INSERT INTO `mac_vod` VALUES('16646','情债','共20集全','qingzhai','Q','','http://photocdn.sohu.com/kis/fengmian/1041/1041418/1041418_ver_big_20161021170003.jpg','http://photocdn.sohu.com/kis/fengmian/1041/1041418/1041418_ver_big_20161021170003.jpg','','李幼斌/周丽华/范丽萍/解洐','康洪雷','房地产公司,初恋情人,生意场,死对头,建筑','共20集全','大陆','国语','1995','12','',',441,','0','0','0','0','0','0','0','0','267143','0','0','0','0','0','0','10.0','0','334','1481692004','1482341117','0','0','“天堂”房地产公司的老总林世雍，与“胜天”房地产公司老总马仁俊，可谓一对生意场上的死对头。林世雍的妻子余丽洁，二十年前曾是马仁俊的初恋情人，由于各种原因，余丽洁后来不得不委身于林世雍。二十年后，当初的建筑小工马仁俊成长为财大气粗的建筑商，怀着向林世雍报仇雪耻并一争天下的雄心，从沿海地区重新杀回了内地。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161101/n472026244.shtml#第2集$http://tv.sohu.com/20161101/n472026252.shtml#第3集$http://tv.sohu.com/20161101/n472026258.shtml#第4集$http://tv.sohu.com/20161101/n472026267.shtml#第5集$http://tv.sohu.com/20161101/n472026272.shtml#第6集$http://tv.sohu.com/20161101/n472026279.shtml#第7集$http://tv.sohu.com/20161101/n472026291.shtml#第8集$http://tv.sohu.com/20161101/n472026293.shtml#第9集$http://tv.sohu.com/20161101/n472026313.shtml#第10集$http://tv.sohu.com/20161101/n472026334.shtml#第11集$http://tv.sohu.com/20161101/n472026344.shtml#第12集$http://tv.sohu.com/20161101/n472026353.shtml#第13集$http://tv.sohu.com/20161101/n472026374.shtml#第14集$http://tv.sohu.com/20161101/n472026394.shtml#第15集$http://tv.sohu.com/20161101/n472026416.shtml#第16集$http://tv.sohu.com/20161101/n472026428.shtml#第17集$http://tv.sohu.com/20161101/n472026467.shtml#第18集$http://tv.sohu.com/20161101/n472026487.shtml#第19集$http://tv.sohu.com/20161101/n472026501.shtml#第20集$http://tv.sohu.com/20161101/n472026525.shtml$$$01$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/r0021dthik1.html#02$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/b0021qx6yab.html#03$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/y0021ggxbjp.html#04$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/l0021j6nl2w.html#05$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/b0021gd1zzz.html#06$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/d0021g5rsgh.html#07$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/k0021g5vid2.html#08$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/g00217le52b.html#09$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/c0021p72lqs.html#10$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/w00210htddi.html#11$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/q0021f7h1wu.html#12$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/s0021twoyc5.html#13$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/w00213cch9o.html#14$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/x0021a2dd7q.html#15$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/k0021e5uxvl.html#16$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/j0021s0r4h5.html#17$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/n00215q33mi.html#18$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/e0021g6w9ec.html#19$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/o0021yo1up9.html#20$http://v.qq.com/x/cover/s7gl6r5u0rvdq02/d00217z59aa.html','','','','');
INSERT INTO `mac_vod` VALUES('16647','绿野艳阳红','共24集全','lvyeyanyanghong','L','','http://photocdn.sohu.com/kis/fengmian/1097/1097843/1097843_ver_big_20161023192502.jpg','http://photocdn.sohu.com/kis/fengmian/1097/1097843/1097843_ver_big_20161023192502.jpg','','赵毅/陈小艺/孙维民/柏青/李玉峰','黄力加','玉米深加工,知识分子,明争暗斗,命悬一线,银行贷款','共24集全','大陆','国语','2006','12','',',447,','0','0','0','0','0','0','0','0','209586','0','0','0','0','0','0','4.0','0','499','1481692004','1482341121','0','0','老支书刘茂福即将退休，支部书记的人选成为众村民及乡村干部关注的焦点。经过村干部米粮、曲元宝等人明争暗斗之后，当选的竟然是一位农家妇女—谷雨。众人惊讶之余，也不免为她担忧：“女人不压茬，母鸡不打鸣”，一个女人当村长，行么？谷雨的想法很简单，她就是要解决周边农民卖粮难问题。她虚心接受了“知识分子”夏诗朋的意见，学着“用工业思维考虑农业问题”。她决定办工厂，搞玉米深加工。谷雨以村里一片树林作抵押向银行贷款，办起了柠檬酸厂。但这片树林是鸡鸣甸的“家底儿”，是刘茂福等一些老人的精神家园。伴随着试车失败、产品滞销、事故频发等一系列问题的出现，村民们对谷雨从不理解发展到了行为抵触。婚姻面临崩溃，工厂命悬一线，村民又不理解，谷雨在多重压力下苦苦坚持着。然而，坚强的谷雨还是挺过来了，柠檬酸厂的生产与营销渐渐步入正轨，谷雨又有了进一步发展的大计划。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161102/n472116613.shtml#第2集$http://tv.sohu.com/20161102/n472116622.shtml#第3集$http://tv.sohu.com/20161102/n472116629.shtml#第4集$http://tv.sohu.com/20161102/n472116632.shtml#第5集$http://tv.sohu.com/20161102/n472116637.shtml#第6集$http://tv.sohu.com/20161102/n472116641.shtml#第7集$http://tv.sohu.com/20161102/n472116645.shtml#第8集$http://tv.sohu.com/20161102/n472116651.shtml#第9集$http://tv.sohu.com/20161102/n472116657.shtml#第10集$http://tv.sohu.com/20161102/n472116664.shtml#第11集$http://tv.sohu.com/20161102/n472116673.shtml#第12集$http://tv.sohu.com/20161102/n472116684.shtml#第13集$http://tv.sohu.com/20161102/n472116692.shtml#第14集$http://tv.sohu.com/20161102/n472116700.shtml#第15集$http://tv.sohu.com/20161102/n472116711.shtml#第16集$http://tv.sohu.com/20161102/n472116722.shtml#第17集$http://tv.sohu.com/20161102/n472116728.shtml#第18集$http://tv.sohu.com/20161102/n472116737.shtml#第19集$http://tv.sohu.com/20161102/n472116744.shtml#第20集$http://tv.sohu.com/20161102/n472116752.shtml#第21集$http://tv.sohu.com/20161102/n472116758.shtml#第22集$http://tv.sohu.com/20161102/n472116768.shtml#第23集$http://tv.sohu.com/20161102/n472116780.s