INSERT INTO `mac_vod` VALUES('16648','英雄无名','共26集全','yingxiongwuming','Y','','http://photocdn.sohu.com/kis/fengmian/52/52037/52037_ver_big_20161021154517.jpg','http://photocdn.sohu.com/kis/fengmian/52/52037/52037_ver_big_20161021154517.jpg','','唐国强/夏凡/刘劲/邵汶/陶飞霏','毛卫宁','皖南事变,外交部,反法西斯,美国政府,蒋介石','共26集全','大陆','国语','2008','12','',',423,','0','0','0','0','0','0','0','0','523649','0','0','0','0','0','0','6.0','0','60','1481692004','1482341122','0','0','《英雄无名》首次揭秘了我党隐蔽战线的传奇人物、战略情报家阎宝航同志鲜为人知的事迹。张学良的高级幕僚和挚友，曾经是蒋介石和宋美龄身边的红人，“新生活运动”的副总干事，阎宝航官至国民政府军事委员会政治部少将。然而，这个“虔诚的基督徒”，军统局长戴笠和中统局长徐恩增的朋友，却是由周恩来亲自介绍入党发展的“红色大间谍”。周恩来交给阎宝航的任务，是利用自己在国民党高层的职位和人脉关系，暗中为延安和共产国际收集国际战略情报。1941年的重庆，是国际反法西斯战场的东方中心。也正是在这个风云际会的战时中国临时首都，阎宝航利用自己的关系，周旋于国民党政府核心和美国，英国，日本和德国等国的外交圈子，以高超的技巧和过人的胆识，领导自己的情报小组开始了一场表面似乎波澜不兴，却惊心动魄的间谍战。“皖南事变”爆发，为了配合党中央对国民党顽固派的斗争和维护抗日统一战线的策略，阎宝航暗地里周旋于国民政府外交部，为美国政府特使和周恩来会见创造了条件，从而为中共反击国民党的反共高潮做出了贡献。而在此时，阎宝航情报小组的电台却进入了军统的监测范围。军统局长戴笠命令军统少将特派员谭文强负责调查电台信号。谭文强展开调查后，很快就锁定阎宝航，认为他与电台之间存在联系，遂将阎宝航作为了自己的头号对手，试图通过电台侦破将阎宝航小组一举摧毁。阎宝航通过自己的渠道得知，德国纳粹元首希特勒亲自接见了国民党驻德国大使馆武官桂永清，而且桂永清和两名德国情报官员随后秘密回到了重庆。综合多方面的情报和自己的分析，阎宝航认定桂永清给蒋介石带回了极为重要的绝密情报。在得到红岩村的指令后，阎宝航一边对付军统特务和卫戍司令部宪兵对自己的监视和调查，一边针对桂永清回国开始寻找情报获取的突破口。为了转移军统的视线，阎宝航将自己所获得的日本间谍何康的线索同时透露给戴笠和徐恩增，在军统和中统之间形成互不相让的“狗咬狗”局面。与此同时，他机敏地同德国驻华使馆武官拉上关系，进一步得知纳粹德国将在夏天有重大军事动向。终于，在一次规格极高的酒宴上，阎宝航从国民党高层探听到一个惊天动地的消息：德国纳粹决定在6月20日左右对苏联发动闪电战，也就是属于纳粹统帅部最高机密的所谓“巴巴罗萨计划”。阎宝航惊险地摆脱了军统特务对自己的跟踪，让情报小组的两个秘密电台同时发报，将这一震惊世界的重大战略情报告知了延安和苏联驻华使馆。苏联红军在得到阎宝航情报之后，采取了及时的应急措施，才使得纳粹军队的闪电战未能完全奏效。而因为及时提供了这个至关重要的情报，斯大林和苏共中央专门给中共发报表示感谢……由于“巴巴罗萨计划”的泄漏，表面与阎宝航打得火热、暗中却一直怀疑他身份的戴笠下决心要找到证据置阎宝航于死地。他指派负责阎宝航专案的谭文强针对那次酒宴和阎宝航前后的活动，对阎宝航进行暗中调查，并派特务打入阎宝航家，对之进行秘密监视。在此过程中，与阎宝航小组有关联的中共地下组织人员突然被军统抓捕，其中一人叛变，阎宝航小组又一次面临生死存亡的抉择。仔细分析局势之后，阎宝航拒绝了周恩来让其撤离重庆的指示，决定与特务机关周旋，冒险继续留在重庆搜集情报。1941年底，在红岩村的指示下，阎宝航把军统刚刚成立的特种技术研究室作为目标，通过政治手段将特种技术研究室的头目拉入自己的圈子，并通过此人获得了另一个极为重大的战略情报：日军航空部队在三本五十六大将的指挥下，将于12月初针对美军太平洋舰队发动突然袭击。与此同时，军统少将谭文强对阎宝航的调查也逐渐深入，几乎就要获得有关阎宝航的关键证据，将他和他的小组一网打尽。阎宝航再次利用自己跟国民党高层的关系，营救了被捕的同志，粉碎了戴笠的阴谋和谭文强针对自己的暗杀计划，将日军偷袭珍珠港的战略情报报告了延安。1945年，纳粹投降，欧战结束，国际反法西斯战场的重心转移到东方。苏联方面电告中共，希望获得有关日军关东军的情报。阎宝航在接受这个重要任务之后，动用自己在美军和军统、政府中的关系，终于了解到军令部三厅有一批极为详细的日本关东军布防情报。他通过自己和宋美龄的关系，得到了政治部部长陈诚的授权，再利用自己和军统以及三厅领导共同的东北背景，以研究东北情况为名接近了这批情报。然而，几年前调查失败之后一直耿耿于怀的谭文强却在此时又发现了阎宝航的活动，并针对他开始了新一轮的铤而走险。就在阎宝航将这份极有价值的情报拿到手的同时，谭文强的枪口也对准了他。千钧一发之际，一直潜伏在军统暗中保护阎宝航的我地下情报人员将谭文强击毙，阎宝航终于脱身，将这份情报交付党中央。而为了掩护阎宝航，我地下情报人员壮烈牺牲。由于阎宝航获得的关东军布防的详细情报，苏联红军出兵东北，以摧枯拉朽之势彻底打败了日本关东军，第二次世界大战终于落下帷幕。阎宝航获得三大战略情报，使其成为中共情报史上的一座辉煌的丰碑，对世界反法西斯战争的总体格局发挥了重要作用，由此在1995年得到了俄罗斯政府的正式表彰。而这位“红色大间谍”的身份和功绩，也才在半个世纪之后为人所知。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161102/n472118686.shtml#第2集$http://tv.sohu.com/20161102/n472118694.shtml#第3集$http://tv.sohu.com/20161102/n472118701.shtml#第4集$http://tv.sohu.com/20161102/n472118704.shtml#第5集$http://tv.sohu.com/20161102/n472118706.shtml#第6集$http://tv.sohu.com/20161102/n472118708.shtml#第7集$http://tv.sohu.com/20161102/n472118711.shtml#第8集$http://tv.sohu.com/20161102/n472118713.shtml#第9集$http://tv.sohu.com/20161102/n472118717.shtml#第10集$http://tv.sohu.com/20161102/n472118719.shtml#第11集$http://tv.sohu.com/20161102/n472118724.shtml#第12集$http://tv.sohu.com/20161102/n472118727.shtml#第13集$http://tv.sohu.com/20161102/n472118734.shtml#第14集$http://tv.sohu.com/20161102/n472118749.shtml#第15集$http://tv.sohu.com/20161102/n472118763.shtml#第16集$http://tv.sohu.com/20161102/n472118780.shtml#第17集$http://tv.sohu.com/20161102/n472118789.shtml#第18集$http://tv.sohu.com/20161102/n472118799.shtml#第19集$http://tv.sohu.com/20161102/n472118808.shtml#第20集$http://tv.sohu.com/20161102/n472118815.shtml#第21集$http://tv.sohu.com/20161102/n472118822.shtml#第22集$http://tv.sohu.com/20161102/n472118830.shtml#第23集$http://tv.sohu.com/20161102/n472118842.shtml#第24集$http://tv.sohu.com/20161102/n472118860.shtml#第25集$http://tv.sohu.com/20161102/n472118872.shtml#第26集$http://tv.sohu.com/20161102/n472118884.shtml$$$01$http://v.qq.com/x/cover/727rfvdy456zlue/l00210xbl3e.html#02$http://v.qq.com/x/cover/727rfvdy456zlue/u00214c7slm.html#03$http://v.qq.com/x/cover/727rfvdy456zlue/q0021s9qs6s.html#0