INSERT INTO `mac_vod` VALUES('16649','今世迷情','共18集全','jinshimiqing','J','','http://photocdn.sohu.com/kis/fengmian/1043/1043660/1043660_ver_big_20161021154503.jpg','http://photocdn.sohu.com/kis/fengmian/1043/1043660/1043660_ver_big_20161021154503.jpg','','张志忠/丁梦雨/陈婷/高强','王连平','泰国,离家出走','共18集全','大陆','国语','1999','12','',',377,','0','0','0','0','0','0','0','0','919494','0','0','0','0','0','0','3.0','0','161','1481692005','1482341116','0','0','三个涉世不深的少女离家出走，被蛇头骗到泰国，从此走上了一条惊心动魄的危险之路，历经艰辛的磨难，增强了三个少女对祖国对家庭的眷恋和热爱，悟出生命的真谛，最终踏上了回家之路。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161101/n472024540.shtml#第2集$http://tv.sohu.com/20161101/n472024557.shtml#第3集$http://tv.sohu.com/20161101/n472024562.shtml#第4集$http://tv.sohu.com/20161101/n472024566.shtml#第5集$http://tv.sohu.com/20161101/n472024570.shtml#第6集$http://tv.sohu.com/20161101/n472024574.shtml#第7集$http://tv.sohu.com/20161101/n472024580.shtml#第8集$http://tv.sohu.com/20161101/n472024586.shtml#第9集$http://tv.sohu.com/20161101/n472024594.shtml#第10集$http://tv.sohu.com/20161101/n472024599.shtml#第11集$http://tv.sohu.com/20161101/n472024607.shtml#第12集$http://tv.sohu.com/20161101/n472024612.shtml#第13集$http://tv.sohu.com/20161101/n472024617.shtml#第14集$http://tv.sohu.com/20161101/n472024623.shtml#第15集$http://tv.sohu.com/20161101/n472024629.shtml#第16集$http://tv.sohu.com/20161101/n472024632.shtml#第17集$http://tv.sohu.com/20161101/n472024640.shtml#第18集$http://tv.sohu.com/20161101/n472024646.shtml$$$01$http://v.qq.com/x/cover/w1k6sxejqzl096d/n0021ycrvn1.html#02$http://v.qq.com/x/cover/w1k6sxejqzl096d/o00213alqu3.html#03$http://v.qq.com/x/cover/w1k6sxejqzl096d/x00216rg3g7.html#04$http://v.qq.com/x/cover/w1k6sxejqzl096d/b0021e1616h.html#05$http://v.qq.com/x/cover/w1k6sxejqzl096d/y0021xy9y5b.html#06$http://v.qq.com/x/cover/w1k6sxejqzl096d/n002148t597.html#07$http://v.qq.com/x/cover/w1k6sxejqzl096d/s0021n5d0ry.html#08$http://v.qq.com/x/cover/w1k6sxejqzl096d/r0021c3aecl.html#09$http://v.qq.com/x/cover/w1k6sxejqzl096d/w0021u8nsrb.html#10$http://v.q