INSERT INTO `mac_vod` VALUES('16650','情感阴谋','共20集全','qingganyinmou','Q','','http://photocdn.sohu.com/kis/fengmian/90/90202/90202_ver_big_20161021172503.jpg','http://photocdn.sohu.com/kis/fengmian/90/90202/90202_ver_big_20161021172503.jpg','','王姬/高曙光','陈应岐','美国留学,上海,情感,哥哥,经理','共20集全','大陆','国语','2000','12','',',62,','0','0','0','0','0','0','0','0','836260','0','0','0','0','0','0','7.0','0','450','1481692005','1482341120','0','0','《情感阴谋》起始于一场悲剧：来自他乡的民营公司老板李楠山，不知何故突然跳楼身亡，他在美国留学的弟弟李楠风闻讯后匆匆回到上海，从嫂子陈悦处得知哥哥的惨死是一个叫林知秋的女经理逼迫的。于是，他改名换姓，混入林知秋的公司，卧薪尝胆，伺机为兄报仇。可是，在他一步步铲除了复仇之路上的障碍后，却不知不觉爱上了“仇人”，李楠风陷入痛苦彷徨之中。此时，“神秘人物”周天成道破了他的秘密，并且以此要挟李楠风协助他吞并林知秋的公司。在林知秋破产之际，李楠风才发现自己陷入了一个更大的阴谋。','sohu','','','第1集$http://tv.sohu.com/20161102/n472116319.shtml#第2集$http://tv.sohu.com/20161102/n472116333.shtml#第3集$http://tv.sohu.com/20161102/n472116338.shtml#第4集$http://tv.sohu.com/20161102/n472116345.shtml#第5集$http://tv.sohu.com/20161102/n472116350.shtml#第6集$http://tv.sohu.com/20161102/n472116357.shtml#第7集$http://tv.sohu.com/20161102/n472116361.shtml#第8集$http://tv.sohu.com/20161102/n472116365.shtml#第9集$http://tv.sohu.com/20161102/n472116373.shtml#第10集$http://tv.sohu.com/20161102/n472116379.shtml#第11集$http://tv.sohu.com/20161102/n472116382.shtml#第12集$http://tv.sohu.com/20161102/n472116391.shtml#第13集$http://tv.sohu.com/20161102/n472116396.shtml#第14集$http://tv.sohu.com/20161102/n472116403.shtml#第15集$http://tv.sohu.com/20161102/n472116408.shtml#第16集$http://tv.sohu.com/20161102/n472116413.shtml#第17集$http://tv.sohu.com/20161102/n472116416.shtml#第18集$http://tv.sohu.com/20161102/n472116419.shtml#第19集$http://tv.sohu.com/20161102/n472116424.shtml#第20集$http://tv.sohu.com/20161102/n472116429.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16651','绝地逢生','共20集全','juedifengsheng','J','','http://photocdn.sohu.com/kis/fengmian/192/192017/192017_ver_big_20161021161005.jpg','http://photocdn.sohu.com/kis/fengmian/192/192017/192017_ver_big_20161021161005.jpg','','杜源/童蕾/党昊/何苗/石小满','胡琤','科学发展观,电视剧,贵州省,改革开放,人与自然','共20集全','大陆','国语','2009','12','',',441,','0','0','0','0','0','0','0','0','980639','0','0','0','0','0','0','5.0','0','18','1481692005','1482341121','0','0','电视剧《绝处逢生》是一部反应我国农村改革开放三十年发展历程，阐释“科学发展观”重大意义的电视剧。取材于我国贵州省的乌蒙山区，这里山多地少是我国石漠化最严重的地区，长期以来党和国家在这里倾注了大量的人力、物力、财力。一次次的救济和扶贫，对这里的复生一直收效甚微；最终还是在“科学发展观”的指导下，才使当地居民探寻到一条人与自然和谐发展的道路，摆脱了穷困的命运。','sohu','','','第1集$http://tv.sohu.com/20161102/n472118485.shtml#第2集$http://tv.sohu.com/20161102/n472118490.shtml#第3集$http://tv.sohu.com/20161102/n472118494.shtml#第4集$http://tv.sohu.com/20161102/n472118498.shtml#第5集$http://tv.sohu.com/20161102/n472118501.shtml#第6集$http://tv.sohu.com/20161102/n472118507.shtml#第7集$http://tv.sohu.com/20161102/n472118510.shtml#第8集$http://tv.sohu.com/20161102/n472118513.shtml#第9集$http://tv.sohu.com/20161102/n472118518.shtml#第10集$http://tv.sohu.com/20161102/n472118521.shtml#第11集$http://tv.sohu.com/20161102/n472118524.shtml#第12集$http://tv.sohu.com/20161102/n472118528.shtml#第13集$http://tv.sohu.com/20161102/n472118530.shtml#第14集$http://tv.sohu.com/20161102/n472118540.shtml#第15集$http://tv.sohu.com/20161102/n472118546.shtml#第16集$http://tv.sohu.com/20161102/n472118548.shtml#第17集$http://tv.sohu.com/20161102/n472118553.shtml#第18集$http://tv.sohu.com/20161102/n472118561.shtml#第19集$http://tv.sohu.com/20161102/n472118570.shtml#第20集$http://tv.sohu.com/20161102/n472118574.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16652','惠安女','共15集全','huiannv','H','','http://photocdn.sohu.com/kis/fengmian/1099/1099142/1099142_ver_big_20161021153003.jpg','http://photocdn.sohu.com/kis/fengmian/1099/1099142/1099142_ver_big_20161021153003.jpg','','奚美娟/林芳兵/邵峰/周贤珍','苏舟','电视剧,集体自杀,惠安女,大时代,娃娃亲','共15集全','大陆','国语','1999','12','',',390,','0','0','0','0','0','0','0','0','229926','0','0','0','0','0','0','2.0','0','127','1481692005','1482341115','0','0','电视剧《惠安女》在大时代变迁的背景下讲述了几位惠安女性的生活悲欢与身世沉浮。惠安女有订娃娃亲、早婚、不落夫家和集体自杀的独特习俗，以其特殊的环境、特殊的服饰、特殊的婚俗习惯,呈现了惠安女这一特殊群体因循的习俗和现代生活浪潮变革的碰撞与蜕化，剧中的三位惠安女阿月、阿花、阿菜既背负着历史的重担，又怀抱着未来的期望。主人公阿月童年时便父母双亡，偏又遭遇婚姻不幸。后来凭藉着自己的勤劳品格与刚强意志，在大家的关爱和鼓励下，在改革开放的春风里，拼搏致富，在经历一次次的艰难挫折之后，终于获得了事业上的成功。','sohu','','','第1集$http://tv.sohu.com/20161101/n472023267.shtml#第2集$http://tv.sohu.com/20161101/n472023274.shtml#第3集$http://tv.sohu.com/20161101/n472023292.shtml#第4集$http://tv.sohu.com/20161101/n472023297.shtml#第5集$http://tv.sohu.com/20161101/n472023307.shtml#第6集$http://tv.sohu.com/20161101/n472023312.shtml#第7集$http://tv.sohu.com/20161101/n472023318.shtml#第8集$http://tv.sohu.com/20161101/n472023330.shtml#第9集$http://tv.sohu.com/20161101/n472023346.shtml#第10集$http://tv.sohu.com/20161101/n472023354.shtml#第11集$http://tv.sohu.com/20161101/n472023361.shtml#第12集$http://tv.sohu.com/20161101/n472023383.shtml#第13集$http://tv.sohu.com/20161101/n472023386.shtml#第14集$http://tv.sohu.com/20161101/n472023393.shtml#第15集$http://tv.sohu.com/20161101/n472023411.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16653','日出东方','共20集全','richudongfang','R','','http://photocdn.sohu.com/kis/fengmian/81/81298/81298_ver_big_20161021162010.jpg','http://photocdn.sohu.com/kis/fengmian/81/81298/81298_ver_big_20161021162010.jpg','','王霙/宋凯/孔祥玉/洪亮/孙继堂','王进/马润生','天安门广场,五四运动,共产主义,社会主义,世界大战','共20集全','大陆','国语','2001','12','',',388,','0','0','0','0','0','0','0','0','854138','0','0','0','0','0','0','3.0','0','128','1481692005','1482341120','0','0','1919年4月第一次世界大战结束，在战胜国召开的“巴黎和会”上，北洋军阀政府外交官丧权辱国的消息传回国内，北大的师生们愤怒了，5月4日在天安门广场游行示威，遭到武装军警的镇压,大批学生被逮捕。北京的学生们在悲愤之下，奔走天津、长沙、上海等全国各地演讲，抗议政府的暴行，“五四运动”的烈焰迅速传遍全国。五四运动后，社会主义学说成为新思潮的主流，吸引了一大批先进青年，在李大钊和陈独秀的推动和大力宣传下，马克思主义的介绍与宣传进入了一个新的阶段。李大钊、陈独秀与共产国际的代表威金斯基多次交谈后，决定立即组建上海的共产党组织。1920年8月22日，在陈独秀的主持下，中国第一个共产主义小组在上海诞生。接着，在北京、湖南、武汉、广东、山东相继成立了共产主义小组。','sohu','','','第1集$http://tv.sohu.com/20161102/n472104307.shtml#第2集$http://tv.sohu.com/20161102/n472104313.shtml#第3集$http://tv.sohu.com/20161102/n472104319.shtml#第4集$http://tv.sohu.com/20161102/n472104325.shtml#第5集$http://tv.sohu.com/20161102/n472104331.shtml#第6集$http://tv.sohu.com/20161102/n472104334.shtml#第7集$http://tv.sohu.com/20161102/n472104336.shtml#第8集$http://tv.sohu.com/20161102/n472104340.shtml#第9集$http://tv.sohu.com/20161102/n472104344.shtml#第10集$http://tv.sohu.com/20161102/n472104354.shtml#第11集$http://tv.sohu.com/20161102/n472104366.shtml#第12集$http://tv.sohu.com/20161102/n472104372.shtml#第13集$http://tv.sohu.com/20161102/n472104381.shtml#第14集$http://tv.sohu.com/20161102/n472104392.shtml#第15集$http://tv.sohu.com/20161102/n472104399.shtml#第16集$http://tv.sohu.com/20161102/n472104406.shtml#第17集$http://tv.sohu.com/20161102/n472104413.shtml#第18集$http://tv.sohu.com/20161102/n472104421.shtml#第19集$http://tv.sohu.com/20161102/n472104429.shtml#第20集$http://tv.sohu.com/20161102/n472104435.shtml','','','','');
INSERT INTO `mac_vod` VALUES('20597','赛末点','','saimodian','S','','http://puui.qpic.cn/vcover_vt_pic/0/fa4ks9e0lfzgi9kt1468555269.jpg/220','http://puui.qpic.cn/vcover_vt_pic/0/fa4ks9e0lfzgi9kt1468555269.jpg/220','','乔纳森·莱斯·梅耶斯/斯嘉丽·约翰逊/马修·古迪','伍迪·艾伦','','腾讯高清','英国','英语','0','1','',',1543,','0','0','0','0','0','0','0','0','227347','0','0','0','0','0','0','9.0','0','229','1481777312','1482347650','0','0','穷小子威尔顿（乔纳森o莱斯o迈勒斯）为改变自己的命运，从爱尔兰来到伦敦当起网球教练，立誓要凭一身网球绝技混入对该运动情有独钟的上流社会。结识富家公子哥汤姆后，他得到机会，对方的妹妹克罗伊（艾米莉o莫蒂梅尔）对他一见钟情，其后，在对方的父亲的相助下，威尔顿顺利混入上流社会。\n正当要与克罗伊谈婚论嫁时，威尔顿邂逅汤姆的女友、来自美国的女演员诺拉（斯嘉丽o约翰逊），后者同样在为进入上流社会做着不懈的努力。相似经历令两人萌生真情，但威尔顿并没为诺拉放弃自己的计划。一切梦想都成真后，威尔顿重遇已与汤姆分手的诺拉，两人旧情复燃，威尔顿开始在她与妻子之间周旋。不久，诺拉怀孕坚拒堕胎，威尔顿迎来人生的赛点。\n        ','qq','','','腾讯高清$http://v.qq.com/x/cover/fa4ks9e0lfzgi9k/z00209tpibq.html','','','','');
INSERT INTO `mac_vod` VALUES('16654','中华英豪','共30集全','zhonghuayinghao','Z','','http://photocdn.sohu.com/kis/fengmian/63/63448/63448_ver_big_20161021155516.jpg','http://photocdn.sohu.com/kis/fengmian/63/63448/63448_ver_big_20161021155516.jpg','','修庆/曹颖/邵兵/陶虹/田少军','范秀明','孙中山,中华英豪,紫禁城,袁世凯,清政府','共30集全','大陆','国语','2000','12','',',409,','0','0','0','0','0','0','0','0','532348','0','0','0','0','0','0','5.0','0','149','1481692006','1482341115','0','0','神秘莫测的“自然门”武功传人—杜心武。为了好友谭嗣同的牺牲毅然独闯紫禁城，刹杀误国秧民的慈嬉太后，而遭到清廷追辑被迫逃亡日本并结识了孙中山等革命志士，从此投身革命，成为孙中山的保镖，共同奔走海内外，鼓动革命。为了保护革命经费，他击败日本武术第一高手，为了推翻腐败的满清政府，他随宋教仁先后收服了东北马贼，策反新军，打响了武昌革命第一枪。为了维护共和，他不惜冒生命危险，刹杀妄想恢复帝制的袁世凯，这些脍炙人口的英雄事迹，永远为后人传颂。','sohu','','','第1集$http://tv.sohu.com/20161101/n472013208.shtml#第2集$http://tv.sohu.com/20161101/n472013212.shtml#第3集$http://tv.sohu.com/20161101/n472013218.shtml#第4集$http://tv.sohu.com/20161101/n472013230.shtml#第5集$http://tv.sohu.com/20161101/n472013236.shtml#第6集$http://tv.sohu.com/20161101/n472013248.shtml#第7集$http://tv.sohu.com/20161101/n472013258.shtml#第8集$http://tv.sohu.com/20161101/n472013267.shtml#第9集$http://tv.sohu.com/20161101/n472013277.shtml#第10集$http://tv.sohu.com/20161101/n472013282.shtml#第11集$http://tv.sohu.com/20161101/n472013286.shtml#第12集$http://tv.sohu.com/20161101/n472013292.shtml#第13集$http://tv.sohu.com/20161101/n472013299.shtml#第14集$http://tv.sohu.com/20161101/n472013306.shtml#第15集$http://tv.sohu.com/20161101/n472013313.shtml#第16集$http://tv.sohu.com/20161101/n472013323.shtml#第17集$http://tv.sohu.com/20161101/n472013328.shtml#第18集$http://tv.sohu.com/20161101/n472013331.shtml#第19集$http://tv.sohu.com/20161101/n472013340.shtml#第20集$http://tv.sohu.com/20161101/n472013356.shtml#第21集$http://tv.sohu.com/20161101/n472013363.shtml#第22集$http://tv.sohu.com/20161101/n472013373.shtml#第23集$http://tv.sohu.com/20161101/n472013383.shtml#第24集$http://tv.sohu.com/20161101/n472013391.shtml#第25集$http://tv.sohu.com/20161101/n472013401.shtml#第26集$http://tv.sohu.com/20161101/n472013415.shtml#第27集$http://tv.sohu.com/2016