INSERT INTO `mac_vod` VALUES('20600','男狐聊斋','','nanhuliaozhai','N','','http://puui.qpic.cn/vcover_vt_pic/0/o259zfwvhkvl3oit1476963071.jpg/220','http://puui.qpic.cn/vcover_vt_pic/0/o259zfwvhkvl3oit1476963071.jpg/220','','叶小开/何其炜/朱丽岚','李遥波','一见钟情,杂货铺,男男女女,聊斋,故事','腾讯高清','内地','国语','0','1','',',1547,','0','0','0','0','5','0','0','0','720615','0','0','0','0','0','0','10.0','0','199','1481777315','1482347653','0','0','与《聊斋》原著相同，故事一开始便是书生刘子固对杂货铺卖扇女阿绣一见钟情。暗恋阿绣的刘子固与阿绣以扇面上的画相交，这一切都被修炼成人形下山游玩的狐仙看在了眼里，而这个狐仙却跟原著不同，他是一只男狐仙！狐仙初涉红尘，觉得人间男男女女相知相恋甚是好玩，便想也来体味一番。于是化作人形，时而变为一风流俊俏的小公子名唤秀郎，与书生刘子固把酒言欢相见恨晚结为异姓兄弟；时而变为一女子与阿绣一模一样，假阿绣与刘子固山盟海誓神仙眷侣。不料却被拆穿，而刘子固却陷入了两难的抉择??\n        ','qq$$$ykyun','$$$','$$$','腾讯高清$http://v.qq.com/x/cover/o259zfwvhkvl3oi/s0022ilj5dm.html$$$BD$CODc2MzE4MA==','','','','');
INSERT INTO `mac_vod` VALUES('16655','文化站长','共26集全','wenhuazhanchang','W','','http://photocdn.sohu.com/kis/fengmian/205/205878/205878_ver_big_20161021161503.jpg','http://photocdn.sohu.com/kis/fengmian/205/205878/205878_ver_big_20161021161503.jpg','','李静/马恩然/林永健/雷恪生/王志飞','余淳','电视剧,社会主义,文化生活,现实生活,轻喜剧','共26集全','大陆','国语','2007','12','',',398,','0','0','0','0','0','0','0','0','72939','0','0','0','0','0','0','6.0','0','291','1481692006','1482341120','0','0','电视剧《文化站长》原名《文化站长管文化》是一部反映当代乡村文化生活的幽默型轻喜剧，本剧描写的是在创建社会主义新农村，构建和谐社会的热潮中，发生在我国北方农村--北留乡和相府村中的一系列文化趣事。通过乡文化站站长管文化这个小人物的形象展开生动、活泼的故事情节，展示当代农村的现实生活。北留乡文化站长管文化是本乡相府村中的一名老文化人，靠自己的文化实力当上了乡文化站长，从此也雄心勃勃地干起了文化大事业。然而，他并不懂得为官之道。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161102/n472118329.shtml#第2集$http://tv.sohu.com/20161102/n472118334.shtml#第3集$http://tv.sohu.com/20161102/n472118336.shtml#第4集$http://tv.sohu.com/20161102/n472118339.shtml#第5集$http://tv.sohu.com/20161102/n472118343.shtml#第6集$http://tv.sohu.com/20161102/n472118348.shtml#第7集$http://tv.sohu.com/20161102/n472118355.shtml#第8集$http://tv.sohu.com/20161102/n472118364.shtml#第9集$http://tv.sohu.com/20161102/n472118372.shtml#第10集$http://tv.sohu.com/20161102/n472118377.shtml#第11集$http://tv.sohu.com/20161102/n472118380.shtml#第12集$http://tv.sohu.com/20161102/n472118383.shtml#第13集$http://tv.sohu.com/20161102/n472118385.shtml#第14集$http://tv.sohu.com/20161102/n472118389.shtml#第15集$http://tv.sohu.com/20161102/n472118395.shtml#第16集$http://tv.sohu.com/20161102/n472118398.shtml#第17集$http://tv.sohu.com/20161102/n472118401.shtml#第18集$http://tv.sohu.com/20161102/n472118410.shtml#第19集$http://tv.sohu.com/20161102/n472118415.shtml#第20集$http://tv.sohu.com/20161102/n472118421.shtml#第21集$http://tv.sohu.com/20161102/n472118427.shtml#第22集$http://tv.sohu.com/20161102/n472118435.shtml#第23集$http://tv.sohu.com/20161102/n472118442.shtml#第24集$http://tv.sohu.com/20161102/n472118450.shtml#第25集$http://tv.sohu.com/20161102/n472118455.shtml#第26集$http://tv.sohu.com/20161102/n472118461.shtml$$$01$http://