INSERT INTO `mac_vod` VALUES('16656','心网','共20集全','xinwang','X','','http://photocdn.sohu.com/kis/fengmian/39/39448/39448_ver_big_20161021160503.jpg','http://photocdn.sohu.com/kis/fengmian/39/39448/39448_ver_big_20161021160503.jpg','','常宽/梅婷/周迅/李志舆/严屹宽','刘婷','私家侦探,红楼,法国','共20集全','大陆','国语','2000','12','',',369,','0','0','0','0','0','0','0','0','489023','0','0','0','0','0','0','7.0','0','29','1481692006','1482341119','0','0','私家侦探马力（常宽饰）受人之托从法国回沪，寻找富商卓越（李志舆饰）失散的女儿卓宁（梅婷饰），助手华葱（满江饰）配合他的工作。马力很快找到卓宁，并融进她生活的圈子，由此了解到卓宁对父亲有很大成见，而母亲乐敏（梅婷饰）的死也与父亲生活不检点有关。马力观察到，卓宁生性活泼可爱，但做事轻率不计后果，他决定对症下药。围绕卓宁母亲临终前留下的一句寻找“海角红楼”，马力展开了深入调查，他发现卓宁竟是其母与卓越结婚前跟他人生的孩子，此人是演员林海棠。其实卓越早知详情，只是身患重疾来日无多，他才托马力借寻女一事告诉她真相。但在此时，马力竟爱上了卓宁，他不想按约定完成卓越所托。','sohu','','','第1集$http://tv.sohu.com/20161102/n472098863.shtml#第2集$http://tv.sohu.com/20161102/n472098884.shtml#第3集$http://tv.sohu.com/20161102/n472098900.shtml#第4集$http://tv.sohu.com/20161102/n472098916.shtml#第5集$http://tv.sohu.com/20161102/n472098938.shtml#第6集$http://tv.sohu.com/20161102/n472098956.shtml#第7集$http://tv.sohu.com/20161102/n472098971.shtml#第8集$http://tv.sohu.com/20161102/n472098994.shtml#第9集$http://tv.sohu.com/20161102/n472099003.shtml#第10集$http://tv.sohu.com/20161102/n472099021.shtml#第11集$http://tv.sohu.com/20161102/n472099029.shtml#第12集$http://tv.sohu.com/20161102/n472099039.shtml#第13集$http://tv.sohu.com/20161102/n472099050.shtml#第14集$http://tv.sohu.com/20161102/n472099064.shtml#第15集$http://tv.sohu.com/20161102/n472099070.shtml#第16集$http://tv.sohu.com/20161102/n472099087.shtml#第17集$http://tv.sohu.com/20161102/n472099097.shtml#第18集$http://tv.sohu.com/20161102/n472099110.shtml#第19集$http://tv.sohu.com/20161102/n472099118.shtml#第20集$http://tv.sohu.com/20161102/n472099125.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16657','文成公主','共20集全','wenchenggongzhu','W','','http://photocdn.sohu.com/kis/fengmian/44/44482/44482_ver_big_20161021154510.jpg','http://photocdn.sohu.com/kis/fengmian/44/44482/44482_ver_big_20161021154510.jpg','','曹颖/仁青顿珠/洪宇宙/张光北/张志忠','蔡晓晴','文成公主,松赞干布,民族团结,唐太宗,大唐','共20集全','大陆','国语','2001','12','',',351,','0','0','0','0','0','0','0','0','643526','0','0','0','0','0','0','5.0','0','336','1481692006','1482341114','0','0','公元7世纪初，正值唐太宗贞观年间。此时，雪域高原的第32代赞普松赞干布(仁青顿珠饰)完成了统一各部族的大业，建立了吐蕃王朝，他派使臣向唐请婚，未得同意。松赞干布武力请婚再次遭到唐太宗(洪宇宙饰)拒绝，他便谴心腹大相禄东赞(张光北饰)再往长安谢罪请婚。唐太宗为松赞干布的诚意感动，但却苦于无适龄女儿出嫁。大唐礼部尚书、江夏郡王李道宗(张志忠饰)之女李雪雁(曹颖饰)是个伶俐活泼、聪颖过人的大家闺秀、宗室之女。在遴选公主时，唐太宗一眼看中雪雁，册封为“文成公主”下嫁吐蕃。文成公主与松赞干布携手，为汉藏民族团结谱写了一首万古流芳的颂歌。','sohu','','','第1集$http://tv.sohu.com/20161101/n472011350.shtml#第2集$http://tv.sohu.com/20161101/n472011360.shtml#第3集$http://tv.sohu.com/20161101/n472011367.shtml#第4集$http://tv.sohu.com/20161101/n472011386.shtml#第5集$http://tv.sohu.com/20161101/n472011408.shtml#第6集$http://tv.sohu.com/20161101/n472011424.shtml#第7集$http://tv.sohu.com/20161101/n472011442.shtml#第8集$http://tv.sohu.com/20161101/n472011461.shtml#第9集$http://tv.sohu.com/20161101/n472011472.shtml#第10集$http://tv.sohu.com/20161101/n472011483.shtml#第11集$http://tv.sohu.com/20161101/n472011502.shtml#第12集$http://tv.sohu.com/20161101/n472011515.shtml#第13集$http://tv.sohu.com/20161101/n472011533.shtml#第14集$http://tv.sohu.com/20161101/n472011550.shtml#第15集$http://tv.sohu.com/20161101/n472011561.shtml#第16集$http://tv.sohu.com/20161101/n472011567.shtml#第17集$http://tv.sohu.com/20161101/n472011573.shtml#第18集$http://tv.sohu.com/20161101/n472011577.shtml#第19集$http://tv.sohu.com/20161101/n472011583.shtml#第20集$http://tv.sohu.com/20161101/n472011597.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16658','福星临门','共24集全','fuxinglinmen','F','','http://photocdn.sohu.com/kis/fengmian/46/46303/46303_ver_big_20161021162003.jpg','http://photocdn.sohu.com/kis/fengmian/46/46303/46303_ver_big_20161021162003.jpg','','王茜华/吴京安/李静/张孝中/贺生伟','许瑞生','新农村建设,眼镜王蛇,大富豪,平安,建筑','共24集全','大陆','国语','2007','12','',',398,','0','0','0','0','0','0','0','0','763019','0','0','0','0','0','0','1.0','0','106','1481692006','1482341120','0','0','为落实中央指示精神，加快新农村建设，济州市委开展“文化下乡，干部包村”工作，抽调大批优秀党员干部下乡包村。剧团副团长杨玉兰（王茜华饰）被派往田村包村，她的任务是协助村委开展“提高农民精神文化素质，以富带贫，共同促进，建设和谐平安的新农村”。原村委主任郭劳顺（张孝中饰）做村妇响八乡的工作时摔得骨折不能工作，他的儿子大富豪郭永谋（吴京安饰）听说他早年的恋人杨玉兰来家乡包村，把自己的建筑公司转给别人，自己回村竞选当上了“临时主任”。田村经济富裕，但村风欠佳。响八乡迷信泼辣好惹事，崔二街疲游手好闲人称“眼镜王蛇”无人敢惹，梅甘石玩世不恭好事不干坏事有余，郭秋奸邪心底自私，杨玉兰面对富裕村里的诸多“精神穷人”，寻找产生矛盾的原因，治愚治穷，在短时间内引导田村人走上了精神和物资双文明的真正的小康之路。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161102/n472118083.shtml#第2集$http://tv.sohu.com/20161102/n472118094.shtml#第3集$http://tv.sohu.com/20161102/n472118105.shtml#第4集$http://tv.sohu.com/20161102/n472118113.shtml#第5集$http://tv.sohu.com/20161102/n472118124.shtml#第6集$http://tv.sohu.com/20161102/n472118135.shtml#第7集$http://tv.sohu.com/20161102/n472118147.shtml#第8集$http://tv.sohu.com/20161102/n472118159.shtml#第9集$http://tv.sohu.com/20161102/n472118171.shtml#第10集$http://tv.sohu.com/20161102/n472118183.shtml#第11集$http://tv.sohu.com/20161102/n472118192.shtml#第12集$http://tv.sohu.com/20161102/n472118199.shtml#第13集$http://tv.sohu.com/20161102/n472118208.shtml#第14集$http://tv.sohu.com/20161102/n472118221.shtml#第15集$http://tv.sohu.com/20161102/n472118229.shtml#第16集$http://tv.sohu.com/20161102/n472118239.shtml#第17集$http://tv.sohu.com/20161102/n472118244.shtml#第18集$http://tv.sohu.com/20161102/n472118251.shtml#第19集$http://tv.sohu.com/20161102/n472118257.shtml#第20集$http://tv.sohu.com/20161102/n472118262.shtml#第21集$http://tv.sohu.com/20161102/n472118272.shtml#第22集$http://tv.sohu.com/20161102/n472118276.shtml#第23集$http://tv.sohu.com/20161102/n472118283.shtml#第24集$http://tv.sohu.com/20161102/n4