INSERT INTO `mac_vod` VALUES('16660','老爸向前冲','','laobaxiangqianchong','L','','http://photocdn.sohu.com/kis/fengmian/53/53167/53167_ver_big_20161021165502.jpg','http://photocdn.sohu.com/kis/fengmian/53/53167/53167_ver_big_20161021165502.jpg','','傅彪/陈龙/原华/倪景阳/郑毓芝','蒋家骏','人到中年,慧聪,财务,经理,情人','正片','大陆','国语','2001','12','',',360,','0','0','0','0','0','0','0','0','578174','0','0','0','0','0','0','5.0','0','83','1481692007','1482352539','0','0','何山（傳彪饰）人到中年，目前是一家超市的经理，由于多年前丧妻，他视女儿乐乐（倪景阳饰）为掌上明珠。年过而立仍未嫁人的慧聪（原华饰）受公司委派来超市主管财务，为了却乐乐劝何山重组家庭的愿望，何山与慧聪草签一份《情人合同》。执行合同伊始，漏洞百出，但总算在亲友面前蒙混过关，由于两人性格南辕北辙，都想尽快从这个可笑的合同中解脱出来。何山整日怕女儿交上什么不良男友，可偏偏家里就出现了一位橫瞧竖看都别扭的男友。慧聪的母亲则为女儿引进了声势浩大的相亲团。为掩人耳目，他俩的合同不断的延期，由于二人心思脱离了工作，超市出现重大问题，两人只好摒弃前嫌，专心“救火”。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161101/n472030863.shtml#第2集$http://tv.sohu.com/20161101/n472030883.shtml#第3集$http://tv.sohu.com/20161101/n472030891.shtml#第4集$http://tv.sohu.com/20161101/n472030898.shtml#第5集$http://tv.sohu.com/20161101/n472030908.shtml#第6集$http://tv.sohu.com/20161101/n472030917.shtml#第7集$http://tv.sohu.com/20161101/n472030924.shtml#第8集$http://tv.sohu.com/20161101/n472030933.shtml#第9集$http://tv.sohu.com/20161101/n472030944.shtml#第10集$http://tv.sohu.com/20161101/n472030948.shtml#第11集$http://tv.sohu.com/20161101/n472030955.shtml#第12集$http://tv.sohu.com/20161101/n472030962.shtml#第13集$http://tv.sohu.com/20161101/n472030968.shtml#第14集$http://tv.sohu.com/20161101/n472030978.shtml#第15集$http://tv.sohu.com/20161101/n472030992.shtml#第16集$http://tv.sohu.com/20161101/n472031002.shtml#第17集$http://tv.sohu.com/20161101/n472031005.shtml#第18集$http://tv.sohu.com/20161101/n472031015.shtml#第19集$http://tv.sohu.com/20161101/n472031027.shtml#第20集$http://tv.sohu.com/20161101/n472031032.shtml#第21集$http://tv.sohu.com/20161101/n472031038.shtml$$$http://v.youku.com/v_show/id_XMTg2NTk5Mzc5Mg==.html','','','','');
INSERT INTO `mac_vod` VALUES('16661','我心换你心','共25集全','woxinhuannixin','W','','http://photocdn.sohu.com/kis/fengmian/85/85560/85560_ver_big_20161021170502.jpg','http://photocdn.sohu.com/kis/fengmian/85/85560/85560_ver_big_20161021170502.jpg','','程前/潘虹/胡军/苏瑾/章申','王南','大都会,港台剧,轻喜剧,男人,青年','共25集全','大陆','国语','2000','12','',',356,','0','0','0','0','0','0','0','0','630560','0','0','0','0','0','0','8.0','0','341','1481692007','1482341124','0','0','25集现代剧《我心换你心》是一部都市轻喜剧，以年轻母亲、富商太太、一对热恋情侣为三条主线，除了表现妇女否极泰来的张力外，主要描绘的大都会青年男人一边吃苦头，一边还懂得自嘲幽默的可敬可爱之处，情节轻松惹笑，让人感到颇有几分港台剧的味道。','sohu','','','第1集$http://tv.sohu.com/20161102/n472117715.shtml#第2集$http://tv.sohu.com/20161102/n472117736.shtml#第3集$http://tv.sohu.com/20161102/n472117749.shtml#第4集$http://tv.sohu.com/20161102/n472117755.shtml#第5集$http://tv.sohu.com/20161102/n472117765.shtml#第6集$http://tv.sohu.com/20161102/n472117778.shtml#第7集$http://tv.sohu.com/20161102/n472117793.shtml#第8集$http://tv.sohu.com/20161102/n472117811.shtml#第9集$http://tv.sohu.com/20161102/n472117826.shtml#第10集$http://tv.sohu.com/20161102/n472117834.shtml#第11集$http://tv.sohu.com/20161102/n472117848.shtml#第12集$http://tv.sohu.com/20161102/n472117856.shtml#第13集$http://tv.sohu.com/20161102/n472117863.shtml#第14集$http://tv.sohu.com/20161102/n472117879.shtml#第15集$http://tv.sohu.com/20161102/n472117893.shtml#第16集$http://tv.sohu.com/20161102/n472117898.shtml#第17集$http://tv.sohu.com/20161102/n472117905.shtml#第18集$http://tv.sohu.com/20161102/n472117916.shtml#第19集$http://tv.sohu.com/20161102/n472117926.shtml#第20集$http://tv.sohu.com/20161102/n472117970.shtml#第21集$http://tv.sohu.com/20161102/n472117981.shtml#第22集$http://tv.sohu.com/20161102/n472117993.shtml#第23集$http://tv.sohu.com/20161102/n472118008.shtml#第24集$http://tv.sohu.com/20161102/n472118023.shtml#第25集$http://tv.sohu.com/20161102/n472118035.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16662','武当','共30集全','wudang','W','','http://photocdn.sohu.com/kis/fengmian/75/75436/75436_ver_big_20160716020503.jpg','http://photocdn.sohu.com/kis/fengmian/75/75436/75436_ver_big_20160716020503.jpg','','焦恩俊/严屹宽/李若彤/张茜/计春华','谭锐铭','武当山,张三丰,太极拳,朱元璋,皇觉寺','共30集全','大陆','国语','2004','12','',',448,','0','0','0','0','0','0','0','0','261112','0','0','0','0','0','0','1.0','0','325','1481692008','1482341119','0','0','元末，群雄并起，天下大乱。武当为长春真人邱处机百岁办祈福大典，皇觉寺和尚朱元璋、义军首领郭子兴的养女马芝兰、富家女沈蓉来到武当，与邱处机俗家弟子张君宝结为好友。在大漠苦练多年的赤必烈带火郎、雪鹰来武当挑战邱，邱重伤生死未卜，君宝被擒。朱元璋投身郭子兴麾下，但被奸人所害，伦为乞丐，欲跳崖自尽，幸遇逃脱的君宝相救，重拾信心。与朱相恋的沈蓉因有孕来找朱，却发现朱为了兵权与马芝兰完婚，动了胎气，难产而死，君宝悲愤不已。赤必烈得知邱处机未死，再次来武当山决战，两败俱伤。邱临死前给君宝留下八字秘诀。君宝领悟秘诀，创出太极拳，改名张三丰。朱称帝后大开杀戒，连三丰也不放过。三丰怒杀十八龙骑直闯御前，欲杀朱，马皇后赶来求情。三丰无奈放过朱，归隐武当，不问江湖。','sohu$$$qq$$$youku','$$$$$$','$$$$$$','第1集$http://tv.sohu.com/20161101/n471983064.shtml#第2集$http://tv.sohu.com/20161101/n471983071.shtml#第3集$http://tv.sohu.com/20161101/n471983077.shtml#第4集$http://tv.sohu.com/20161101/n471983087.shtml#第5集$http://tv.sohu.com/20161101/n471983093.shtml#第6集$http://tv.sohu.com/20161101/n471983100.shtml#第7集$http://tv.sohu.com/20161101/n471983104.shtml#第8集$http://tv.sohu.com/20161101/n471983113.shtml#第9集$http://tv.sohu.com/20161101/n471983121.shtml#第10集$http://tv.sohu.com/20161101/n471983134.shtml#第11集$http://tv.sohu.com/20161101/n471983150.shtml#第12集$http://tv.sohu.com/20161101/n471983168.shtml#第13集$http://tv.sohu.com/20161101/n471983179.shtml#第14集$http://tv.sohu.com/20161101/n471983193.shtml#第15集$http://tv.sohu.com/20161101/n471983213.shtml#第16集$http://tv.sohu.com/20161101/n471983231.shtml#第17集$http://tv.sohu.com/20161101/n471983241.shtml#第18集$http://tv.sohu.com/20161101/n471983245.shtml#第19集$http://tv.sohu.com/20161101/n471983253.shtml#第20集$http://tv.sohu.com/20161101/n471983274.shtml#第21集$http://tv.sohu.com/20161101/n471983283.shtml#第22集$http://tv.sohu.com/20161101/n471983293.shtml#第23集$http://tv.sohu.com/20161101/n471983304.shtml#第24集$http://tv.sohu.com/20161101/n471983313.shtml#第25集