INSERT INTO `mac_vod` VALUES('16663','月儿弯弯','共20集全','yueerwanwan','Y','','http://photocdn.sohu.com/kis/fengmian/1064/1064232/1064232_ver_big_20161021164510.jpg','http://photocdn.sohu.com/kis/fengmian/1064/1064232/1064232_ver_big_20161021164510.jpg','','李树生/嵇波/于月仙/郭冬临/王刚','郭少雄','村委会成员,汉文帝,大都市,党支部,豆腐','共20集全','大陆','国语','2008','12','',',441,','0','0','0','0','0','0','0','0','55854','0','0','0','0','0','0','7.0','0','181','1481692008','1482341123','0','0','文帝村是以汉文帝陵命名的村庄，和大都市紧紧相连。在城市基础建设不断扩充的过程中，文帝村的土地像切豆腐一样被切走。村党支部书记杨明亮在村里工作了三十多年，看到土地流失非常痛心，但又无力阻止。村里划地得到一百万，老书记想留着给村办企业做资金，村长和村委会成员以少数服从多数的决定，把钱在村里分掉。','sohu','','','第1集$http://tv.sohu.com/20161102/n472117782.shtml#第2集$http://tv.sohu.com/20161102/n472117800.shtml#第3集$http://tv.sohu.com/20161102/n472117816.shtml#第4集$http://tv.sohu.com/20161102/n472117829.shtml#第5集$http://tv.sohu.com/20161102/n472117838.shtml#第6集$http://tv.sohu.com/20161102/n472117850.shtml#第7集$http://tv.sohu.com/20161102/n472117859.shtml#第8集$http://tv.sohu.com/20161102/n472117870.shtml#第9集$http://tv.sohu.com/20161102/n472117882.shtml#第10集$http://tv.sohu.com/20161102/n472117894.shtml#第11集$http://tv.sohu.com/20161102/n472117899.shtml#第12集$http://tv.sohu.com/20161102/n472117906.shtml#第13集$http://tv.sohu.com/20161102/n472117914.shtml#第14集$http://tv.sohu.com/20161102/n472117925.shtml#第15集$http://tv.sohu.com/20161102/n472117959.shtml#第16集$http://tv.sohu.com/20161102/n472117976.shtml#第17集$http://tv.sohu.com/20161102/n472117988.shtml#第18集$http://tv.sohu.com/20161102/n472117998.shtml#第19集$http://tv.sohu.com/20161102/n472118013.shtml#第20集$http://tv.sohu.com/20161102/n472118028.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16664','走出你的爱','共26集全','zouchunideai','Z','','http://photocdn.sohu.com/kis/fengmian/1206/1206806/1206806_ver_big_20160726104502.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206806/1206806_ver_big_20160726104502.jpg','','曾黎/萧正楠/童爱玲/胡东/韦杰','蒋家骏','时装设计,时装界,影响力,主办方,报名','共26集全','大陆','国语','2007','12','',',377,','0','0','0','0','0','0','0','0','993764','0','0','0','0','0','0','1.0','0','226','1481692008','1482341118','0','0','一场极具影响力的时装设计大赛在滨海拉开帷幕。苏征天--时装界老大、风尚集团总裁亲自担任比赛评委。与父亲苏征天一样，纪阳对时装设计情有独钟；他以恋人小绵的名义报名参赛。当纪阳设计的时装走过比赛T型天桥时，赛场一片惊呼，评委们给出比赛最高分。但按参赛规则，与主办方或评委有关系的是不能参赛。当纪阳上台领奖时，作为评委的苏征天认出来了；他当着所有媒体与评委，宣布获奖无效。纪阳数月的心血付之东流，父子之战一触即发。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161101/n471979128.shtml#第2集$http://tv.sohu.com/20161101/n471979143.shtml#第3集$http://tv.sohu.com/20161101/n471979160.shtml#第4集$http://tv.sohu.com/20161101/n471979176.shtml#第5集$http://tv.sohu.com/20161101/n471979189.shtml#第6集$http://tv.sohu.com/20161101/n471979210.shtml#第7集$http://tv.sohu.com/20161101/n471979222.shtml#第8集$http://tv.sohu.com/20161101/n471979236.shtml#第9集$http://tv.sohu.com/20161101/n471979268.shtml#第10集$http://tv.sohu.com/20161101/n471979283.shtml#第11集$http://tv.sohu.com/20161101/n471979303.shtml#第12集$http://tv.sohu.com/20161101/n471979333.shtml#第13集$http://tv.sohu.com/20161101/n471979350.shtml#第14集$http://tv.sohu.com/20161101/n471979367.shtml#第15集$http://tv.sohu.com/20161101/n471979385.shtml#第16集$http://tv.sohu.com/20161101/n471979408.shtml#第17集$http://tv.sohu.com/20161101/n471979423.shtml#第18集$http://tv.sohu.com/20161101/n471979449.shtml#第19集$http://tv.sohu.com/20161101/n471979471.shtml#第20集$http://tv.sohu.com/20161101/n471979482.shtml#第21集$http://tv.sohu.com/20161101/n471979496.shtml#第22集$http://tv.sohu.com/20161101/n471979510.shtml#第23集$http://tv.sohu.com/20161101/n471979523.shtml#第24集$http://tv.sohu.com/20161101/n471979534.shtml#第25集$http://tv.sohu.com/20161101/n471979553.shtml#第26集$http://tv.sohu.com/20161101/n471979560.shtml$$$http://v.youku.