INSERT INTO `mac_vod` VALUES('16665','鸳鸯河','共22集全','yuanyanghe','Y','','http://photocdn.sohu.com/kis/fengmian/197/197369/197369_ver_big_20160927165003.jpg','http://photocdn.sohu.com/kis/fengmian/197/197369/197369_ver_big_20160927165003.jpg','','谢君豪/佟丽娅/郭珍霓/郭凯敏/娟子','马玉辉','新婚生活,广西梧州,上海,世纪','共22集全','大陆','国语','2008','12','',',441,','0','0','0','0','0','0','0','0','449094','0','0','0','0','0','0','2.0','0','329','1481692009','1482341117','0','0','上世纪六十年代末，广西梧州的小镇上，新聘请的小学老师上海姑娘黄曼莉的到来仿佛给平静的水面投下一颗石子，她的美丽让全镇居民都津津乐道。不仅是小镇上的居民，镇上小学的年轻老师韦涧清和洪国强也同时对她有了好感，韦涧清乐观活泼，深受学生的喜爱。在韦涧清细心的呵护与体贴入微的照顾下，黄曼莉逐渐向他敞开了心扉。而两人的结合也让洪国强的内心更加失落和嫉妒。短短数月，韦涧清和黄曼莉的新婚生活就因为岁月的动荡被打破了。韦涧清被派省城学习的日子里，因为洪国强和妻子高小霞的揭发，黄曼莉陷入了无休止的批斗和检讨中。韦母为了保全儿子的清白，极力劝说黄曼莉回上海找寻生父。就这样，黄曼莉离开了依依不舍的鸳鸯河。','sohu','','','第1集$http://tv.sohu.com/20161020/n470845635.shtml#第2集$http://tv.sohu.com/20161020/n470845645.shtml#第3集$http://tv.sohu.com/20161020/n470845651.shtml#第4集$http://tv.sohu.com/20161020/n470845654.shtml#第5集$http://tv.sohu.com/20161020/n470845663.shtml#第6集$http://tv.sohu.com/20161020/n470845671.shtml#第7集$http://tv.sohu.com/20161020/n470845677.shtml#第8集$http://tv.sohu.com/20161020/n470845682.shtml#第9集$http://tv.sohu.com/20161020/n470845690.shtml#第10集$http://tv.sohu.com/20161020/n470845697.shtml#第11集$http://tv.sohu.com/20161020/n470845703.shtml#第12集$http://tv.sohu.com/20161020/n470845706.shtml#第13集$http://tv.sohu.com/20161020/n470845710.shtml#第14集$http://tv.sohu.com/20161020/n470845713.shtml#第15集$http://tv.sohu.com/20161020/n470845722.shtml#第16集$http://tv.sohu.com/20161020/n470845728.shtml#第17集$http://tv.sohu.com/20161020/n470845731.shtml#第18集$http://tv.sohu.com/20161020/n470845741.shtml#第19集$http://tv.sohu.com/20161020/n470845751.shtml#第20集$http://tv.sohu.com/20161020/n470845759.shtml#第21集$http://tv.sohu.com/20161020/n470845766.shtml#第22集$http://tv.sohu.com/20161020/n470845775.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16666','圣天门口（卫视版）','共46集全','shengtianmenkouweishiban','S','','http://photocdn.sohu.com/kis/fengmian/185/185399/185399_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/185/185399/185399_ver_big.jpg','','段奕宏/宋佳/袁文康/黄志忠/柯蓝','张黎/刘淼淼','圣天门口,爱情,火花,浪潮,历史','共46集全','大陆','国语','2012','12','',',437,','0','0','0','0','0','0','0','0','89167','0','0','0','0','0','0','5.0','0','448','1481692010','1482341116','0','0','天门口镇世代居住着雪杭两大家族，两家世代不和，彼此争斗。杭家青年杭九枫为了给雪家抹黑，私通遭弃的雪家儿媳阿彩，不料却被刚烈直爽的阿彩激出了爱情的火花。不久，革命浪潮席卷了天门口镇，雪家在战乱中衰落，杭九枫和阿彩成为了红军战士。但阿彩没有答应杭九枫的爱情，雪杭两家延续着世代不相往来的旧怨。两个人在战争岁月里时聚时离，他们彼此扶持，但家族宿怨却让他们始终无法结合，他们只能默默守望。历经战火，天门口镇终于迎来了彻底的解放，阿彩去了省城，而杭九枫却留了下来，天门口镇经历了火红的岁月，也经历了历史的波折，杭九枫在老镇长段三国的配合下，在大饥荒的时候，宁肯丢官弃职，毅然开仓放粮，赈济百姓，让天门口人安然度过了艰难时刻，杭九枫以对家乡的忠勇，保护了天门口镇。','sohu','','','第1集$http://tv.sohu.com/20161020/n470845213.shtml#第2集$http://tv.sohu.com/20161020/n470845218.shtml#第3集$http://tv.sohu.com/20161020/n470845223.shtml#第4集$http://tv.sohu.com/20161020/n470845228.shtml#第5集$http://tv.sohu.com/20161020/n470845242.shtml#第6集$http://tv.sohu.com/20161020/n470845248.shtml#第7集$http://tv.sohu.com/20161020/n470845254.shtml#第8集$http://tv.sohu.com/20161020/n470845259.shtml#第9集$http://tv.sohu.com/20161020/n470845265.shtml#第10集$http://tv.sohu.com/20161020/n470845275.shtml#第11集$http://tv.sohu.com/20161020/n470845283.shtml#第12集$http://tv.sohu.com/20161020/n470845288.shtml#第13集$http://tv.sohu.com/20161020/n470845293.shtml#第14集$http://tv.sohu.com/20161020/n470845307.shtml#第15集$http://tv.sohu.com/20161020/n470845315.shtml#第16集$http://tv.sohu.com/20161020/n470845322.shtml#第17集$http://tv.sohu.com/20161020/n470845332.shtml#第18集$http://tv.sohu.com/20161020/n470845341.shtml#第19集$http://tv.sohu.com/20161020/n470845353.shtml#第20集$http://tv.sohu.com/20161020/n470845361.shtml#第21集$http://tv.sohu.com/20161020/n470845375.shtml#第22集$http://tv.sohu.com/20161020/n470845389.shtml#第23集$http://tv.sohu.com/20161020/n470845399.shtml#第24集$http://tv.sohu.com/20161020/n470845410.shtml#第25集$http://tv.sohu.com/20161