INSERT INTO `mac_vod` VALUES('16667','恋爱兵法','共32集全','lianaibingfa','L','','http://photocdn.sohu.com/kis/fengmian/69/69543/69543_ver_big_20160921232503.jpg','http://photocdn.sohu.com/kis/fengmian/69/69543/69543_ver_big_20160921232503.jpg','','金桢勋/徐若瑄/袁文康/陈紫函/刘滨','李敏澈','飞往中国,恋爱兵法,韩国首尔,总经理,分公司','共32集全','大陆','国语','2008','12','',',348,','0','0','0','0','0','0','0','0','451428','0','0','0','0','0','0','4.0','0','303','1481692010','1482341116','0','0','从韩国首尔飞往中国上海的航班。头等舱内，一个年轻英俊、一脸阳光的韩国小伙子正凝视舷窗外，陷入心绪之中，他叫金正浩，是韩国著名家族大企业“五星集团”的少公子。金正浩在韩国的事业因为年轻没有经验而遭受挫折，此次来上海除了受家族安排担任上海分公司总经理外，还和一份埋藏心中、没来得及表白的美丽初恋有关，原来年幼失诂的金正浩曾随奶奶在上海生活了十年，这十年却成为他人生记忆中最幸福的时光，记忆中一个叫欧阳明明的美丽女孩让金正浩朝思慕想，始终无法忘怀，金正浩已经下决心要向明明表白心意。','sohu','','','第1集$http://tv.sohu.com/20161020/n470844956.shtml#第2集$http://tv.sohu.com/20161020/n470844961.shtml#第3集$http://tv.sohu.com/20161020/n470844971.shtml#第4集$http://tv.sohu.com/20161020/n470844982.shtml#第5集$http://tv.sohu.com/20161020/n470844991.shtml#第6集$http://tv.sohu.com/20161020/n470845001.shtml#第7集$http://tv.sohu.com/20161020/n470845009.shtml#第8集$http://tv.sohu.com/20161020/n470845017.shtml#第9集$http://tv.sohu.com/20161020/n470845026.shtml#第10集$http://tv.sohu.com/20161020/n470845033.shtml#第11集$http://tv.sohu.com/20161020/n470845040.shtml#第12集$http://tv.sohu.com/20161020/n470845044.shtml#第13集$http://tv.sohu.com/20161020/n470845051.shtml#第14集$http://tv.sohu.com/20161020/n470845058.shtml#第15集$http://tv.sohu.com/20161020/n470845063.shtml#第16集$http://tv.sohu.com/20161020/n470845068.shtml#第17集$http://tv.sohu.com/20161020/n470845076.shtml#第18集$http://tv.sohu.com/20161020/n470845085.shtml#第19集$http://tv.sohu.com/20161020/n470845095.shtml#第20集$http://tv.sohu.com/20161020/n470845102.shtml#第21集$http://tv.sohu.com/20161020/n470845110.shtml#第22集$http://tv.sohu.com/20161020/n470845118.shtml#第23集$http://tv.sohu.com/20161020/n470845123.shtml#第24集$http://tv.sohu.com/20161020/n470845133.shtml#第25集$http://tv.sohu.com/20161020/n470845139.shtml#第26集$http://tv.sohu.com/20161020/n470845147.shtml#第27集$