INSERT INTO `mac_vod` VALUES('16668','戈壁剿匪记','共27集全','gebijiaofeiji','G','','http://photocdn.sohu.com/kis/fengmian/1103/1103403/1103403_ver_big_20161019181003.jpg','http://photocdn.sohu.com/kis/fengmian/1103/1103403/1103403_ver_big_20161019181003.jpg','','申军谊/牛犇/赵小锐/张冰','戈弋','淮海战役,国民党,解放军,小分队,野战军','共27集全','大陆','国语','2009','12','',',362,','0','0','0','0','0','0','0','0','209650','0','0','0','0','0','0','4.0','0','457','1481692011','1482341115','0','0','国民党一支残余部队，为首的是国民党女子独立团的少校副团长欧阳君，企图与西疆部队汇合继续以人民为敌。欧阳君带领着百十人残部来到了号称“千里戈壁”的边缘地带。我军某师在追歼这股残匪途中，突然得到野战军的调遣，迅速支援淮海战役，郭师长令该师的侦察连组建了一支剿匪小分队，由侦察连连长尚自喜带队开展侦察，伺机歼灭这股顽匪。欧阳君带领残部继续作恶，过往的村庄被抢劫一空，在外打猎的青年村民们得知消息发誓报仇，加入了剿匪的行列。欧阳君为躲避追赶，分成三路人马向西挺进，其他两路人马都被我军的剿匪小分队消灭，欧阳君带领仅剩下的十多个匪兵仓惶向西逃窜，解放军侦察小分队乘胜追击。匪兵们在沙漠中饥渴难忍，此时我军侦察员赶到，果断地击毙了几个匪兵将其他人员擒获，欧阳君一看大势已去，拼命逃走，被赶来的白灵打死。','sohu','','','第1集$http://tv.sohu.com/20161020/n470798745.shtml#第2集$http://tv.sohu.com/20161020/n470798770.shtml#第3集$http://tv.sohu.com/20161020/n470798786.shtml#第4集$http://tv.sohu.com/20161020/n470798803.shtml#第5集$http://tv.sohu.com/20161020/n470798808.shtml#第6集$http://tv.sohu.com/20161020/n470798822.shtml#第7集$http://tv.sohu.com/20161020/n470798839.shtml#第8集$http://tv.sohu.com/20161020/n470798849.shtml#第9集$http://tv.sohu.com/20161020/n470798862.shtml#第10集$http://tv.sohu.com/20161020/n470798877.shtml#第11集$http://tv.sohu.com/20161020/n470798895.shtml#第12集$http://tv.sohu.com/20161020/n470798920.shtml#第13集$http://tv.sohu.com/20161020/n470798940.shtml#第14集$http://tv.sohu.com/20161020/n470798949.shtml#第15集$http://tv.sohu.com/20161020/n470798967.shtml#第16集$http://tv.sohu.com/20161020/n470798979.shtml#第17集$http://tv.sohu.com/20161020/n470798985.shtml#第18集$http://tv.sohu.com/20161020/n470799000.shtml#第19集$http://tv.sohu.com/20161020/n470799018.shtml#第20集$http://tv.sohu.com/20161020/n470799031.shtml#第21集$http://tv.sohu.com/20161020/n470799040.shtml#第22集$http://tv.sohu.com/20161020/n470799049.shtml#第23集$http://tv.sohu.com/20161020/n470799060.shtml#第24集$http://tv.sohu.com/20161020/n47079907