INSERT INTO `mac_vod` VALUES('16669','误入军统的女人','共26集全','wurujuntongdenvren','W','','http://photocdn.sohu.com/kis/fengmian/75/75084/75084_ver_big_20161019180003.jpg','http://photocdn.sohu.com/kis/fengmian/75/75084/75084_ver_big_20161019180003.jpg','','王奎荣/牛犇/韩月乔/王耀辉','杨健康','军统特务,共产党员,国民党,解放军,解放区','共26集全','大陆','国语','2006','12','',',390,','0','0','0','0','0','0','0','0','659728','0','0','0','0','0','0','1.0','0','478','1481692011','1482341115','0','0','解放前夕，漂亮的阿静为躲避城防司令的儿子卢天丰的纠缠而进了国民党军统特务学校。阿静被学校特务头目黄飞强奸。特务学校的训练极其残酷，一个被抓回的逃跑女生被狼狗活吃了。阿静等人学习窃听、跟踪、色诱、下毒、绑架、杀人，被训练成外表美丽但心狠手辣的杀人机器。为解放区运药的地下游击队员被军统抓获，军统想由此破获解放区整个药品渠道，于是阿静被派遣与药商纪老板结婚。在监狱中，阿静被安排和一个共产党员的妻子沈薇关在一起……杂牌军罗司令的副官领图女色和金银，在女特务的诱惑威逼下做了奸细……解放了，军统留下骨干特务分子潜伏下来，潜伏特务大肆搞暗杀，炸电厂等破坏活动，解放军军管会主任施卫与敌特斗智斗勇，终将军统特务全部抓获。','sohu','','','第1集$http://tv.sohu.com/20161020/n470794859.shtml#第2集$http://tv.sohu.com/20161020/n470794873.shtml#第3集$http://tv.sohu.com/20161020/n470794887.shtml#第4集$http://tv.sohu.com/20161020/n470794906.shtml#第5集$http://tv.sohu.com/20161020/n470794934.shtml#第6集$http://tv.sohu.com/20161020/n470794953.shtml#第7集$http://tv.sohu.com/20161020/n470794965.shtml#第8集$http://tv.sohu.com/20161020/n470794978.shtml#第9集$http://tv.sohu.com/20161020/n470794992.shtml#第10集$http://tv.sohu.com/20161020/n470795000.shtml#第11集$http://tv.sohu.com/20161020/n470795014.shtml#第12集$http://tv.sohu.com/20161020/n470795024.shtml#第13集$http://tv.sohu.com/20161020/n470795035.shtml#第14集$http://tv.sohu.com/20161020/n470795049.shtml#第15集$http://tv.sohu.com/20161020/n470795064.shtml#第16集$http://tv.sohu.com/20161020/n470795097.shtml#第17集$http://tv.sohu.com/20161020/n470795111.shtml#第18集$http://tv.sohu.com/20161020/n470795128.shtml#第19集$http://tv.sohu.com/20161020/n470795141.shtml#第20集$http://tv.sohu.com/20161020/n470795154.shtml#第21集$http://tv.sohu.com/20161020/n470795166.shtml#第22集$http://tv.sohu.com/20161020/n470795170.shtml#第23集$http://tv.sohu.com/20161020/n470795182.shtml#第24集$http://tv.sohu.com/20161020/n470795193.shtml#第25集$http://tv.sohu.com/20161020/n