INSERT INTO `mac_vod` VALUES('16670','猛犸敢死队','共26集全','mengmagansidui','M','','http://photocdn.sohu.com/kis/fengmian/92/92025/92025_ver_big_20161019175003.jpg','http://photocdn.sohu.com/kis/fengmian/92/92025/92025_ver_big_20161019175003.jpg','','李宜璇/索品/许娜/王跃辉/杜旭东','杨健康','猛犸敢死队,盘尼西林,女子敢死队,国民党,国际海运','共26集全','大陆','国语','2010','12','',',388,','0','0','0','0','0','0','0','0','977404','0','0','0','0','0','0','8.0','0','196','1481692012','1482341114','0','0','国共合作时期，国民党为阻止日军北上，成立了以国民党女连长海娅娜为首女子敢死队，代号“猛犸”。一列日军军火列车在车站上被分装成两列火车。运往北部山区的火车在八路军武工队副队长于刚的指挥下，很快被引爆；另一军火列车，被敢死队秘密安装了定时炸弹，并利用车身的运行，炸毁了日军进攻路线上的桥梁和隧道。身兼数职携带着新A军新的密电码的通讯处长丁显不幸被俘，敢死队接受了深入日军监狱营救活动。由于叛徒的出卖，马奎叛变投敌，隐藏在日军后防医院高层病房内。敢死队海娅娜假扮护士。接着，关系着日军入侵北上的明月桥也神不知鬼不觉地被炸毁；日军通过国际海运运到的军备药品盘尼西林被盗；日军高级特派员车队遭袭。从此，猛犸敢死队名扬四海，所到之处，日军闻风丧胆，惶惶不可终日。日军司令官恼羞成怒，下令围剿，但最终以惨败而告终。而猛犸敢死队还继续在行动，英勇战斗在抗日最前沿的阵地。','sohu','','','第1集$http://tv.sohu.com/20161020/n470792497.shtml#第2集$http://tv.sohu.com/20161020/n470792506.shtml#第3集$http://tv.sohu.com/20161020/n470792522.shtml#第4集$http://tv.sohu.com/20161020/n470792542.shtml#第5集$http://tv.sohu.com/20161020/n470792562.shtml#第6集$http://tv.sohu.com/20161020/n470792584.shtml#第7集$http://tv.sohu.com/20161020/n470792625.shtml#第8集$http://tv.sohu.com/20161020/n470792633.shtml#第9集$http://tv.sohu.com/20161020/n470792655.shtml#第10集$http://tv.sohu.com/20161020/n470792671.shtml#第11集$http://tv.sohu.com/20161020/n470792677.shtml#第12集$http://tv.sohu.com/20161020/n470792686.shtml#第13集$http://tv.sohu.com/20161020/n470792700.shtml#第14集$http://tv.sohu.com/20161020/n470792705.shtml#第15集$http://tv.sohu.com/20161020/n470792711.shtml#第16集$http://tv.sohu.com/20161020/n470792730.shtml#第17集$http://tv.sohu.com/20161020/n470792738.shtml#第18集$http://tv.sohu.com/20161020/n470792757.shtml#第19集$http://tv.sohu.com/20161020/n470792775.shtml#第20集$http://tv.sohu.com/20161020/n470792787.shtml#第21集$http://tv.sohu.com/20161020/n470792798.shtml#第22集$http://tv.sohu.com/20161020/n470792814.shtml#第23集$http://tv.sohu.com/20161020/n470792841.shtml#第24集$http:/