INSERT INTO `mac_vod` VALUES('16671','双刺（卫视版）','共41集全','shuangciweishiban','S','','http://photocdn.sohu.com/kis/fengmian/1203/1203242/1203242_ver_big_20160725151503.jpg','http://photocdn.sohu.com/kis/fengmian/1203/1203242/1203242_ver_big_20160725151503.jpg','','祖锋/王子文/曹征/倪虹洁/肖涵','牟晓杰','共产党员,两口子,党组织,胜利,成都','共41集全','大陆','国语','2016','12','',',449,','0','0','0','0','0','0','0','0','564822','0','0','0','0','0','0','8.0','0','160','1481692012','1482341114','0','0','1949年秋冬之交,风雨飘摇的成都，彭刚（祖峰饰）、吴佩欣（王子文饰）和女儿豆豆的幸福三口之家迎来了危机。两口子曾共赴国难，在抗战前线并肩杀敌，危急关头结下生死情缘而成为夫妻。谁知抗战胜利后随即转入内战，彭刚五内俱焚，因为他曾经是一名共产党员，他不能把枪口对准自己的同志，所以他乔装颓废，以一副不思进取的状态退居人后。成都解放在即的紧要关头，彭刚被党组织发现，他立即行动起来。谁知自己的变化引起妻子的怀疑，吴佩欣如梦惊醒，共枕多年换来的却是同床异梦，她害怕失去丈夫，害怕失去家庭，于是她由暗中监视彭刚，到精心设置圈套干扰彭刚所有的作为，甚至切断他与外界的一切联系。蒙在鼓里的彭刚对此浑然不知，他一往无前地投入到组织所赋予自己的任务中，冒着生命危险，化解种种障碍，殊死奋战，用生命捍卫了自己的使命和信仰，迎来成都的解放。','sohu','','','第1集$http://tv.sohu.com/20160725/n460919566.shtml#第2集$http://tv.sohu.com/20160930/n469465986.shtml#第3集$http://tv.sohu.com/20160930/n469465988.shtml#第4集$http://tv.sohu.com/20161001/n469515015.shtml#第5集$http://tv.sohu.com/20161001/n469515023.shtml#第6集$http://tv.sohu.com/20161002/n469548739.shtml#第7集$http://tv.sohu.com/20161003/n469578606.shtml#第8集$http://tv.sohu.com/20161003/n469578610.shtml#第9集$http://tv.sohu.com/20161004/n469604348.shtml#第10集$http://tv.sohu.com/20161004/n469604350.shtml#第11集$http://tv.sohu.com/20161005/n469624328.shtml#第12集$http://tv.sohu.com/20161005/n469624330.shtml#第13集$http://tv.sohu.com/20161006/n469645640.shtml#第14集$http://tv.sohu.com/20161006/n469645642.shtml#第15集$http://tv.sohu.com/20161007/n469669138.shtml#第16集$http://tv.sohu.com/20161007/n469669140.shtml#第17集$http://tv.sohu.com/20161009/n469756019.shtml#第18集$http://tv.sohu.com/20161009/n469756023.shtml#第19集$http://tv.sohu.com/20161009/n469836495.shtml#第20集$http://tv.sohu.com/20161010/n469932510.shtml#第21集$http://tv.sohu.com/20161010/n469932512.shtml#第22集$http://tv.sohu.com/20161011/n470026506.shtml#第23集$http://tv.sohu.com/20161011/n470026508.shtml#第24集$http://tv.sohu.