INSERT INTO `mac_vod` VALUES('21082','虎 虎 虎','','huhuhu','H','','http://puui.qpic.cn/vcover_vt_pic/0/15tlme1g17x2vpjt1463806907.jpg/220','http://puui.qpic.cn/vcover_vt_pic/0/15tlme1g17x2vpjt1463806907.jpg/220','','马丁·鲍尔萨姆/山村聪/约瑟夫·科顿','深作欣二','','腾讯高清','日本','英语','0','1','',',1897,','0','0','0','0','0','0','0','0','482228','0','0','0','0','0','0','8.0','0','271','1481877850','1482347461','0','0','这是一部真实的电影，真实展现了日军偷袭珍珠港的历史。美军插手太平洋战场，日军最高将领山本五十六（山村聪 S^o Yamamura 饰）认为美军实力强大，应速战速战，不宜和美国人打长久战。于是，由他一手策划的偷袭珍珠港行动正式启动了。\n虽然美军从此前截获的日军密电中得知了日军可能进行突袭的消息，但多数人都对此不屑一顾，密电的内容也没进行上报。即使在突袭当天美军一个士兵发现了雷达上不寻常的飞机群，美军将领仍然认为那是自己的飞机在执行巡逻任务。最终使得日军偷袭行动一举成功，美军损失惨重。山本五十六也成了美国人最大的眼中钉。\n        ','qq','','','腾讯高清$http://v.qq.com/x/cover/15tlme1g17x2vpj/f0021r803nr.html','','','','');
INSERT INTO `mac_vod` VALUES('16672','女人魂','共30集全','nvrenhun','N','','http://photocdn.sohu.com/kis/fengmian/185/185609/185609_ver_big_20161019175010.jpg','http://photocdn.sohu.com/kis/fengmian/185/185609/185609_ver_big_20161019175010.jpg','','孔祥玉/刘世龙/姚居德/杜旭东','杨北松','国民党当局,军统特务,游击队,地下党,秘密','共30集全','大陆','国语','2008','12','',',450,','0','0','0','0','0','0','0','0','278552','0','0','0','0','0','0','3.0','0','183','1481692012','1482341113','0','0','解放前夕，国民党当局秘密训练了一批女特工从事敌特活动。我军在得知这一情报后，对这批女特工实施策反工作，女地下党周巧真通过军统特务们的层层考验留在了军统学校。游击队利用在山中的有利条件，又通过周巧真的情报，破坏了军统的几次特务活动。军统学校内人人自危，互相猜疑，周巧真也险些被她们识破。军统特务们的种种作为，使得几名女学员心灰意冷，周巧真通过不断努力感化最终赢得几名女特工学员的信任，成功的扭转了她们的命运，使她们弃暗投明，迎着曙光走向美好的明天。','sohu','','','第1集$http://tv.sohu.com/20161020/n470791746.shtml#第2集$http://tv.sohu.com/20161020/n470791759.shtml#第3集$http://tv.sohu.com/20161020/n470791774.shtml#第4集$http://tv.sohu.com/20161020/n470791788.shtml#第5集$http://tv.sohu.com/20161020/n470791795.shtml#第6集$http://tv.sohu.com/20161020/n470791818.shtml#第7集$http://tv.sohu.com/20161020/n470791824.shtml#第8集$http://tv.sohu.com/20161020/n470791826.shtml#第9集$http://tv.sohu.com/20161020/n470791831.shtml#第10集$http://tv.sohu.com/20161020/n470791835.shtml#第11集$http://tv.sohu.com/20161020/n470791837.shtml#第12集$http://tv.sohu.com/20161020/n470791850.shtml#第13集$http://tv.sohu.com/20161020/n470791866.shtml#第14集$http://tv.sohu.com/20161020/n470791881.shtml#第15集$http://tv.sohu.com/20161020/n470791895.shtml#第16集$http://tv.sohu.com/20161020/n470791905.shtml#第17集$http://tv.sohu.com/20161020/n470791908.shtml#第18集$http://tv.sohu.com/20161020/n470791913.shtml#第19集$http://tv.sohu.com/20161020/n470791922.shtml#第20集$http://tv.sohu.com/20161020/n470791935.shtml#第21集$http://tv.sohu.com/20161020/n470791943.shtml#第22集$http://tv.sohu.com/20161020/n470791947.shtml#第23集$http://tv.sohu.com/20161020/n470791952.shtml#第24集$http://tv.sohu.com/20161020/n470791958.shtml#第25集$http://tv.sohu.com/20161020/n470791967.shtml#第26集$http://tv.sohu.com/20161020/n470791970.shtml#第27集$http://tv.sohu.com