INSERT INTO `mac_vod` VALUES('16673','麻雀（卫视版）','共69集全','maqueweishiban','M','','http://photocdn.sohu.com/kis/fengmian/1203/1203415/1203415_ver_big_20160901153502.jpg','http://photocdn.sohu.com/kis/fengmian/1203/1203415/1203415_ver_big_20160901153502.jpg','','李易峰/周冬雨/李小冉/张鲁一/张若昀','金琛/周远舟','侵华日军,国民党,作战计划,侵略者,日本','共69集全','大陆','国语','2016','12','',',451,','0','0','0','0','0','0','0','0','376053','0','0','0','0','0','0','9.0','0','138','1481692013','1482341113','0','0','1940年3月，汪伪政府宣布成立。侵华日军在上海大肆搜捕抗日志士，汪伪组建由前国民党军官毕忠良担任处长的“特别行动处”为虎作伥。一直潜伏在毕忠良身边、代号“麻雀”的中共党员陈深，与组织暂时失去联系。置身虎视狼顾的险境中，陈深信仰坚定，冒死营救上线“宰相”及抗日志士。毕忠良老奸巨猾，虽与救命恩人陈深“情同兄弟”，却对其产生怀疑，设重重陷阱步步紧逼。“宰相”牺牲后，陈深终于找到新上线“医生”并受命拿到日军代号为“归零”的重要作战计划。陈深的昔日恋人徐碧城，与另一国军情报人员唐山海假扮夫妻潜伏进特别行动处，在多次行动中给陈深制造麻烦和危机。智计过人的陈深最终成功地获取了“归零”计划，挫败了日本侵略者的阴谋。','sohu','','','第1集$http://tv.sohu.com/20160504/n447639846.shtml#第2集$http://tv.sohu.com/20160905/n467698496.shtml#第3集$http://tv.sohu.com/20160906/n467780231.shtml#第4集$http://tv.sohu.com/20160906/n467780240.shtml#第5集$http://tv.sohu.com/20160907/n467893435.shtml#第6集$http://tv.sohu.com/20160907/n467893437.shtml#第7集$http://tv.sohu.com/20160908/n468013711.shtml#第8集$http://tv.sohu.com/20160908/n468013713.shtml#第9集$http://tv.sohu.com/20160909/n468119744.shtml#第10集$http://tv.sohu.com/20160911/n468168193.shtml#第11集$http://tv.sohu.com/20160911/n468206940.shtml#第12集$http://tv.sohu.com/20160913/n468291876.shtml#第13集$http://tv.sohu.com/20160913/n468291879.shtml#第14集$http://tv.sohu.com/20160913/n468382863.shtml#第15集$http://tv.sohu.com/20160913/n468382869.shtml#第16集$http://tv.sohu.com/20160915/n468466465.shtml#第17集$http://tv.sohu.com/20160915/n468466470.shtml#第18集$http://tv.sohu.com/20160915/n468504456.shtml#第19集$http://tv.sohu.com/20160916/n468541305.shtml#第20集$http://tv.sohu.com/20160917/n468580079.shtml#第21集$http://tv.sohu.com/20160918/n468656950.shtml#第22集$http://tv.sohu.com/20160919/n468742348.shtml#第23集$http://tv.sohu.com/20160919/n468742354.shtml#第24集$http://tv.sohu.com/20160920/n468816931.shtml#第25集$http://tv.sohu.