INSERT INTO `mac_vod` VALUES('16674','黄金地带','共28集全','huangjindidai','H','','http://photocdn.sohu.com/kis/fengmian/88/88167/88167_ver_big_20161019181010.jpg','http://photocdn.sohu.com/kis/fengmian/88/88167/88167_ver_big_20161019181010.jpg','','罗嘉良/王姬/郑晓宁/朱杰/王菁华','王建军','美国,黄金,财富,哥哥,陆家','共28集全','大陆','国语','2010','12','',',452,','0','0','0','0','0','0','0','0','709074','0','0','0','0','0','0','7.0','0','336','1481692013','1482341113','0','0','从美国归来的弟弟陆远航为了报复同母异父的哥哥陆耕农多年前的杀父夺妻之恨，利用八大集团的财富和现在的剑北市首富陆耕农展开了一场殊死的商战，以此想打垮耕农及其领导的耕农集团。虽然远航步步相逼，但耕农却处处忍让似有很多难言之处，虽不同父，毕竟兄弟相称，究竟谁是亲生有待考证，表面看兄弟两人斗得不亦乐乎，但在事件背后操纵两人相斗的却是夏伯清、张家全父子，夏伯清既是当年害死陆耕农父亲陆禾的元凶，也是害陆耕农前妻夏瑜神秘失踪的主使，而张家全为了霸占陆家兄弟的利益不择手段，几经周折，最后陆家兄弟联手大逆转，正义战胜了邪恶。','sohu','','','第1集$http://tv.sohu.com/20161020/n470790977.shtml#第2集$http://tv.sohu.com/20161020/n470790998.shtml#第3集$http://tv.sohu.com/20161020/n470791007.shtml#第4集$http://tv.sohu.com/20161020/n470791020.shtml#第5集$http://tv.sohu.com/20161020/n470791040.shtml#第6集$http://tv.sohu.com/20161020/n470791061.shtml#第7集$http://tv.sohu.com/20161020/n470791074.shtml#第8集$http://tv.sohu.com/20161020/n470791089.shtml#第9集$http://tv.sohu.com/20161020/n470791113.shtml#第10集$http://tv.sohu.com/20161020/n470791136.shtml#第11集$http://tv.sohu.com/20161020/n470791156.shtml#第12集$http://tv.sohu.com/20161020/n470791171.shtml#第13集$http://tv.sohu.com/20161020/n470791194.shtml#第14集$http://tv.sohu.com/20161020/n470791206.shtml#第15集$http://tv.sohu.com/20161020/n470791214.shtml#第16集$http://tv.sohu.com/20161020/n470791223.shtml#第17集$http://tv.sohu.com/20161020/n470791236.shtml#第18集$http://tv.sohu.com/20161020/n470791243.shtml#第19集$http://tv.sohu.com/20161020/n470791256.shtml#第20集$http://tv.sohu.com/20161020/n470791269.shtml#第21集$http://tv.sohu.com/20161020/n470791287.shtml#第22集$http://tv.sohu.com/20161020/n470791296.shtml#第23集$http://tv.sohu.com/20161020/n470791322.shtml#第24集$http://tv.sohu.com/20161020/n470791342.shtml#第25集$http://tv.sohu.com/20161020/n470791360.shtml#第26集$http://tv.sohu.com/20161020/n470791378.s