INSERT INTO `mac_vod` VALUES('16675','大爱无言','共21集全','daaiwuyan','D','','http://photocdn.sohu.com/kis/fengmian/204/204857/204857_ver_big_20160927170004.jpg','http://photocdn.sohu.com/kis/fengmian/204/204857/204857_ver_big_20160927170004.jpg','','佟瑞欣/米学东/米杨/张谦','刚毅','公安局长,电视剧,东方科技,检察院,调查组','共21集全','大陆','国语','2007','12','',',454,','0','0','0','0','0','0','0','0','559272','0','0','0','0','0','0','10.0','0','458','1481692014','1482341118','0','0','该剧是一部反映检察官打击渎职犯罪、保护国家和人民群众利益不受侵害的电视剧。力在展现检察长方知铎为实现一个检察官的神圣职责，在国家利益和个人亲情、爱情之间进行艰难的抉择。南江市“东方科技”股票崩盘，股民血本无归，国有资金流失19个亿。有关部门两次派出调查组进行调查，无果而终。省检察院派出反渎职侵权局局长方知铎到南江市担任代理检察长，以调查诈骗案中的渎职行为为突破口，以搞清“6·18”证券诈骗案真相。方知铎秘密进入南江市调查，走访了前两次调查中受诬陷的检察官钟大民和受威胁的公安局长包成汉，和“6·18”证券诈骗案的主谋苏东方斗智斗勇。周小丁以生命换来了苏东方涉案的电子证据，白荻进行紧急破译，终于在苏东方将要离开南江市的最后时刻，拿到了他涉案的确切证据。','sohu$$$qq$$$youku','$$$$$$','$$$$$$','第1集$http://tv.sohu.com/20161020/n470845776.shtml#第2集$http://tv.sohu.com/20161020/n470845786.shtml#第3集$http://tv.sohu.com/20161020/n470845794.shtml#第4集$http://tv.sohu.com/20161020/n470845801.shtml#第5集$http://tv.sohu.com/20161020/n470845809.shtml#第6集$http://tv.sohu.com/20161020/n470845822.shtml#第7集$http://tv.sohu.com/20161020/n470845827.shtml#第8集$http://tv.sohu.com/20161020/n470845833.shtml#第9集$http://tv.sohu.com/20161020/n470845842.shtml#第10集$http://tv.sohu.com/20161020/n470845850.shtml#第11集$http://tv.sohu.com/20161020/n470845859.shtml#第12集$http://tv.sohu.com/20161020/n470845866.shtml#第13集$http://tv.sohu.com/20161020/n470845873.shtml#第14集$http://tv.sohu.com/20161020/n470845882.shtml#第15集$http://tv.sohu.com/20161020/n470845888.shtml#第16集$http://tv.sohu.com/20161020/n470845896.shtml#第17集$http://tv.sohu.com/20161020/n470845902.shtml#第18集$http://tv.sohu.com/20161020/n470845908.shtml#第19集$http://tv.sohu.com/20161020/n470845916.shtml#第20集$http://tv.sohu.com/20161020/n470845920.shtml#第21集$http://tv.sohu.com/20161020/n470845927.shtml$$$01$http://v.qq.com/x/cover/w9rmef5gj7476kj/s0021jkscef.html#02$http://v.qq.com/x/cover/w9rmef5gj7476kj/s00218kkhgo.html#03$http://v.qq.com/x/