INSERT INTO `mac_vod` VALUES('16676','你的生命我的决定','共22集全','nideshengmingwodejueding','N','','http://photocdn.sohu.com/kis/fengmian/201/201642/201642_ver_big_20160927150503.jpg','http://photocdn.sohu.com/kis/fengmian/201/201642/201642_ver_big_20160927150503.jpg','','李明启/孙松/袁志博/刘威葳/佟瑞欣','曹慧生','骨髓移植,网络虚拟,乳腺癌,白血病,好心人','共22集全','大陆','国语','2007','12','',',377,','0','0','0','0','0','0','0','0','31832','0','0','0','0','0','0','4.0','0','99','1481692016','1482341110','0','0','孪生兄弟张大力和张二力拥有平静的生活，就在二力和女友刘英准备结婚前，刘英遭到文自强的强暴，并导致流产，张二力悲痛中向文自强寻仇并误伤人命，离家出走。身为警察的大力被警局要求回避此案，可大力不忍心弟弟一错再错，劝说二力投案自首，争取从宽处理，万般无奈，大力掏出手铐，要将弟弟绳之以法。二力挣扎逃走，大力在追二力时晕倒在地，犹豫间，二力将哥哥送到医院，再次藏匿。大力在医院中被检查出患有血癌，为了挽救大力，警方要求刘英配合，告知二力回来进行骨髓移植手术，才可救活大力。在仇恨与亲情间，二力最终选择到医院配合手术救治……肺癌患者丁小小治疗中依然沉迷网恋，哥哥一家和小水的女友宁宁以宽容和关爱唤醒陷入网络虚拟世界的小小；六岁女孩儿丹丹患上白血病，在社会感召下终于有好心人站出来捐献骨髓；乳腺癌手术后又患恶性继发性肿瘤的孙英一心想让丈夫能够生活得更轻松，在生命的最后一段时间主动提出离婚……由于癌症的残酷，面对它，生活被高度浓缩，一切人都会被洗尽铅华，呈现出赤裸裸的灵魂，善良与丑恶、坚强于懦弱、亲情与友情，正是面对死亡，生命才显露出了珍贵，人性才会闪现尊严，癌症患者同亲人和朋友的故事都在这里一目了然。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161010/n469902371.shtml#第2集$http://tv.sohu.com/20161010/n469902382.shtml#第3集$http://tv.sohu.com/20161010/n469902391.shtml#第4集$http://tv.sohu.com/20161010/n469902398.shtml#第5集$http://tv.sohu.com/20161010/n469902413.shtml#第6集$http://tv.sohu.com/20161010/n469902420.shtml#第7集$http://tv.sohu.com/20161010/n469902432.shtml#第8集$http://tv.sohu.com/20161010/n469902444.shtml#第9集$http://tv.sohu.com/20161010/n469902460.shtml#第10集$http://tv.sohu.com/20161010/n469902465.shtml#第11集$http://tv.sohu.com/20161010/n469902475.shtml#第12集$http://tv.sohu.com/20161010/n469902479.shtml#第13集$http://tv.sohu.com/20161010/n469902489.shtml#第14集$http://tv.sohu.com/20161010/n469902496.shtml#第15集$http://tv.sohu.com/20161010/n469902498.shtml#第16集$http://tv.sohu.com/20161010/n469902507.shtml#第17集$http://tv.sohu.com/20161010/n469902515.shtml#第18集$http://tv.sohu.com/20161010/n469902526.shtml#第19集$http://tv.sohu.com/20161010/n469902543.shtml#第20集$http://tv.sohu.com/20161010/n469902558.shtml#第21集$http://t