INSERT INTO `mac_vod` VALUES('16677','重返大福村','共35集全','zhongfandafucun','Z','','http://photocdn.sohu.com/kis/fengmian/197/197125/197125_ver_big_20160919181004.jpg','http://photocdn.sohu.com/kis/fengmian/197/197125/197125_ver_big_20160919181004.jpg','','翟小兴/许歌/来喜/胡先煦','林丛','风光无限,抚养权,下一步,企业家,陆家','共35集全','大陆','国语','2013','12','',',456,','0','0','0','0','0','0','0','0','698064','0','0','0','0','0','0','10.0','0','52','1481692016','1482341112','0','0','本剧讲述了由大福村走出的农民陆大鹏在某市发展成了一名风光无限的企业家，而在众人仰慕的成功背后，有着不为人知的头疼事。生活上离异的他，又当爹又当妈的抚养一双不省心的儿女，因工作忙碌疏于交流，和儿女间的矛盾日益加重，前妻还不停的于他争夺抚养权；因全球大环境影响，陆大鹏的事业起起伏伏、麻烦不断。某杂志记者的张可欣，为了得到第一手“情报”，她处心积虑的“潜伏”在陆大鹏身边，几经波折，最终得到陆大鹏的信任。百般无奈的陆大鹏在友人的建议下决定“破釜沉舟”携全家重返大福村，希望在“重返”中和儿女充分相处，让孩子自己决定由谁抚养，同时，冷静的梳理下一步的工作思路。张可欣得知后决定一同重返，在陆家女儿的帮助下，张可欣和陆家三人一同踏上返乡路。','sohu','','','第1集$http://tv.sohu.com/20161017/n470447573.shtml#第2集$http://tv.sohu.com/20161017/n470447575.shtml#第3集$http://tv.sohu.com/20161017/n470447582.shtml#第4集$http://tv.sohu.com/20161017/n470447586.shtml#第5集$http://tv.sohu.com/20161017/n470447597.shtml#第6集$http://tv.sohu.com/20161017/n470447602.shtml#第7集$http://tv.sohu.com/20161017/n470447605.shtml#第8集$http://tv.sohu.com/20161017/n470447608.shtml#第9集$http://tv.sohu.com/20161017/n470447611.shtml#第10集$http://tv.sohu.com/20161017/n470447618.shtml#第11集$http://tv.sohu.com/20161017/n470447625.shtml#第12集$http://tv.sohu.com/20161017/n470447628.shtml#第13集$http://tv.sohu.com/20161017/n470447635.shtml#第14集$http://tv.sohu.com/20161017/n470447638.shtml#第15集$http://tv.sohu.com/20161017/n470447643.shtml#第16集$http://tv.sohu.com/20161017/n470447653.shtml#第17集$http://tv.sohu.com/20161017/n470447669.shtml#第18集$http://tv.sohu.com/20161017/n470447676.shtml#第19集$http://tv.sohu.com/20161017/n470447683.shtml#第20集$http://tv.sohu.com/20161017/n470447701.shtml#第21集$http://tv.sohu.com/20161017/n470447717.shtml#第22集$http://tv.sohu.com/20161017/n470447732.shtml#第23集$http://tv.sohu.com/20161017/n470447748.shtml#第24集$http://tv.sohu.com/20161017/n470447764.shtml#第25集$http://tv.sohu.com/20