INSERT INTO `mac_vod` VALUES('21194','潇洒先生','','xiaosaxiansheng','X','','http://puui.qpic.cn/vcover_vt_pic/0/qhx2zztda900kpht1444963790.jpg/220','http://puui.qpic.cn/vcover_vt_pic/0/qhx2zztda900kpht1444963790.jpg/220','','郑则仕/关之琳/楼南光','郑则仕','出租司机,开小店,生意','腾讯高清','香港','国语','0','1','',',1824,','0','0','0','0','0','0','0','0','870490','0','0','0','0','0','0','4.0','0','65','1481877913','1482347525','0','0','潇洒是一个船员，整天在海上漂泊，一去就是几个月，他的妈妈和小妹阿珍都很担心他。一天，潇洒回到家，妹妹非常惊喜，可是他的妈妈并不开心，觉得他没有出息。潇洒很是委屈，于是借酒消愁。阿珍和她的妈妈靠开小店为生，每天，早晨都有很多出租司机来照顾她们的生意，其中有一位司机阿光对阿珍有意思，经常来帮助她们。一天，政府通知他们，房子半年后要撤，但是他们一时又拿不出钱去买新的房子，为了筹钱，于是一家人在阿光的帮助……\n        ','qq','','','腾讯高清$http://v.qq.com/x/cover/qhx2zztda900kph/p00194r6jtm.html','','','','');
INSERT INTO `mac_vod` VALUES('16680','百姓秀才官','共21集全','baixingxiucaiguan','B','','http://photocdn.sohu.com/kis/fengmian/200/200164/200164_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/200/200164/200164_ver_big.jpg','','巩汉林/沈殿霞/张立/计春华/尚华','高翊浚','虎虎生威,翰林院,轻喜剧,因为爱,黄安','共21集全','大陆','国语','2000','12','',',457,','0','0','0','0','0','0','0','0','521699','0','0','0','0','0','0','2.0','0','113','1481692017','1482341104','0','0','本剧为一大型古装轻喜剧，故事发生在清末湖北黄安的邱家寨，剧情以秀才为主线，以秀才娘子、石匠阮老好、恶霸邱金贵、无赖谢瘸子、糊涂县官何九桂等为辅线展开了一系列令人啼笑皆非的故事。秀才姓盛名仁，因为爱打哈哈，所以人送外号“哈哈”，此人学富五车，才高八斗，因厌恶官场黑暗，二十余年不再应试，读书耕作以求安然宁静；秀才娘子是一位胖嫂，徐娘伴老，风韵犹存，为人侠肝义胆，爽朗坦直，温柔时脉脉含情，愤发时又虎虎生威，路见不平拔“刀”相助，可是往往是揽了事又办不了事，于是常把不爱惹事的秀才搅进漩涡；石匠阮老好，年轻体壮，忠厚老实，石匠媳妇貌美贤惠，纯朴勤劳；恶霸邱金贵，倚仗其叔是翰林院翰林，其岳父是吏部侍郎，狐假虎威，仗势欺人，横行乡里，欺压百姓，而唯独惧怕其妻邱大奶奶；无赖谢瘸子是个讼棍，又是邱金贵的狗头军师。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161009/n469821804.shtml#第2集$http://tv.sohu.com/20161009/n469821815.shtml#第3集$http://tv.sohu.com/20161009/n469821821.shtml#第4集$http://tv.sohu.com/20161009/n469821829.shtml#第5集$http://tv.sohu.com/20161009/n469821839.shtml#第6集$http://tv.sohu.com/20161009/n469821847.shtml#第7集$http://tv.sohu.com/20161009/n469821859.shtml#第8集$http://tv.sohu.com/20161009/n469821872.shtml#第9集$http://tv.sohu.com/20161009/n469821884.shtml#第10集$http://tv.sohu.com/20161009/n469821896.shtml#第11集$http://tv.sohu.com/20161009/n469821907.shtml#第12集$http://tv.sohu.com/20161009/n469821918.shtml#第13集$http://tv.sohu.com/20161009/n469821930.shtml#第14集$http://tv.sohu.com/20161009/n469821944.shtml#第15集$http://tv.sohu.com/20161009/n469821957.shtml#第16集$http://tv.sohu.com/20161009/n469821968.shtml#第17集$http://tv.sohu.com/20161009/n469821982.shtml#第18集$http://tv.sohu.com/20161009/n469821994.shtml#第19集$http://tv.sohu.com/20161009/n469822003.shtml#第20集$http://tv.sohu.com/20161009/n469822009.shtml#第21集$http://tv.sohu.com/20161009/n469822015.shtml$$$http://v.youku.com/v_show/id_XMTgxMjQ0NTY5Mg==.html#http://v.youku.com/v_show/id_XMTgxMjQ2NzQ2NA==.html#http://v.youku.com/v_show/id_XMTgxMjQ4NTYzM