INSERT INTO `mac_vod` VALUES('16681','兵变1938','共24集全','bingbian1938','B','','http://photocdn.sohu.com/kis/fengmian/53/53166/53166_ver_big_20160919182003.jpg','http://photocdn.sohu.com/kis/fengmian/53/53166/53166_ver_big_20160919182003.jpg','','梅婷/刘磊/李君峰/黑子/徐光宇','张玉中','参谋长,日本,安阳,太行,武装','共24集全','大陆','国语','2007','12','',',458,','0','0','0','0','0','0','0','0','813435','0','0','0','0','0','0','8.0','0','234','1481692017','1482341109','0','0','晨雾笼罩下的华北重镇安阳车站。由北平秘密返回驻地的太行抗日游击纵队司令李万成，一下火车即被日军宪兵武装劫持。前来接站的纵队参谋长林达飞突然发现，在劫持李万成的宪兵队伍中的女翻译竟是自己妻子的妹妹赵蔷。李万成的生死兄弟，游击纵队副司令关震宇得知司令被日军劫持，和林达飞积极展开营救，但日本人欲要突破的目标却是拥兵能战的关震宇。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161010/n469900270.shtml#第2集$http://tv.sohu.com/20161010/n469900281.shtml#第3集$http://tv.sohu.com/20161010/n469900303.shtml#第4集$http://tv.sohu.com/20161010/n469900324.shtml#第5集$http://tv.sohu.com/20161010/n469900352.shtml#第6集$http://tv.sohu.com/20161010/n469900377.shtml#第7集$http://tv.sohu.com/20161010/n469900400.shtml#第8集$http://tv.sohu.com/20161010/n469900416.shtml#第9集$http://tv.sohu.com/20161010/n469900437.shtml#第10集$http://tv.sohu.com/20161010/n469900458.shtml#第11集$http://tv.sohu.com/20161010/n469900482.shtml#第12集$http://tv.sohu.com/20161010/n469900508.shtml#第13集$http://tv.sohu.com/20161010/n469900524.shtml#第14集$http://tv.sohu.com/20161010/n469900536.shtml#第15集$http://tv.sohu.com/20161010/n469900552.shtml#第16集$http://tv.sohu.com/20161010/n469900569.shtml#第17集$http://tv.sohu.com/20161010/n469900587.shtml#第18集$http://tv.sohu.com/20161010/n469900595.shtml#第19集$http://tv.sohu.com/20161010/n469900619.shtml#第20集$http://tv.sohu.com/20161010/n469900632.shtml#第21集$http://tv.sohu.com/20161010/n469900645.shtml#第22集$http://tv.sohu.com/20161010/n469900656.shtml#第23集$http://tv.sohu.com/20161010/n469900669.shtml#第24集$http://tv.sohu.com/20161010/n469900686.shtml$$$01$http://v.qq.com/x/cover/3cerde4xndw4zcb/f00223d0f6d.html#02$http://v.qq.com/x/cover/3cerde4xndw4zcb/h0022djf5t8.html#03$http://v.qq.com/x/cover/3cerde4xndw4zcb/i00220wsr89.