INSERT INTO `mac_vod` VALUES('16683','暗夜心慌慌','共20集全','anyexinhuanghuang','A','','http://photocdn.sohu.com/kis/fengmian/55/55743/55743_ver_big_20160920141503.jpg','http://photocdn.sohu.com/kis/fengmian/55/55743/55743_ver_big_20160920141503.jpg','','马可/刘一含/梁超/李易祥/蒋宏杰','庄枫','老板娘,诡异事件,实习生,中国,江南','共20集全','大陆','国语','2006','12','',',459,','0','0','0','0','0','0','0','0','36595','0','0','0','0','0','0','6.0','0','301','1481692018','1482341108','0','0','不可理喻的死亡诅咒，闻之色变的午夜幽灵，凶形险恶的毒虫猛兽……30年代中国的江南某城，在每一个阴暗的角落，总有一些恐怖、惊险、离奇的事情发生，是神鬼作祟？是妖魔附体？还是有更纷繁复杂的阴谋暗藏其中。在层层迷雾下，一群正直果敢睿智的“驱魔者”——报社记者包正、美丽法医寒冰、实习生杜子腾、风韵老板娘曾美丽、探长侯启发，用无畏的勇气、缜密的推理试图拨开层层迷雾，还原诡异事件后的真实原貌，而最后的真相往往让你瞠目结舌。','sohu','','','第1集$http://tv.sohu.com/20161010/n469898184.shtml#第2集$http://tv.sohu.com/20161010/n469898187.shtml#第3集$http://tv.sohu.com/20161010/n469898197.shtml#第4集$http://tv.sohu.com/20161010/n469898210.shtml#第5集$http://tv.sohu.com/20161010/n469898221.shtml#第6集$http://tv.sohu.com/20161010/n469898238.shtml#第7集$http://tv.sohu.com/20161010/n469898253.shtml#第8集$http://tv.sohu.com/20161010/n469898265.shtml#第9集$http://tv.sohu.com/20161010/n469898279.shtml#第10集$http://tv.sohu.com/20161010/n469898300.shtml#第11集$http://tv.sohu.com/20161010/n469898319.shtml#第12集$http://tv.sohu.com/20161010/n469898328.shtml#第13集$http://tv.sohu.com/20161010/n469898334.shtml#第14集$http://tv.sohu.com/20161010/n469898345.shtml#第15集$http://tv.sohu.com/20161010/n469898359.shtml#第16集$http://tv.sohu.com/20161010/n469898372.shtml#第17集$http://tv.sohu.com/20161010/n469898383.shtml#第18集$http://tv.sohu.com/20161010/n469898390.shtml#第19集$http://tv.sohu.com/20161010/n469898407.shtml#第20集$http://tv.sohu.com/20161010/n469898422.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16684','不嫁则已','共20集全','bujiazeyi','B','','http://photocdn.sohu.com/kis/fengmian/192/192451/192451_ver_big_20160927140003.jpg','http://photocdn.sohu.com/kis/fengmian/192/192451/192451_ver_big_20160927140003.jpg','','王亚楠/奚美娟/刘艺/石小群/程莉莎','陶玲玲','知识分子,克林顿,年轻人,成功者,爱情','共20集全','大陆','国语','2002','12','',',355,','0','0','0','0','0','0','0','0','640362','0','0','0','0','0','0','5.0','0','302','1481692018','1482341110','0','0','20多岁的苏典典为代表的“金童玉女”式的婚姻，经历了令人羡慕的短暂过程最终失败了；一对年轻人经历真正爱情至上的结合，大难当头考验了他们的情感；已经离了婚的中年男大款、克林顿式的事业成功者，身边女人犹如走马灯；50多岁的知识分子，重病在身的妻子和一辈子忍受寂寞的丈夫，双方都让人同情；陶然姑娘，始终不渝地追求爱情，十分阳光。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161010/n469910083.shtml#第2集$http://tv.sohu.com/20161010/n469910091.shtml#第3集$http://tv.sohu.com/20161010/n469910095.shtml#第4集$http://tv.sohu.com/20161010/n469910098.shtml#第5集$http://tv.sohu.com/20161010/n469910102.shtml#第6集$http://tv.sohu.com/20161010/n469910108.shtml#第7集$http://tv.sohu.com/20161010/n469910115.shtml#第8集$http://tv.sohu.com/20161010/n469910124.shtml#第9集$http://tv.sohu.com/20161010/n469910130.shtml#第10集$http://tv.sohu.com/20161010/n469910141.shtml#第11集$http://tv.sohu.com/20161010/n469910151.shtml#第12集$http://tv.sohu.com/20161010/n469910158.shtml#第13集$http://tv.sohu.com/20161010/n469910160.shtml#第14集$http://tv.sohu.com/20161010/n469910164.shtml#第15集$http://tv.sohu.com/20161010/n469910169.shtml#第16集$http://tv.sohu.com/20161010/n469910183.shtml#第17集$http://tv.sohu.com/20161010/n469910188.shtml#第18集$http://tv.sohu.com/20161010/n469910196.shtml#第19集$http://tv.sohu.com/20161010/n469910205.shtml#第20集$http://tv.sohu.com/20161010/n469910210.shtml$$$http://v.youku.com/v_show/id_XMTgzMTI2NTIwNA==.html#http://v.youku.com/v_show/id_XMTgzMjAzNjIyNA==.html#http://v.youku.com/v_show/id_XMTgzMTI3MDc5Ng==.html#http://v.youku.com/v_show/id_XMTgzMDU0NTA0OA==.html#http://v.youku.com/v_show/id_XMTgzMDU0NTY0OA==.html#http://v.youku.com/v_show/id_XMTgzMDU1NDUyOA==.html#http://v.youku.com/v_show/id_XMTgzMDU1NTE3Mg==.html#ht