INSERT INTO `mac_vod` VALUES('16685','李氏家族','','lishijiazu','L','','http://photocdn.sohu.com/kis/fengmian/1207/1207431/1207431_ver_big_20160926134010.jpg','http://photocdn.sohu.com/kis/fengmian/1207/1207431/1207431_ver_big_20160926134010.jpg','','曹培昌/刘丹/李艳秋/邓英','刘晓波','的情人,男子汉,少奶奶,新科,经理','','大陆','国语','1997','12','',',437,','0','0','0','0','0','0','0','0','831489','0','0','0','0','0','0','5.0','0','213','1481692018','1482344858','0','0','该剧全景式、多侧面地描绘了一个家族繁衍发展的兴衰史。在李氏家族的发展历史上，有闯皇城、告御状的男子汉；有心黑手辣、精明干练的少奶奶；有苦读三载、一举成名的新科状元；有万贯家财、可号动九州十三县的亏帮头子。生活在改革大潮的李氏后人中，有飞黄腾达的市长，为富不任的经理、醉生梦死的情人、离婚不归的媳妇。历史和现实的强大反差，祖先和后代的不同人物命运，构成了一幅幅丰富多彩的人生画卷。','sohu$$$qq$$$youku','$$$$$$','$$$$$$','第1集$http://tv.sohu.com/20161009/n469817627.shtml#第2集$http://tv.sohu.com/20161009/n469817630.shtml#第3集$http://tv.sohu.com/20161009/n469817633.shtml#第4集$http://tv.sohu.com/20161009/n469817639.shtml#第5集$http://tv.sohu.com/20161009/n469817644.shtml#第6集$http://tv.sohu.com/20161009/n469817652.shtml#第7集$http://tv.sohu.com/20161009/n469817669.shtml#第8集$http://tv.sohu.com/20161009/n469817683.shtml#第9集$http://tv.sohu.com/20161009/n469817693.shtml#第10集$http://tv.sohu.com/20161009/n469817703.shtml#第11集$http://tv.sohu.com/20161009/n469817712.shtml#第12集$http://tv.sohu.com/20161009/n469817719.shtml#第13集$http://tv.sohu.com/20161009/n469817727.shtml#第14集$http://tv.sohu.com/20161009/n469817736.shtml#第15集$http://tv.sohu.com/20161009/n469817741.shtml#第16集$http://tv.sohu.com/20161009/n469817746.shtml#第17集$http://tv.sohu.com/20161009/n469817755.shtml$$$01$http://v.qq.com/x/cover/cmtly85uxu985pn/c0020ienox2.html#02$http://v.qq.com/x/cover/cmtly85uxu985pn/e0020k9c1gu.html#03$http://v.qq.com/x/cover/cmtly85uxu985pn/t0020e04plj.html#04$http://v.qq.com/x/cover/cmtly85uxu985pn/z0020700xq6.html#05$http://v.qq.com/x/cover/cmtly85uxu985pn/p0020p6oi18.html#06$http://v.qq.com/x/cover/cmtly85uxu985pn/v0020fwkycx.html#07$http://v.qq.com/x/cover/cmtly85uxu985pn/p0020lqmqea.html#08$http://v.qq.com/x/cover/cmtly85uxu985pn/a0020skh71u.html#09$http