INSERT INTO `mac_vod` VALUES('16686','非常接触','共20集全','feichangjiechu','F','','http://photocdn.sohu.com/kis/fengmian/53/53097/53097_ver_big_20160926154503.jpg','http://photocdn.sohu.com/kis/fengmian/53/53097/53097_ver_big_20160926154503.jpg','','巍子/廖京生/邬倩倩/戴娇倩/盖丽丽','尤小刚','网络公司,投资顾问,总经理,老朋友,观察者','共20集全','大陆','国语','2001','12','',',431,','0','0','0','0','0','0','0','0','866649','0','0','0','0','0','0','2.0','0','141','1481692018','1482341109','0','0','东南沿海，我军就要三军联合演习，由此，围绕着我导弹发射的保障与干扰等关键问题，雷和平等我国安人员与某海外间谍机关特务，展开了一场你死我活的生死大比拼。雷和平等接到我海外密报，某海外间谍组织诺亚山庄，特地制定了代号为“诺查丹玛斯”行动，派遣间谍潜入大陆，搜集我导弹机密资料、破坏我导弹发射。此时，望海市国际经贸洽谈会正隆重召开，一批间谍乘机混入。其中，就有代号“乖乖兔”的范青春，他以投资顾问的身份，前来与研制我导弹“K4”技术的快线网络公司考察，而快线的总经理丁欣如，则是范当年插队时的恋人，雷和平也是他们插队时的好朋友。就此，雷和平与打着寻亲与投资旗号的老朋友范青春，明里暗中，亲情与敌我双重较量交叉起伏，不断变化进行着一次次斗智斗勇的“非常接触”。范青春不断调动“喜鹊”、“观察者三号”等间谍迷惑雷和平等人，而此间还有号称“港岛一狐”的奸商林黄可馨和她助手何小绿的搅和，现代青年“电脑疯子”徐文正“另类”举动不断，IHC东亚间谍机关琪琪以交际花身份频频诱惑出击，还有我某金融干部黎仁龙境外下水与胆小自首，等等，都使得案情波云诡谲，险象环生，一度使得雷和平等差点迷失了主方向。在老厅长帮助下，雷和平设计了“非常接触”计划，决定以假装提前行动引蛇出洞。此举果然奏效，大小间谍纷纷浮出水面。而在一次被敌方下套陷害的过程中，雷和平发现，原来自己的对手就是范青春。范青春妄图借丁欣如女儿与年轻舰长杨帆的恋人关系窃取我机密，以及组织各方间谍，利用高科技电子技术手段进行自杀性疯狂反击等动作，都终被雷和平等—一化解。演习准时进行，范青春等亲自上阵对我方导弹实施强磁场干扰，雷和平从天而降，将其当场抓获。真相大白：范青春、黎仁龙等竟然都是双重间谍，同为诺亚山庄和IHC东亚间谍机关服务。而我们的一位国安战士也因此献出了宝贵的生命，她就是林黄可馨助手、那位看似很傻却极有心机的何小绿。国际经贸洽谈会圆满闭幕。与此同时，雷和平的助手肖一丁已取得诺亚山庄信任，正准备潜入大陆执行新的“S计划”。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161010/n469909415.shtml#第2集$http://tv.sohu.com/20161010/n469909429.shtml#第3集$http://tv.sohu.com/20161010/n469909441.shtml#第4集$http://tv.sohu.com/20161010/n469909447.shtml#第5集$http://tv.sohu.com/20161010/n469909460.shtml#第6集$http://tv.sohu.com/20161010/n469909473.shtml#第7集$http://tv.sohu.com/20161010/n469909485.shtml#第8集$http://tv.sohu.com/20161010/n469909494.shtml#第9集$http://tv.sohu.com/20161010/n469909507.shtml#第10集$http://tv.sohu.com/20161010/n469909519.shtml#第11集$http://tv.sohu.com/20161010/n469909530.shtml#第12集$http://tv.sohu.com/20161010/n469909543.shtml#第13集$http://tv.sohu.com/20161010/n469909556.shtml#第14集$http://tv.sohu.com/20161010/n469909