INSERT INTO `mac_vod` VALUES('16687','布尔什维克兄弟','共20集全','buershiweikexiongdi','B','','http://photocdn.sohu.com/kis/fengmian/1206/1206682/1206682_ver_big_20160926132503.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206682/1206682_ver_big_20160926132503.jpg','','李幼斌/何政军/郑铮/田岷/陈瑾','王冀邢','布尔什维克,婚外情,办公室,市政府','共20集全','大陆','国语','1994','12','',',460,','0','0','0','0','0','0','0','0','945335','0','0','0','0','0','0','9.0','0','66','1481692019','1482341102','0','0','少年刘布接到了一个从市政府打来的电话，于是，她给加班的父亲去送宵夜。在父亲半敞的办公室门外，她看见父亲和年轻的秦芳拥抱在一起。刘布惊恐万分地返身逃走了，空荡荡的走廊里，回响着被惊动了的刘水长的吼叫，而在不引人注意的一个角落里，一手导演了这一幕的秘书王锐，露出了一脸恶毒而快意的笑容。刘家的平静被父亲的婚外情彻底打破了，不堪打击的母亲左淑云住进了医院。刘布跟踪秦芳直到她的家中，当面指责，却在秦芳的一句“我很爱你父亲”的表白前不知所措。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161009/n469817369.shtml#第2集$http://tv.sohu.com/20161009/n469817374.shtml#第3集$http://tv.sohu.com/20161009/n469817380.shtml#第4集$http://tv.sohu.com/20161009/n469817385.shtml#第5集$http://tv.sohu.com/20161009/n469817395.shtml#第6集$http://tv.sohu.com/20161009/n469817407.shtml#第7集$http://tv.sohu.com/20161009/n469817410.shtml#第8集$http://tv.sohu.com/20161009/n469817412.shtml#第9集$http://tv.sohu.com/20161009/n469817417.shtml#第10集$http://tv.sohu.com/20161009/n469817419.shtml#第11集$http://tv.sohu.com/20161009/n469817421.shtml#第12集$http://tv.sohu.com/20161009/n469817424.shtml#第13集$http://tv.sohu.com/20161009/n469817428.shtml#第14集$http://tv.sohu.com/20161009/n469817432.shtml#第15集$http://tv.sohu.com/20161009/n469817443.shtml#第16集$http://tv.sohu.com/20161009/n469817451.shtml#第17集$http://tv.sohu.com/20161009/n469817458.shtml#第18集$http://tv.sohu.com/20161009/n469817468.shtml#第19集$http://tv.sohu.com/20161009/n469817478.shtml#第20集$http://tv.sohu.com/20161009/n469817485.shtml$$$http://v.youku.com/v_show/id_XMTgzMDU3MzMyMA==.html#http://v.youku.com/v_show/id_XMTgzMDU3NTIyMA==.html#http://v.youku.com/v_show/id_XMTgzMTMyNTQyOA==.html#http://v.youku.com/v_show/id_XMTgzMDU4MTE4OA==.html#http://v.youku.com/v_show/id_XMTgzMDU4NzE0OA==.html#http://v.youku.com/v_show/id_XMTgzMT