INSERT INTO `mac_vod` VALUES('16688','爱我给我一个家','共27集全','aiwogeiwoyigejia','A','','http://photocdn.sohu.com/kis/fengmian/1082/1082478/1082478_ver_big_20160920143503.jpg','http://photocdn.sohu.com/kis/fengmian/1082/1082478/1082478_ver_big_20160920143503.jpg','','汤镇宗/金巧巧/刘琦/黎一萱/周浩东','周凤鸣','爱我,故事,命运,女孩,依兰','共27集全','大陆','国语','2006','12','',',461,','0','0','0','0','0','0','0','0','937101','0','0','0','0','0','0','6.0','0','390','1481692019','1482341107','0','0','本剧讲述了四个美丽睿智的女孩何茹、林依兰、小辣椒和安子背井离乡到南滨打工的故事。她们虽然同时漂泊在海滨，但对生活的态度及命运却截然不同，她们经历着欲罢不能的恋情；经历着一同欢笑一同流泪而又矛盾重重的友情；经历着对未知归宿的迷茫和生离死别的变迁。','sohu','','','第1集$http://tv.sohu.com/20161010/n469891474.shtml#第2集$http://tv.sohu.com/20161010/n469891482.shtml#第3集$http://tv.sohu.com/20161010/n469891489.shtml#第4集$http://tv.sohu.com/20161010/n469891499.shtml#第5集$http://tv.sohu.com/20161010/n469891504.shtml#第6集$http://tv.sohu.com/20161010/n469891507.shtml#第7集$http://tv.sohu.com/20161010/n469891515.shtml#第8集$http://tv.sohu.com/20161010/n469891520.shtml#第9集$http://tv.sohu.com/20161010/n469891525.shtml#第10集$http://tv.sohu.com/20161010/n469891536.shtml#第11集$http://tv.sohu.com/20161010/n469891538.shtml#第12集$http://tv.sohu.com/20161010/n469891542.shtml#第13集$http://tv.sohu.com/20161010/n469891549.shtml#第14集$http://tv.sohu.com/20161010/n469891563.shtml#第15集$http://tv.sohu.com/20161010/n469891568.shtml#第16集$http://tv.sohu.com/20161010/n469891582.shtml#第17集$http://tv.sohu.com/20161010/n469891595.shtml#第18集$http://tv.sohu.com/20161010/n469891597.shtml#第19集$http://tv.sohu.com/20161010/n469891599.shtml#第20集$http://tv.sohu.com/20161010/n469891607.shtml#第21集$http://tv.sohu.com/20161010/n469891618.shtml#第22集$http://tv.sohu.com/20161010/n469891622.shtml#第23集$http://tv.sohu.com/20161010/n469891626.shtml#第24集$http://tv.sohu.com/20161010/n469891628.shtml#第25集$http://tv.sohu.com/20161010/n469891630.shtml#第26集$http://tv.sohu.com/20161010/n469891640.shtml#第27集$http://tv.sohu.com/20161010/n469891655.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16689','圈内圈外','共125集全','quannaquanwai','Q','','http://photocdn.sohu.com/kis/fengmian/61/61467/61467_ver_big_20160926164010.jpg','http://photocdn.sohu.com/kis/fengmian/61/61467/61467_ver_big_20160926164010.jpg','','刘惠/方青卓/丁宵汉/倪虹洁/张曦文','娄乃鸣','普天下,小人物,演艺圈,有才华,主人公','共125集全','大陆','国语','2004','12','',',462,','0','0','0','0','0','0','0','0','157223','0','0','0','0','0','0','3.0','0','190','1481692019','1482341109','0','0','该剧的主人公都是演艺圈里的小人物，在五光十色的背景下不懈追求。像许多演员一样，他们有时觉得自己是最好的演员；像许多编剧一样，他们有时认为自己是普天下最有才华的编剧。不过当下这段时间，大家都有点小小的不如意，所以叹息自己“养在深闺无人识”，却又坚信“天生我才必有用”，牢骚归牢骚，哀伤也哀伤，但总的来说，道路曲折，前途光明，大家都相信自己有出头之日，所以就一如既往的努力着。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161010/n469904110.shtml#第2集$http://tv.sohu.com/20161010/n469904122.shtml#第3集$http://tv.sohu.com/20161010/n469904138.shtml#第4集$http://tv.sohu.com/20161010/n469904156.shtml#第5集$http://tv.sohu.com/20161010/n469904175.shtml#第6集$http://tv.sohu.com/20161010/n469904196.shtml#第7集$http://tv.sohu.com/20161010/n469904209.shtml#第8集$http://tv.sohu.com/20161010/n469904231.shtml#第9集$http://tv.sohu.com/20161010/n469904254.shtml#第10集$http://tv.sohu.com/20161010/n469904273.shtml#第11集$http://tv.sohu.com/20161010/n469904299.shtml#第12集$http://tv.sohu.com/20161010/n469904322.shtml#第13集$http://tv.sohu.com/20161010/n469904349.shtml#第14集$http://tv.sohu.com/20161010/n469904371.shtml#第15集$http://tv.sohu.com/20161010/n469904390.shtml#第16集$http://tv.sohu.com/20161010/n469904409.shtml#第17集$http://tv.sohu.com/20161010/n469904431.shtml#第18集$http://tv.sohu.com/20161010/n469904451.shtml#第19集$http://tv.sohu.com/20161010/n469904472.shtml#第20集$http://tv.sohu.com/20161010/n469904497.shtml#第21集$http://tv.sohu.com/20161010/n469904523.shtml#第22集$http://tv.sohu.com/20161010/n469904533.shtml#第23集$http://tv.sohu.com/20161010/n469904553.shtml#第24集$http://tv.sohu.com/20161010/n469904570.shtml#第25集$http://tv.sohu.com/20161010/n469904590.shtml#第26集$http://tv.sohu.com/20161010/n469904605.shtml#第27集$http://tv.sohu.com/20161010/n469904620