INSERT INTO `mac_vod` VALUES('16690','内线','共31集全','naxian','N','','http://photocdn.sohu.com/kis/fengmian/73/73368/73368_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/73/73368/73368_ver_big.jpg','','孙淳/钟汉良/孙菲菲/樊志起/杜雨露','陶玲玲','渡江战役,解放军部队,蒋介石,国民党,联系人','共31集全','大陆','国语','2009','12','',',463,','0','0','0','0','0','0','0','0','220225','0','0','0','0','0','0','10.0','0','372','1481692019','1482341102','0','0','解放军部队为解放全中国准备渡过长江之际，蒋介石依靠长江天险妄图划江而治，渡江战役一触即发。临江，这座号称楚头吴尾的古城，一夜之间成为我军渡江作战的战略要地重要隘口，成为国民党蒋系、桂系和解放军三方势力争夺的焦点。面对着对岸陈兵百万气势如虹的解放军，面对着国民党内部的党派争斗，临江城防司令陈怀远——这个国民党军中的彪悍战将，背后涌出无数暗影，一时间，内线密布，谍影幢幢。就在中共地下党派出潜伏在国民党军中的地下党员“报春鸟”对临江城防司令陈怀远实施策反之时，她的真实身份随着单线联系人的牺牲变得扑朔迷离，连中共地下党都无法判断出谁才是真正的“报春鸟”；保密局此时也派出干将张弛坐镇临江，监视临江的一举一动。一个大策反大起义的故事即将在三方的角逐猎杀中展开。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161009/n469814721.shtml#第2集$http://tv.sohu.com/20161009/n469814750.shtml#第3集$http://tv.sohu.com/20161009/n469814762.shtml#第4集$http://tv.sohu.com/20161009/n469814774.shtml#第5集$http://tv.sohu.com/20161009/n469814790.shtml#第6集$http://tv.sohu.com/20161009/n469814801.shtml#第7集$http://tv.sohu.com/20161009/n469814811.shtml#第8集$http://tv.sohu.com/20161009/n469814822.shtml#第9集$http://tv.sohu.com/20161009/n469814835.shtml#第10集$http://tv.sohu.com/20161009/n469814855.shtml#第11集$http://tv.sohu.com/20161009/n469814882.shtml#第12集$http://tv.sohu.com/20161009/n469814910.shtml#第13集$http://tv.sohu.com/20161009/n469814936.shtml#第14集$http://tv.sohu.com/20161009/n469814959.shtml#第15集$http://tv.sohu.com/20161009/n469814977.shtml#第16集$http://tv.sohu.com/20161009/n469814994.shtml#第17集$http://tv.sohu.com/20161009/n469815011.shtml#第18集$http://tv.sohu.com/20161009/n469815024.shtml#第19集$http://tv.sohu.com/20161009/n469815033.shtml#第20集$http://tv.sohu.com/20161009/n469815044.shtml#第21集$http://tv.sohu.com/20161009/n469815056.shtml#第22集$http://tv.sohu.com/20161009/n469815071.shtml#第23集$http://tv.sohu.com/20161009/n469815083.shtml#第24集$http://tv.sohu.com/20161009/n469815092.shtml#第25集$http://tv.sohu.com/20161009/n4698151