INSERT INTO `mac_vod` VALUES('16691','天龙神剑','','tianlongshenjian','T','','http://photocdn.sohu.com/kis/fengmian/1098/1098309/1098309_ver_big_20160921155002.jpg','http://photocdn.sohu.com/kis/fengmian/1098/1098309/1098309_ver_big_20160921155002.jpg','','黄海冰/吴廷烨/李耀敬','雷瑞麟','天龙神剑,女扮男装,血流成河,天龙山,英雄','','大陆','国语','2005','12','',',386,','0','0','0','0','0','0','0','0','223383','0','0','0','0','0','0','1.0','0','125','1481692019','1482344870','0','0','江湖风云急，一剑定乾坤，笑傲天下小，英雄最情深。比武招亲会上，肖无忌凭一柄利剑，有如神助，力克群雄，赢得才女闵乐倩的芳心，可招来了兵部尚书之子陆猛的忌恨。不久，大祸临头，全家满门抄斩，他在陆家小姐陆素素的同情下才得逃脱，从此单持神剑，独闯江湖，后结识江湖豪侠穆野并与一起劫囚车，杀贪官司，仗义行侠，劫富济贫，除暴安良。天龙山下，官兵觅得踪迹，设下圈套，重兵围攻，双方杀得天昏地暗，血流成河，危难之际，山寨女主马婉云出手相救，并对无忌充满了爱慕之心。无忌走后，陆公子公然逼婚，为逃魔掌，闵乐倩远走他乡，偶遇一老道人指点，练就一身武功，正巧皇上张榜求贤，女扮男装入宫并深得皇上赏识。兵部尚书阴谋篡位，闵乐倩征得皇上同意与无忌兵合一处，合力围剿，忠心平叛，一场大战即将爆发。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161010/n469890458.shtml#第2集$http://tv.sohu.com/20161010/n469890462.shtml#第3集$http://tv.sohu.com/20161010/n469890474.shtml#第4集$http://tv.sohu.com/20161010/n469890482.shtml#第5集$http://tv.sohu.com/20161010/n469890488.shtml#第6集$http://tv.sohu.com/20161010/n469890494.shtml#第7集$http://tv.sohu.com/20161010/n469890504.shtml#第8集$http://tv.sohu.com/20161010/n469890522.shtml#第9集$http://tv.sohu.com/20161010/n469890550.shtml#第10集$http://tv.sohu.com/20161010/n469890581.shtml#第11集$http://tv.sohu.com/20161010/n469890604.shtml#第12集$http://tv.sohu.com/20161010/n469890631.shtml#第13集$http://tv.sohu.com/20161010/n469890643.shtml#第14集$http://tv.sohu.com/20161010/n469890655.shtml#第15集$http://tv.sohu.com/20161010/n469890664.shtml#第16集$http://tv.sohu.com/20161010/n469890670.shtml#第17集$http://tv.sohu.com/20161010/n469890687.shtml#第18集$http://tv.sohu.com/20161010/n469890709.shtml#第19集$http://tv.sohu.com/20161010/n469890720.shtml#第20集$http://tv.sohu.com/20161010/n469890734.shtml$$$01$http://v.qq.com/x/cover/74knnc2ir4acs07/n0021jimq7v.html#02$http://v.qq.com/x/cover/74knnc2ir4acs07/p0021j9sl3h.html#03$http://v.qq.com/x/cover/74knnc2ir4acs07/z0021fcldyk.html#04$http://v.qq.com