INSERT INTO `mac_vod` VALUES('16693','西厢传奇','共21集全','xixiangchuanqi','X','','http://photocdn.sohu.com/kis/fengmian/1019/1019303/1019303_ver_big_20160921163503.jpg','http://photocdn.sohu.com/kis/fengmian/1019/1019303/1019303_ver_big_20160921163503.jpg','','陈丽峰/陶慧敏/刘小锋/何苗/耿咏','龚艺群','西厢记,传奇,才子,红娘,洛阳','共21集全','大陆','国语','2001','12','',',351,','0','0','0','0','0','0','0','0','607032','0','0','0','0','0','0','7.0','0','295','1481692020','1482341106','0','0','本剧根据唐元稹所作《莺莺传》及元王实甫所著《西厢记》改编、发展、敷演而成。实乃元稹自传。唐时，已故相国千金莺莺及侍婢红娘，随老夫人过洛阳，见难民当道，因而痛骂迎面相遇的“洛阳知府”。谁知被骂者越挨骂越高兴，原来此人竟是名播海内的才子张生。张生本来便恃才傲物蔑视官府，挨骂后便乘兴写下名诗《农家怨》讥刺朝政。洛阳知府夏昌衔恨伺机报复，先派艳妓勾引张生，企图坏其名声，一计不成又设法诱出张生不满朝政之言论，将其堂审收监。张生毫不屈服，诟骂不止。后经友人设法营救出监，但已与官府结下仇隙。','sohu','','','第1集$http://tv.sohu.com/20161010/n469884747.shtml#第2集$http://tv.sohu.com/20161010/n469884756.shtml#第3集$http://tv.sohu.com/20161010/n469884760.shtml#第4集$http://tv.sohu.com/20161010/n469884765.shtml#第5集$http://tv.sohu.com/20161010/n469884768.shtml#第6集$http://tv.sohu.com/20161010/n469884774.shtml#第7集$http://tv.sohu.com/20161010/n469884783.shtml#第8集$http://tv.sohu.com/20161010/n469884794.shtml#第9集$http://tv.sohu.com/20161010/n469884797.shtml#第10集$http://tv.sohu.com/20161010/n469884803.shtml#第11集$http://tv.sohu.com/20161010/n469884811.shtml#第12集$http://tv.sohu.com/20161010/n469884822.shtml#第13集$http://tv.sohu.com/20161010/n469884829.shtml#第14集$http://tv.sohu.com/20161010/n469884834.shtml#第15集$http://tv.sohu.com/20161010/n469884842.shtml#第16集$http://tv.sohu.com/20161010/n469884859.shtml#第17集$http://tv.sohu.com/20161010/n469884869.shtml#第18集$http://tv.sohu.com/20161010/n469884885.shtml#第19集$http://tv.sohu.com/20161010/n469884902.shtml#第20集$http://tv.sohu.com/20161010/n469884916.shtml#第21集$http://tv.sohu.com/20161010/n469884928.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16694','共和国往事','共30集全','gongheguowangshi','G','','http://photocdn.sohu.com/kis/fengmian/1135/1135549/1135549_ver_big_20160926140503.jpg','http://photocdn.sohu.com/kis/fengmian/1135/1135549/1135549_ver_big_20160926140503.jpg','','邬倩倩/许还山/曹培昌/王学兵/张双利','尤小刚/陶玲玲','高中毕业,包办婚姻,白云山,党委书记,双胞胎','共30集全','大陆','国语','1999','12','',',394,','0','0','0','0','0','0','0','0','356464','0','0','0','0','0','0','9.0','0','361','1481692020','1482341108','0','0','北平和平解放，女主人公孙成蕙高中毕业，经其六叔，某军管分会主任孙立昆推荐，做了部队文化教员。爱上了团长刘存义，不料，刘存义的乡下妻子汤荣花找上门来，引起轩然大波。孙立昆对此极为反感。汤荣花表现出一个农村妇女的善良胸怀，理智地结束了这场没有感情的包办婚姻，并为刘存义说情。经孙立昆爱人周秀玉说服，刘存义、孙成蕙举行婚礼。大成国货公司老板陈梦熊与艺人柳如花，孙成伟与干娘牟月雯结了婚。“投身了革命”的孙成伟旧习难改，嫖妓被抓，原则性极强的孙立昆将他从军队除了名。孙成伟口口声声答应重新做人，实际上却仍打着孙立昆的旗号招摇。使出旧时代逢迎拍马，欺上瞒下的一套手段，将燃化部器材处长、孙立昆当年部下白云山拉下水。白云山作为大老虎被政府镇压。在劳改中，孙成伟再次当上了小队长。刘存义因在战争年代多次负伤，被分配到机关工作，很不适应，后一家人来到安徽建安媒矿当上矿长，孙成蕙做了矿生活科管理员。1961年春，共和国困难时期，刘援朝与妹妹刘胜利在县城与孤女盼盼唱花鼓戏讨饭，新上任的矿党委书记汤平把自己当天的口粮省给了三个孩子，自己却饿昏在了上任的途中，困难时期，孙成蕙又生下一对双胞胎，刘存义给四儿子起名“自然”，给五女儿起名“困难”，并收养了孤女盼盼。3440工作面出现险情，刘存义扛着材料，打起木垛，支起千斤顶，带领人们抢救压在矿石下的矿工，自己却被砸伤，住进医院。孙成蕙响应党的号召，主动下放。孙成伟出狱后再次表现了自己的生存能力，哪里有饭到哪家吃，骗母亲，也骗孙成蕙，孙成蕙却一直体谅大哥。在全力支援大三线建设的号召下，汤平、刘存义的英雄集体被调往大西南红旗煤矿。在大西南煤矿一干就是15年。自然和困难这对双胞胎被改名为文革和敢斗。小五刘敢斗不听母亲孙成蕙的话，宁肯跟舅舅倒腾服装，买卖越做越大。刘文革圆了哥哥姐姐的当兵梦，刘胜利被县委耿书记派到白水沟调查分田单干，反而推广起白水沟经验。刘文革为掩护战友光荣牺牲。变压器着火，刘存义亲自带领救护队员冲进火巷，被烧伤，面积为65%，为共和国流尽了最后一滴鲜血。根据政策，孙成蕙又恢复了公职。13年后，改革开放给阳山市带来从未有的生机。亚中集团公司董事长刘敢斗决定向银行贷款3000万建图书馆扩建工程。市长刘胜利只顾工作，丈夫钱远与王环环的公关小姐周清清生情，孙立昆的孙子孙笛与周清清、钱远勾结，借图书馆扩建工程推销劣质钢材，趁机大赚一笔。朝辉集团老总刘援朝管理严格有方，企业蒸蒸日上，股票上市。刘盼盼下了岗，与刘援朝女儿刘心、孙成蕙集资成立甜甜果品花卉商店，却遭到儿女们的百般阻挠。孙立昆为图书馆扩建工程奠基。刘敢斗为配合庆祝建国五十周年，搞革命传统教育基地。刘援朝领导下的朝辉电子集团兼工了比他大两倍的合江电子管总厂。刘胜利抓的新工业园和红旗矿转产顺利。在孙立昆的顾问下，刘敢斗传统教育展览搞了起来。钱远受贿、养情人的事败露。图书馆扩建工程轰然倒塌。刘胜利市长亲自打电话，请公安人员抓起自己的丈夫钱远，钱远去自首。孙立昆激动地对公安人员说，孙笛这种人也是劣质钢材，我要看着他落入法网。孙成蕙的放大照片放在新中国历史回顾展厅里，还有摄于小站的全家福。家宴中，孙家老少三代为孙立昆离异的妻子周秀玉接风。孙立昆感憾地说，这是一个家庭的故事，也是我们这个共和国的故事。清晨的天安门广场上，一面国旗伴着朝阳和国歌冉冉升起。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161010/n469903863.shtml#第2集$http://tv.sohu.com/20161010/n469903875.shtml#第3集$http://tv.sohu.co