INSERT INTO `mac_vod` VALUES('16695','妈妈的爱','共28集全','mamadeai','M','','http://photocdn.sohu.com/kis/fengmian/1071/1071367/1071367_ver_big_20160926152003.jpg','http://photocdn.sohu.com/kis/fengmian/1071/1071367/1071367_ver_big_20160926152003.jpg','','王姬/侯天来/李成儒/宇菲','杨毅','千言万语,眼角膜,妈妈的爱,玩具厂,癌细胞','共28集全','大陆','国语','2010','12','',',360,','0','0','0','0','0','0','0','0','779826','0','0','0','0','0','0','2.0','0','222','1481692020','1482341101','0','0','多年前，因为苗国金的疏忽女儿苗正欣的眼睛意外失明，为救治女儿的眼睛，他工作失职，导致五十万公款被骗，进了监狱。玩具厂意外发生了一场大火，苗国金的妻子洪秀为救徒弟哈将军受伤被送进医院。X光发现洪秀肺部有一块阴影，这正是癌症的凶兆，听此消息，洪秀顿时如同天旋地转，悲痛欲绝。得知自己不久于人世，洪秀做出了一生中最重要也是最残酷的决定。她要在癌细胞没有扩散之前把自己的眼角膜给女儿，她要在自己的有生之年看到女儿双眼复明。为了完成自己的愿望，洪秀恳求哈将军替自己保守绝症的秘密，并让他帮助咨询眼角膜移植手术的事宜。面对这样的惊天秘密，哈将军被震惊和感动，却无法面对残酷的现实。当苗正欣取下脸上的纱布，看到了这个世界，看到了妈妈，望着已经双目失明却欣慰而笑的妈妈，她震惊了，大喊了声“妈妈”跪倒在地，千言万语，亦无法表达她的心境，周围之人。无不感动泪下。然而令洪秀万万没有想到的是，正欣复明之后，所有的重担都压在了她身上，这负担远远超过了正欣的能力，面对亲情和爱情的重要抉择，正欣毅然路上了艰辛的报孝之路。','sohu','','','第1集$http://tv.sohu.com/20161009/n469812890.shtml#第2集$http://tv.sohu.com/20161009/n469812910.shtml#第3集$http://tv.sohu.com/20161009/n469812927.shtml#第4集$http://tv.sohu.com/20161009/n469812945.shtml#第5集$http://tv.sohu.com/20161009/n469812965.shtml#第6集$http://tv.sohu.com/20161009/n469812981.shtml#第7集$http://tv.sohu.com/20161009/n469813005.shtml#第8集$http://tv.sohu.com/20161009/n469813025.shtml#第9集$http://tv.sohu.com/20161009/n469813044.shtml#第10集$http://tv.sohu.com/20161009/n469813059.shtml#第11集$http://tv.sohu.com/20161009/n469813084.shtml#第12集$http://tv.sohu.com/20161009/n469813105.shtml#第13集$http://tv.sohu.com/20161009/n469813124.shtml#第14集$http://tv.sohu.com/20161009/n469813144.shtml#第15集$http://tv.sohu.com/20161009/n469813163.shtml#第16集$http://tv.sohu.com/20161009/n469813179.shtml#第17集$http://tv.sohu.com/20161009/n469813217.shtml#第18集$http://tv.sohu.com/20161009/n469813235.shtml#第19集$http://tv.sohu.com/20161009/n469813255.shtml#第20集$http://tv.sohu.com/20161009/n469813274.shtml#第21集$http://tv.sohu.com/20161009/n469813299.shtml#第22集$http://tv.sohu.com/20161009/n469813313.