INSERT INTO `mac_vod` VALUES('16699','血色玫瑰','共26集全','xuesemeigui','X','','http://photocdn.sohu.com/kis/fengmian/44/44380/44380_ver_big_20160927114503.jpg','http://photocdn.sohu.com/kis/fengmian/44/44380/44380_ver_big_20160927114503.jpg','','刘之冰/黄海冰/何政军/茹萍/王姬','王永利/张磊','日本侵略军,帝国主义,命悬一线,国民党,何政军','共26集全','大陆','国语','2007','12','',',371,','0','0','0','0','0','0','0','0','631142','0','0','0','0','0','0','5.0','0','28','1481692021','1482341110','0','0','茫茫硝烟中的敌我周旋枪林弹雨下的战地厮杀1937年日本帝国主义制造了骇人听闻的——南京大屠杀，西门飘雪等五个家破人亡的年轻女孩从血泊中站立起来，自发组织成金陵女神，向日本侵略军讨还血债，并在华生侦探社罗蒙（刘之冰饰）的暗中帮助之下，屡屡得手，搅的日军人心慌慌、鸡犬不宁。国民党特派员何路阳（王海地饰）千方百计接近她们，下决心欲将她们收为己用。此时她们的抵抗行动很快被日军发觉，深陷囹圄。日军准备杀一儆百，斩草除根，扑灭抗日烈焰。值此命悬一线之际，幸得纪洪涛（何政军饰）领导的江东抗日游击队及时营救，脱离险境。随后，她们参加了中国共产党所领导的抗日游击队伍，并在党的教育下，在纪队长的带领指挥下，她们从普通的民间少女成长为抗日先锋战士。此时日军在陈明将军（尤勇饰）率领下在武汉战线受到强烈抵抗，而陈夫人（茹萍饰）在金陵附近执行任务时候被捕，日军以此要挟陈明。见证南京大屠杀的电影胶片阴差阳错落到了斧头帮帮主郑云龙（刘金山饰）手里。在完成党组织交予的“智斩杀人魔王”、“勇救陈夫人”、“三运电影胶片”、“运药根据地”、“浴血军火库”等一系列大战斗任务中，她们用鲜血和生命书写了惊天地，泣鬼神的豪情，悲志，最后纷纷壮烈殉国。滴血般的玫瑰，绽放着女性的巾帼风采。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161010/n469902844.shtml#第2集$http://tv.sohu.com/20161010/n469902855.shtml#第3集$http://tv.sohu.com/20161010/n469902861.shtml#第4集$http://tv.sohu.com/20161010/n469902868.shtml#第5集$http://tv.sohu.com/20161010/n469902872.shtml#第6集$http://tv.sohu.com/20161010/n469902877.shtml#第7集$http://tv.sohu.com/20161010/n469902893.shtml#第8集$http://tv.sohu.com/20161010/n469902898.shtml#第9集$http://tv.sohu.com/20161010/n469902905.shtml#第10集$http://tv.sohu.com/20161010/n469902909.shtml#第11集$http://tv.sohu.com/20161010/n469902923.shtml#第12集$http://tv.sohu.com/20161010/n469902939.shtml#第13集$http://tv.sohu.com/20161010/n469902947.shtml#第14集$http://tv.sohu.com/20161010/n469902953.shtml#第15集$http://tv.sohu.com/20161010/n469902967.shtml#第16集$http://tv.sohu.com/20161010/n469902975.shtml#第17集$http://tv.sohu.com/20161010/n469902990.shtml#第18集$http://tv.sohu.com/20161010/n469903002.shtml#第19集$http://tv.sohu.com/20161010/n469903009.shtml#第20集$http://tv.sohu.com/20161010/n469903015.shtml#第21集