INSERT INTO `mac_vod` VALUES('16700','狭路相逢','共25集全','xialuxiangfeng','X','','http://photocdn.sohu.com/kis/fengmian/49/49401/49401_ver_big_20160926112503.jpg','http://photocdn.sohu.com/kis/fengmian/49/49401/49401_ver_big_20160926112503.jpg','','陈思诚/戴娇倩/金鑫/林江国','查传谊','高二学生,贩毒团伙,染上毒瘾,双胞胎,英雄','共25集全','大陆','国语','2007','12','',',404,','0','0','0','0','0','0','0','0','872425','0','0','0','0','0','0','3.0','0','494','1481692022','1482341105','0','0','本剧通过讲述我缉毒警察深入虎穴、将贩毒分子一网打尽的故事，展示了我国禁毒战场上波澜壮阔的场面，塑造了一批有血有肉的禁毒英雄形象，讴歌了我公安干警舍身忘我、无所畏惧的英雄气概，并昭示了“国家利益高于一切”的历史责任。本剧主题鲜明，不但涉及国家利益，也涉及伦理情感，在个人情感之上更昭显国家利益之重。本剧人物关系设置巧妙，情节跌宕起伏；同时感情充沛，感人至深。2007年某日，许江发生了一起人伦惨案，一个高二学生染上毒瘾，残忍地杀死了父母。此事震动省厅。杜诚以特派员身份，奉命前往许江，打击毒贩。杜诚是一名老资格的缉毒警察。1982年，他成功打入某贩毒团伙内部。贩毒团伙屡遭打击，老大龙哥怀疑有内鬼。他抓获了一名女警以及她的一对双胞胎儿子，令众人对她凌辱，以此试探。杜诚赫然发现，女警竟是自己的妻子！为保护杜诚，杜妻壮烈自杀。死前，她要杜诚照顾好两个孩子。围捕之日，龙哥、老三挟持着杜诚的两个孩子，仓皇逃窜，从此不知下落。而龙哥之子也沦为孤儿。杜诚把龙哥之子抚养成人，并培养成光荣的人民警察。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161009/n469812367.shtml#第2集$http://tv.sohu.com/20161009/n469812377.shtml#第3集$http://tv.sohu.com/20161009/n469812403.shtml#第4集$http://tv.sohu.com/20161009/n469812419.shtml#第5集$http://tv.sohu.com/20161009/n469812439.shtml#第6集$http://tv.sohu.com/20161009/n469812462.shtml#第7集$http://tv.sohu.com/20161009/n469812482.shtml#第8集$http://tv.sohu.com/20161009/n469812499.shtml#第9集$http://tv.sohu.com/20161009/n469812518.shtml#第10集$http://tv.sohu.com/20161009/n469812530.shtml#第11集$http://tv.sohu.com/20161009/n469812550.shtml#第12集$http://tv.sohu.com/20161009/n469812561.shtml#第13集$http://tv.sohu.com/20161009/n469812575.shtml#第14集$http://tv.sohu.com/20161009/n469812594.shtml#第15集$http://tv.sohu.com/20161009/n469812611.shtml#第16集$http://tv.sohu.com/20161009/n469812630.shtml#第17集$http://tv.sohu.com/20161009/n469812654.shtml#第18集$http://tv.sohu.com/20161009/n469812667.shtml#第19集$http://tv.sohu.com/20161009/n469812682.shtml#第20集$http://tv.sohu.com/20161009/n469812698.shtml#第21集$http://tv.sohu.com/20161009/n469812712.shtml#第22集$http://tv.sohu.com/20161009/n4698127