INSERT INTO `mac_vod` VALUES('16701','沧桑花楼街','共22集全','cangsanghualoujie','C','','http://photocdn.sohu.com/kis/fengmian/84/84124/84124_ver_big_20160927160004.jpg','http://photocdn.sohu.com/kis/fengmian/84/84124/84124_ver_big_20160927160004.jpg','','关礼杰/廖学秋/俞小凡/江涛/李敏','梦继','女大学生,关礼杰,都市人,记录,经理','共22集全','大陆','国语','2000','12','',',360,','0','0','0','0','0','0','0','0','918850','0','0','0','0','0','0','9.0','0','18','1481692022','1482341100','0','0','本片充满阴谋与真情，记录一群都市人刻骨铭心的过去和无法忘记的现在……情仇泯灭的大地上，唯一永恒存在的，唯一不变的真爱与信念。仇人公司濒临破产，而后低价收购；通过写匿名信揭发自己子虚乌有的经济问题，引起政府高层的关注，从而名利双收；在资金发生困难时，故意而名利双收；在资金发生因难时，故意勾引付小影的侄女——时尚漂亮性感的女大学生付立文，以获得其富有母亲的支持，以种种借口聘请付小影成为自己的部门经理，并设计使付小影家庭发生危机……一切都在年轻的事业家时光（关礼杰）的设计中进行着。付小影的弟弟与时光女友发生了一夜情，而时光与付小影、付立文之间的感情纠葛更让剧情悬念跌宕、扣人心弦。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161009/n469804276.shtml#第2集$http://tv.sohu.com/20161009/n469804284.shtml#第3集$http://tv.sohu.com/20161009/n469804302.shtml#第4集$http://tv.sohu.com/20161009/n469804321.shtml#第5集$http://tv.sohu.com/20161009/n469804329.shtml#第6集$http://tv.sohu.com/20161009/n469804344.shtml#第7集$http://tv.sohu.com/20161009/n469804354.shtml#第8集$http://tv.sohu.com/20161009/n469804366.shtml#第9集$http://tv.sohu.com/20161009/n469804375.shtml#第10集$http://tv.sohu.com/20161009/n469804396.shtml#第11集$http://tv.sohu.com/20161009/n469804414.shtml#第12集$http://tv.sohu.com/20161009/n469804424.shtml#第13集$http://tv.sohu.com/20161009/n469804432.shtml#第14集$http://tv.sohu.com/20161009/n469804442.shtml#第15集$http://tv.sohu.com/20161009/n469804451.shtml#第16集$http://tv.sohu.com/20161009/n469804461.shtml#第17集$http://tv.sohu.com/20161009/n469804466.shtml#第18集$http://tv.sohu.com/20161009/n469804505.shtml#第19集$http://tv.sohu.com/20161009/n469804520.shtml#第20集$http://tv.sohu.com/20161009/n469804535.shtml#第21集$http://tv.sohu.com/20161009/n469804545.shtml#第22集$http://tv.sohu.com/20161009/n469804559.shtml$$$http://v.youku.com/v_show/id_XNDc4MDY5MDIw.html#http://v.youku.com/v_show/id_XMTgxMzU2Mzc4NA==.html#http://v.youku.com/v_show/id_XNDc4MDY4ODE2.html#http://v.youku.com/v_show/id_XNDc5MzA4OTQw.html#http://v.youku.com/v_show/id_XNDc4MDY4Nzky.html#http://v.youku.com/v_show/id_XNDc4MDY4Nzk2.html#http://v.youku.com/v_show/id_XNDc4MDY4ODMy.html#http://v.youku.com/v_show/id_XNDc4MDY4ODAw.html#http://v.youku.com/v_show/id_XNDc4MDY4ODA0.html#http://v.youku.com/v_show/id_XNDc4MDY4ODEy.html#http://v.youku.com/v_show/id_XNDc4MDY4ODM2.html#http://v.youku.com/v_show/id_XNDc4MDY4ODQ0.html#http://v.youku.com/v_show/id_XNDc4MDY4ODQ4.html#http://v.youku.com/v_show/id_XNDc4MDY4ODUy.html#http://v.youku.com/v_show/id_XMTgxMzU4MDEyNA==.html#http://v.youku.com/v_show/id_XNDc4MDY4ODg0.html#http://v.youku.com/v_show/id_XNDc4MDY4ODg4.html#http://v.youku.com/v_show/id_XNDc4MDY4ODgw.html#http://v.youku.com/v_show/id_XNDc4MDY4ODU2.html#http://v.youku.com/v_show/id_XNDc4MDY4ODY4.html#http://v.youku.com/v_show/id_XNDc4MDY4ODcy.html#http://v.youku.com/v_show/id_XNDc4MDY4ODYw.html','','','','');
INSERT INTO `mac_vod` VALUES('16702','香格里拉','共33集全','xianggelila','X','','http://photocdn.sohu.com/kis/fengmian/185/185506/185506_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/185/185506/185506_ver_big.jpg','','胡歌/王力可/金莎/扎西顿珠/巍子','蒋家骏','香格里拉,金沙江,一见钟情,国民政府,年轻人','共33集全','大陆','国语','2011','12','',',362,','0','0','0','0','0','0','0','0','546916','0','0','0','0','0','0','1.0','0','403','1481692023','1482341104','0','0','1936年春，中国，云南，中甸地区。蓝天、白云、雪山、牧场。中甸地区一年一度的春季赛马节正在纳帕海的草甸子上紧张激烈地进行着。领先的是中甸土司勒仓多吉的女儿卓玛，紧跟其后的是名叫扎西平措的年轻人。扎西骑术更胜一筹，最终获得胜利。就在土司多吉给扎西颁奖的时候，扎西突然抽出弯刀挟持了多吉，逼他交出马贼首领“虫草老爹”。多吉对此并不知晓，拒不承认是自己所为。卓玛不顾叔父桑吉的阻拦，只身前往九龙湾匪寨营救父亲，也落入马贼之手。第二天，虫草老爹的尸首被扔到山寨外，临时大头领索朗执意要杀死多吉为老爹报仇，但扎西却认定此事另有隐情，他说服众人释放了多吉和卓玛。扎西的行为赢得了卓玛的好感，为日后二人的感情打下了基础。中甸国民政府县长王大隆要求召开传统的“春云会议”，决定是否狙击过境的红军。会上，多吉和活佛力排众议，决定放过红军。扎西与死去的虫草老爹感情深厚，一心要找出真凶。此外，扎西身上还有另一段仇恨，那就是他的阿妈和外公十年前在金沙江边惨遭杀害，他之所以投靠虫草老爹，甘当马贼就是要为阿妈和外公报仇。桑吉的儿子达瓦是昆明军官学校的学生，休假时带着美国教官康威回到家乡中甸。康威对卓玛一见钟情，但卓玛心里却惦念着扎西。扎西获知杀害阿妈的仇人乃是哈巴雪山马贼首领格赞，于是前去寻仇。格赞正在狙击一股红军侦察小分队，扎西的到来，意外地救了这支红军队伍。红军连长柳志洪在纳西族地区白水台养伤，得到东巴经师和中祥和他的女儿和梅的救助。扎西来到白水台，和梅分外高兴，当年扎西流浪到白水台时，正是和梅救了他，因此二人是青梅竹马。和梅深爱着扎西，但扎西却始终把她当妹妹看待。为了治疗柳志洪的腿伤，扎西带他前往中甸城求助于天主教堂的神父。但刚来到城外，便被桑吉手下的民团抓捕，投入大牢。桑吉执意要处死扎西，因为正是他让自己的阴谋破了产——原来，桑吉与索朗合谋害死了虫草老爹，他们一石二鸟的计划就是要让桑吉当上土司，而索朗当上九龙湾大首领。卓玛得知扎西被捉，冒险将其救下放走。扎西刺杀桑吉失手负伤，被和梅流浪歌手伦布救回白水台。伦布本来是个会唱弦子的马脚子，因为深爱和梅而自愿留在了白水台。木里土司的孙子仁巴切喜欢卓玛，于是向多吉提亲。多吉应允，但卓玛却不同意，她带着仁巴切前往白水台去见扎西，阴差阳错间，仁巴切意外打伤了和梅，致其失忆。扎西控制了索朗，并杀进桑吉府报仇。然而，卓玛的出现却意外地打乱了扎西的计划，对峙之中扎西挟持卓玛逃进了巴拉格宗大峡谷。桑吉让索朗率领民团士兵进攻巴拉格宗，扎西因寡不敌众悲壮跳崖。卓玛万分悲痛，她发现自己已经深深地爱上了扎西。索朗设下圈套，“意外”地救下了遭到桑吉暗杀的多吉，从而赢得了多吉的信任，很快被任命为民团司令。卓玛跟随父亲多吉巡视领地来到了白水台，当和梅得知扎西的死讯时，痛不欲生，几番寻死。扎西跳崖未死，在巴拉村长者斯那老爹的救治下活了过来，通过斯那老爹的感召，他认识到了爱才是生活的最终目的，而仇恨只能让自己失去更多。浴火重生的扎西要去土司府向卓玛表达爱意，却被桑吉再次捕获，幸好斯那老爹将他救下。他来到白水台，得知心灰意冷的和梅不知所终，痴情的伦布尾随而去。扎西认为是自己耽误了和梅，只好将对卓玛的爱暂时放在一旁，也踏上了寻找和梅的路。和梅准备将自己的生命献给卡瓦格博神山，飞来寺的女尼将她救下。在女尼的感召下，和梅顿悟自己的真爱原来是伦布，一对有情人终成眷属。多吉逼迫卓玛嫁给索朗，卓玛坚决不从，在婚礼上逃走，投湖自杀。此时，扎西也来到土司府寻找卓玛，他被索朗抓住，眼看就要死于非命。桑吉不愿看到索朗坐大势力，救下了扎西。中甸彻底被索朗掌控，桑吉失望之下，被迫与阿墩子土司府的女土司娜仁茨姆成亲，欲图东山再起。1943年，参加了飞虎队的康威意外在中甸碧塔海的草甸坠机，当地傈僳族民众把他当做了白魔鬼，幸好碧云寺的女尼将其救下。这个女尼不是别人，正是消失多年的卓玛，原来卓玛并未投湖，而是管家隆多用生命将她藏了起来。与此同时，扎西已经成了一个马锅头，他率领马帮在崎岖的山路上救下了汉族僧人一通和尚，扎西和马脚子们的善良赢得了一通的尊敬与感激。已经成为土司的索朗为了恢复其贵族地位，独霸康南地区，不惜与日军勾结。他带人前去抢掠坠机上的物资，为了保护康威，卓玛不顾危险亮明了身份。索朗要将康威与卓玛一起抓走，幸好活佛出现，阻止了索朗的不义行为。一通原来是日军的间谍，被派来与索朗联系。但他在扎西等人的感召下放弃了军国主义思想，跪倒在活佛面前，交待了日军与索朗勾结的阴谋。当年奉命杀死扎西阿妈和阿公的马贼格赞告诉卓玛，扎西乃是多吉的私生子，与卓玛是同父异母的兄妹。深爱着扎西的卓玛得知真相，痛不欲生。扎西再次见到卓玛，勇敢地向她表白了自己的爱情。然而，卓玛把真相告诉了他，他如遭雷击，几欲寻死。命运弄人，两个相爱的人却无法相守。在卓玛的鼓励下，扎西振作精神，联合桑吉击败了索朗，并以多吉儿子的身份当上了中甸地区大土司。然而这并不能让他快乐，因为他心里仍然深深地爱着卓玛。为了保家卫国，扎西组织民团以及物资上前线抗击日军侵略。为了帮助康威重返蓝天，卓玛违心答应了木里土司仁巴切的求爱，条件是让仁巴切捐献一架飞机。扎西只能忍痛看着妹妹卓玛嫁给仁巴切，就在这时，飞来寺的女尼在和梅的搀扶下来到了中甸。这个女尼原来是卓玛的阿妈金安拉姆，她说当年多吉深爱着一个名叫曲美的平民女子，金安拉姆为了报复而与他人偷情生下了卓玛，也就是说卓玛并不是多吉的亲生女儿。扎西与卓玛这一对有情人终成眷属。大婚过后，扎西带领民团踏上了抗日的征程。','sohu','','','第1集$http://tv.sohu.com/20161009/n469799586.shtml#第2集$http://tv.sohu.com/20161009/n469799589.shtml#第3集$http://tv.sohu.com/20161009/n469799598.shtml#第4集$http://tv.sohu.com/20161009/n469799602.shtml#第5集$http://tv.sohu.com/20161009/n469799605.shtml#第6集$http://tv.sohu.com/20161009/n469799609.shtml#第7集$http://tv.sohu.com/20161009/n469799612.shtml#第8集$http://tv.sohu.com/20161009/n469799617.shtml#第9集$http://tv.sohu.com/20161009/n469799619.shtml#第10集$http://tv.sohu.com/20161009/n469799625.shtml#第11集$http://tv.sohu.com/20161009/n469799628.shtml#第12集$http://tv.sohu.com/20161009/n469799635.shtml#第13集$http://tv.sohu.com/20161009/n469799637.shtml#第14集$http://tv.sohu.com/20161009/n469799642.shtml#第15集$http://tv.sohu.com/20161009/n469799650.shtml#第16集$http://tv.sohu.com/20161009/n469799658.shtml#第17集$http://tv.sohu.com/20161009/n469799674.shtml#第18集$http://tv.sohu.com/20161009/n469799678.shtml#第19集$http://tv.sohu.com/20161009/n469799680.shtml#第20集$http://tv.sohu.com/20161009/n469799687.shtml#第21集$http://tv.sohu.com/20161009/n469799692.shtml#第22集$http://tv.sohu.com/20161009/n469799698.shtml#第23集$http://tv.sohu.com/20161009/n469799701.shtml#第24集$http://tv.sohu.com/20161009/n469799706.shtml#第25集$http://tv.sohu.com/20161009/n469799714.shtml#第26集$http://tv.sohu.com/20161009/n469799732.shtml