INSERT INTO `mac_vod` VALUES('16703','天网孽情','共24集全','tianwangnieqing','T','','http://photocdn.sohu.com/kis/fengmian/94/94209/94209_ver_big_20160927160503.jpg','http://photocdn.sohu.com/kis/fengmian/94/94209/94209_ver_big_20160927160503.jpg','','胡军/罗湘晋/刘小锋','辛嘉润','人体器官,总经理,企业家,文学奖,刑警队','共24集全','大陆','国语','2001','12','',',431,','0','0','0','0','0','0','0','0','264563','0','0','0','0','0','0','8.0','0','131','1481692023','1482341105','0','0','根据人民文学奖得者方方原著《过程》改编。这是一部公安题材的警察人性剧，通过侦破一起人体器官贩卖案，反映了办案人员的情感历程，刻画了他们在与罪犯进行不屈不挠的斗争中所表现的英雄形象。刑警队李亦东有着非凡的智慧，他总能从别人不易察觉的蛛丝马迹中找到一些很有价值的线索，然而他的思维方式很难被人接受，他属下的刑警江白帆却偏偏易受一些表面现象的迷惑，因而在工作的方式上，二人总是有许多无法解开的冲突。丁敏是冯阡阡的好朋友、丁敏深深地爱着李亦东，可李亦东偏偏对长相酷似自己已故女友林芳的冯阡阡情有独钟，而冯阡阡却是一个罪犯的女儿，曾坐过牢，出狱后与杜强关系暧昧。杜强是一个受人尊敬的成功企业家，李亦东却怀疑他是人体器官司贩卖案的主谋，而江白帆却对杜强十分崇拜，杜强也很欣赏江白帆的聪明才智，二人有着很好的关系，因为江白帆在与杜强接触中不经意间透露了许多有价值的消息而被开除出警队，江白帆认为这是李亦东公报仇私。江白帆失业后去杜强的公司打工，不想竟扶摇直上，不久就坐上了总经理的位子，然而这实际上是杜强为他精心设计好的一个陷阱，丁敏独自去查冯阡阡和杜强的犯罪证据及两人的暖昧关系。不料发生意外，险些丧命，幸被江白帆所救。李亦东的侦破工作颇有进展，掌握了杜强的一些犯罪线索，同时江白帆也逐渐的了解了事件的真相，在公司里搜集到了许多杜强的犯罪证据。然而嗅觉灵敏的杜强却闻风而逃，而且劫持了冯阡阡与丁敏，欲将李亦东置于死地。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161009/n469801160.shtml#第2集$http://tv.sohu.com/20161009/n469801175.shtml#第3集$http://tv.sohu.com/20161009/n469801182.shtml#第4集$http://tv.sohu.com/20161009/n469801192.shtml#第5集$http://tv.sohu.com/20161009/n469801198.shtml#第6集$http://tv.sohu.com/20161009/n469801203.shtml#第7集$http://tv.sohu.com/20161009/n469801211.shtml#第8集$http://tv.sohu.com/20161009/n469801218.shtml#第9集$http://tv.sohu.com/20161009/n469801225.shtml#第10集$http://tv.sohu.com/20161009/n469801231.shtml#第11集$http://tv.sohu.com/20161009/n469801246.shtml#第12集$http://tv.sohu.com/20161009/n469801262.shtml#第13集$http://tv.sohu.com/20161009/n469801277.shtml#第14集$http://tv.sohu.com/20161009/n469801288.shtml#第15集$http://tv.sohu.com/20161009/n469801298.shtml#第16集$http://tv.sohu.com/20161009/n469801310.shtml#第17集$http://tv.sohu.com/20161009/n469801313.shtml#第18集$http://tv.sohu.com/20161009/n469801319.shtml#第19集$http://tv.sohu.com/20161009/