INSERT INTO `mac_vod` VALUES('16704','在那遥远的地方','共28集全','zainayaoyuandedifang','Z','','http://photocdn.sohu.com/kis/fengmian/78/78442/78442_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/78/78442/78442_ver_big.jpg','','李幼斌/殷桃/吴健/沈晓海/顾燕','俞钟','电视剧,昆仑山,李云龙,沈晓海,李幼斌','共28集全','大陆','国语','2009','12','',',465,','0','0','0','0','0','0','0','0','586760','0','0','0','0','0','0','1.0','0','104','1481692023','1482341103','0','0','《在那遥远的地方》引是中国首部描写边防军人的电视剧，以昆仑山的雪域高原风光和中苏对抗为背景。其中，李幼斌饰演一位指挥全局的边防部队司令官，性格上保留了其“李云龙式”的耿直与刚毅，宋汶霏、殷桃扮演其两个反差很大的女儿。作为建国六十周年的献礼作品，由著名演员李幼斌、青年演员沈晓海、殷桃加盟的电视剧《在那遥远的地方》，是中国首部描写边防军人的电视剧。也有同名歌曲——《在那遥远的地方》，是西部歌王王洛宾在1939年创作的一首至今仍被广为传唱的歌曲。','sohu$$$qq','$$$','$$$','第1集$http://tv.sohu.com/20161124/n474040884.shtml#第2集$http://tv.sohu.com/20161124/n474040895.shtml#第3集$http://tv.sohu.com/20161124/n474040904.shtml#第4集$http://tv.sohu.com/20161124/n474040912.shtml#第5集$http://tv.sohu.com/20161124/n474040926.shtml#第6集$http://tv.sohu.com/20161124/n474040938.shtml#第7集$http://tv.sohu.com/20161124/n474040952.shtml#第8集$http://tv.sohu.com/20161124/n474040958.shtml#第9集$http://tv.sohu.com/20161124/n474040991.shtml#第10集$http://tv.sohu.com/20161124/n474041022.shtml#第11集$http://tv.sohu.com/20161124/n474041032.shtml#第12集$http://tv.sohu.com/20161124/n474041038.shtml#第13集$http://tv.sohu.com/20161124/n474041044.shtml#第14集$http://tv.sohu.com/20161124/n474041059.shtml#第15集$http://tv.sohu.com/20161124/n474041078.shtml#第16集$http://tv.sohu.com/20161124/n474041091.shtml#第17集$http://tv.sohu.com/20161124/n474041099.shtml#第18集$http://tv.sohu.com/20161124/n474041116.shtml#第19集$http://tv.sohu.com/20161124/n474041122.shtml#第20集$http://tv.sohu.com/20161124/n474041132.shtml#第21集$http://tv.sohu.com/20161124/n474041142.shtml#第22集$http://tv.sohu.com/20161124/n474041158.shtml#第23集$http://tv.sohu.com/20161124/n474041173.shtml#第24集$http://tv.sohu.com/20161124/n474041182.shtml#第25集$http://tv.sohu.com/20161124/n474041197.shtml#第26集$http://tv.sohu.com/20161124/n474041206.shtml#第27集$http://tv.sohu.com/20161124/n4