INSERT INTO `mac_vod` VALUES('16705','大国医','共40集全','daguoyi','D','','http://photocdn.sohu.com/kis/fengmian/221/221725/221725_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/221/221725/221725_ver_big.jpg','','赵文瑄/徐帆/王绘春/刘莉莉/卡尔','吴子牛','慈禧太后,大国医,德高,平乐','共40集全','大陆','国语','2009','12','',',349,','0','0','0','0','0','0','0','0','155726','0','0','0','0','0','0','10.0','0','325','1481692023','1482341104','0','0','郭氏平乐正骨已有二百余年行医史，清代时医过慈禧太后，德高医精，闻名遐迩。郭家一直人丁不旺，到第四代传人郭一山，娶了两房夫人都相继去世，为传宗接代，让郭氏正骨代代相传，郭一山又急急迎娶小他十一岁的山村姑娘云鹤鸣。迎亲路上，突然有人抬着担架拦住了迎亲队伍……','sohu','','','第1集$http://tv.sohu.com/20161009/n469800265.shtml#第2集$http://tv.sohu.com/20161009/n469800272.shtml#第3集$http://tv.sohu.com/20161009/n469800284.shtml#第4集$http://tv.sohu.com/20161009/n469800290.shtml#第5集$http://tv.sohu.com/20161009/n469800299.shtml#第6集$http://tv.sohu.com/20161009/n469800309.shtml#第7集$http://tv.sohu.com/20161009/n469800328.shtml#第8集$http://tv.sohu.com/20161009/n469800339.shtml#第9集$http://tv.sohu.com/20161009/n469800350.shtml#第10集$http://tv.sohu.com/20161009/n469800362.shtml#第11集$http://tv.sohu.com/20161009/n469800373.shtml#第12集$http://tv.sohu.com/20161009/n469800384.shtml#第13集$http://tv.sohu.com/20161009/n469800397.shtml#第14集$http://tv.sohu.com/20161009/n469800405.shtml#第15集$http://tv.sohu.com/20161009/n469800410.shtml#第16集$http://tv.sohu.com/20161009/n469800416.shtml#第17集$http://tv.sohu.com/20161009/n469800421.shtml#第18集$http://tv.sohu.com/20161009/n469800427.shtml#第19集$http://tv.sohu.com/20161009/n469800437.shtml#第20集$http://tv.sohu.com/20161009/n469800446.shtml#第21集$http://tv.sohu.com/20161009/n469800453.shtml#第22集$http://tv.sohu.com/20161009/n469800463.shtml#第23集$http://tv.sohu.com/20161009/n469800470.shtml#第24集$http://tv.sohu.com/20161009/n469800480.shtml#第25集$http://tv.sohu.com/20161009/n469800482.shtml#第26集$http://tv.sohu.com/20161009/n469800489.shtml#第27集$http://tv.sohu.com/20161009/n469800496.shtml#第28集$http://tv.sohu.com/20161009/n469800508.shtml#第29集$http://tv.sohu.com/20161009/n469800523.shtml#第30集