INSERT INTO `mac_vod` VALUES('16706','补天裂','共26集全','butianlie','B','','http://photocdn.sohu.com/kis/fengmian/1088/1088572/1088572_ver_big_20160926140004.jpg','http://photocdn.sohu.com/kis/fengmian/1088/1088572/1088572_ver_big_20160926140004.jpg','','蒋恺/田少军/杨明娜/谢尔盖/牛星丽','尤小刚/陶玲玲','中国领土,中华民族,知识分子,帝国主义,侵略者','共26集全','大陆','国语','1998','12','',',442,','0','0','0','0','0','0','0','0','55575','0','0','0','0','0','0','1.0','0','379','1481692024','1482341103','0','0','清末年间（1898年），帝国主义列强对中国领土大肆侵略和瓜分，随着侵略者权益的不断扩大，软弱无能的清政府与外国列强英帝国主义签订了又一份丧权辱国的不平等条约《展拓香港界址专条》。易君恕、邓伯雄等中国传统知识分子，爱国的仁人志士忠贞保国，慷慨赴死，为了中华民族不屈不绕，同仇敌忾，奋勇斗争抗击侵略。剧中展示香港百年风情画，体现了感天动地生死恋，描述了异彩纷呈众生相，绘制了惨烈悲壮群英图。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161008/n469732551.shtml#第2集$http://tv.sohu.com/20161008/n469732573.shtml#第3集$http://tv.sohu.com/20161008/n469732578.shtml#第4集$http://tv.sohu.com/20161008/n469732582.shtml#第5集$http://tv.sohu.com/20161008/n469732586.shtml#第6集$http://tv.sohu.com/20161008/n469732590.shtml#第7集$http://tv.sohu.com/20161008/n469732598.shtml#第8集$http://tv.sohu.com/20161008/n469732606.shtml#第9集$http://tv.sohu.com/20161008/n469732616.shtml#第10集$http://tv.sohu.com/20161008/n469732625.shtml#第11集$http://tv.sohu.com/20161008/n469732634.shtml#第12集$http://tv.sohu.com/20161008/n469732637.shtml#第13集$http://tv.sohu.com/20161008/n469732642.shtml#第14集$http://tv.sohu.com/20161008/n469732654.shtml#第15集$http://tv.sohu.com/20161008/n469732669.shtml#第16集$http://tv.sohu.com/20161008/n469732677.shtml#第17集$http://tv.sohu.com/20161008/n469732680.shtml#第18集$http://tv.sohu.com/20161008/n469732682.shtml#第19集$http://tv.sohu.com/20161008/n469732687.shtml#第20集$http://tv.sohu.com/20161008/n469732697.shtml#第21集$http://tv.sohu.com/20161008/n469732703.shtml#第22集$http://tv.sohu.com/20161008/n469732713.shtml#第23集$http://tv.sohu.com/20161008/n469732721.shtml#第24集$http://tv.sohu.com/20161008/n469732731.shtml#第25集$http://tv.sohu.com/20161008/n469732742.shtml#第26集$http://tv.sohu.com/20161008/n469732750.shtml$$$http://v.youku.com/v_s