INSERT INTO `mac_vod` VALUES('16707','谁为梦想买单','共25集全','shuiweimengxiangmaidan','S','','http://photocdn.sohu.com/kis/fengmian/222/222330/222330_ver_big_20160926111503.jpg','http://photocdn.sohu.com/kis/fengmian/222/222330/222330_ver_big_20160926111503.jpg','','吕丽萍/孙海英/范明/戴娇倩/崔林','毛卫宁','金水河,个体户,高科技,老婆,故事','共25集全','大陆','国语','2007','12','',',355,','0','0','0','0','0','0','0','0','513971','0','0','0','0','0','0','3.0','0','438','1481692024','1482341104','0','0','故事叙述八十年代末，北方小镇金水河，通过勤劳致富的个体户们手里有了闲钱。聪明但是经常好做梦的刘奇思给大伙出了个“钱生钱”的好主意，那就是造飞机卖专利。在刘奇思好哥们五里香烤鸡店老板金守财的大力倡导下，大伙纷纷入股这个“高科技”项目，都梦想着飞机造成后能够一本万利。但刘奇思试飞不成功，虽说没被摔死，却被乡亲们追得走投无路，老婆也跟他离了婚。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161009/n469812132.shtml#第2集$http://tv.sohu.com/20161009/n469812165.shtml#第3集$http://tv.sohu.com/20161009/n469812190.shtml#第4集$http://tv.sohu.com/20161009/n469812208.shtml#第5集$http://tv.sohu.com/20161009/n469812228.shtml#第6集$http://tv.sohu.com/20161009/n469812246.shtml#第7集$http://tv.sohu.com/20161009/n469812263.shtml#第8集$http://tv.sohu.com/20161009/n469812276.shtml#第9集$http://tv.sohu.com/20161009/n469812285.shtml#第10集$http://tv.sohu.com/20161009/n469812296.shtml#第11集$http://tv.sohu.com/20161009/n469812308.shtml#第12集$http://tv.sohu.com/20161009/n469812316.shtml#第13集$http://tv.sohu.com/20161009/n469812331.shtml#第14集$http://tv.sohu.com/20161009/n469812346.shtml#第15集$http://tv.sohu.com/20161009/n469812362.shtml#第16集$http://tv.sohu.com/20161009/n469812374.shtml#第17集$http://tv.sohu.com/20161009/n469812386.shtml#第18集$http://tv.sohu.com/20161009/n469812409.shtml#第19集$http://tv.sohu.com/20161009/n469812427.shtml#第20集$http://tv.sohu.com/20161009/n469812443.shtml#第21集$http://tv.sohu.com/20161009/n469812467.shtml#第22集$http://tv.sohu.com/20161009/n469812483.shtml#第23集$http://tv.sohu.com/20161009/n469812497.shtml#第24集$http://tv.sohu.com/20161009/n469812520.shtml#第25集$http://tv.sohu.com/20161009/n469812531.shtml$$$http://v.youku.com/v_show/id_XMTgyMzkwNTIyMA==.html#http://v.youku.com/v_show/id_XMTgyMzE3MDcwO