INSERT INTO `mac_vod` VALUES('16708','军医','共24集全','junyi','J','','http://photocdn.sohu.com/kis/fengmian/73/73367/73367_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/73/73367/73367_ver_big.jpg','','邓超/李小冉/马雅舒/张嘉译/黄曼','刘惠宁','新四军,国民党,离家出走,古城,故乡','共24集全','大陆','国语','2009','12','',',466,','0','0','0','0','0','0','0','0','964452','0','0','0','0','0','0','9.0','0','222','1481692024','1482341102','0','0','在古城危难之际他回到了故乡，并与青梅竹马的三妹重逢，但是天不随人愿，郭老爷欲将三妹嫁于大户人家做小，三妹誓死不从，于是趁所有人熟睡离家出走，从小一起长大的恩纯得知后尾随三妹一起参加了新四军。郭家碍于面子对外宣称三妹已死。男方仗着权势到郭家要人，并强行要求二妹顶替三妹出嫁，危难之下为救二妹，五哥娶了二妹。并在郭家古楼开了诊所，不久二妹就为五哥生下了一个女儿宝华，生活美满。　　1938年夏天，国民党部队开进了西门镇，由于军队缺乏军医，国军征用了五哥的诊所。张师长佩服五哥的高超医术，想将五哥带在身边，五哥做了激烈的思想斗争之后，答应随部队上前线，但是并不参军。前线战事激烈，伤兵愈来愈多，诊所里放满了伤员，五哥不眠不休的动手术。二妹见五哥如此辛苦，也到诊所里帮忙。前线战事升级队伍伤亡扩大，需要建立战前医院，五哥告别了妻儿，带着水虎上了前线。','sohu','','','第1集$http://tv.sohu.com/20161008/n469725497.shtml#第2集$http://tv.sohu.com/20161008/n469725511.shtml#第3集$http://tv.sohu.com/20161008/n469725523.shtml#第4集$http://tv.sohu.com/20161008/n469725539.shtml#第5集$http://tv.sohu.com/20161008/n469725543.shtml#第6集$http://tv.sohu.com/20161008/n469725552.shtml#第7集$http://tv.sohu.com/20161008/n469725565.shtml#第8集$http://tv.sohu.com/20161008/n469725575.shtml#第9集$http://tv.sohu.com/20161008/n469725585.shtml#第10集$http://tv.sohu.com/20161008/n469725594.shtml#第11集$http://tv.sohu.com/20161008/n469725602.shtml#第12集$http://tv.sohu.com/20161008/n469725606.shtml#第13集$http://tv.sohu.com/20161008/n469725622.shtml#第14集$http://tv.sohu.com/20161008/n469725633.shtml#第15集$http://tv.sohu.com/20161008/n469725661.shtml#第16集$http://tv.sohu.com/20161008/n469725673.shtml#第17集$http://tv.sohu.com/20161008/n469725684.shtml#第18集$http://tv.sohu.com/20161008/n469725689.shtml#第19集$http://tv.sohu.com/20161008/n469725695.shtml#第20集$http://tv.sohu.com/20161008/n469725703.shtml#第21集$http://tv.sohu.com/20161008/n469725710.shtml#第22集$http://tv.sohu.com/20161008/n469725728.shtml#第23集$http://tv.sohu.com/20161008/n469725738.shtml#第24集$http://tv.sohu.com/20161008/n469725742.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16709','古宅','共21集全','guzhai','G','','http://photocdn.sohu.com/kis/fengmian/1050/1050971/1050971_ver_big_20160926155009.jpg','http://photocdn.sohu.com/kis/fengmian/1050/1050971/1050971_ver_big_20160926155009.jpg','','赵君/于小慧/贺小书','严啸川','安宁','共21集全','大陆','国语','2009','12','',',431,','0','0','0','0','0','0','0','0','319227','0','0','0','0','0','0','4.0','0','497','1481692024','1482341104','0','0','侨商吴道宏回乡投资办企业，把祖宅吴家大院要了回来。吴家后裔吴子阳等人住进去以后，这座曾经以“闹鬼”著称的古宅内就怪事不断，宅子里藏有财宝的传闻也不胫而走，搞得一家人无法安宁。装神弄鬼、贼喊捉贼、瞒天过海、无中生有。一出出好戏在古宅中陆续上演……到底是冤死的阴魂不散，还是贪婪的世人作祟？一座埋藏着珍宝的宝宅，引来几路人马疯狂争夺，相隔八十年的两宗疑案，串起家族间的世代恩仇。','sohu','','','第1集$http://tv.sohu.com/20161009/n469811813.shtml#第2集$http://tv.sohu.com/20161009/n469811825.shtml#第3集$http://tv.sohu.com/20161009/n469811842.shtml#第4集$http://tv.sohu.com/20161009/n469811863.shtml#第5集$http://tv.sohu.com/20161009/n469811877.shtml#第6集$http://tv.sohu.com/20161009/n469811895.shtml#第7集$http://tv.sohu.com/20161009/n469811919.shtml#第8集$http://tv.sohu.com/20161009/n469811934.shtml#第9集$http://tv.sohu.com/20161009/n469811956.shtml#第10集$http://tv.sohu.com/20161009/n469811977.shtml#第11集$http://tv.sohu.com/20161009/n469812003.shtml#第12集$http://tv.sohu.com/20161009/n469812018.shtml#第13集$http://tv.sohu.com/20161009/n469812031.shtml#第14集$http://tv.sohu.com/20161009/n469812053.shtml#第15集$http://tv.sohu.com/20161009/n469812077.shtml#第16集$http://tv.sohu.com/20161009/n469812096.shtml#第17集$http://tv.sohu.com/20161009/n469812117.shtml#第18集$http://tv.sohu.com/20161009/n469812131.shtml#第19集$http://tv.sohu.com/20161009/n469812164.shtml#第20集$http://tv.sohu.com/20161009/n469812193.shtml#第21集$http://tv.sohu.com/20161009/n469812216.shtml','','','','');
