INSERT INTO `mac_vod` VALUES('16711','秋去秋来','共34集全','qiuquqiulai','Q','','http://photocdn.sohu.com/kis/fengmian/1092/1092051/1092051_ver_big_20160923155502.jpg','http://photocdn.sohu.com/kis/fengmian/1092/1092051/1092051_ver_big_20160923155502.jpg','','寇世勋/曹曦文/陈刚/李佳/郑卫莉','张国庆','真命天子,抗癌药物,安眠药,研究生,外甥女','共34集全','大陆','国语','2008','12','',',369,','0','0','0','0','0','0','0','0','834716','0','0','0','0','0','0','6.0','0','200','1481692026','1482341101','0','0','这是一个围绕着两个家庭发生的故事。苏小霁和苏小薇是同父异母的姐妹，小薇的妈妈早年病逝，而父亲苏文培专注于研制抗癌药物CBM，无暇顾及女儿，尽管继母李云箐竭力照顾，无奈小薇个性极为敏感脆弱，再加上同为医学院教授的姨妈龚蕾误以为姐姐的死都源于姐夫的绯闻，对姐夫心怀愤恨，于是千方百计地在外甥女面前挑唆他们的父女关系，造成苏小薇与父亲长期以来势同水火。谁也没有料到龚蕾的儿子田野竟然和苏小霁谈上了恋爱，这不能不让龚蕾暴跳如雷，发誓决不容忍，苏文培夫妇为此也是忧心忡忡。正当龚蕾准备棒打鸳鸯的时候，苏小薇的婚姻又亮起了红灯，丈夫有了外遇，并提出离婚。原本因为母亲早亡、与父亲不睦而格外渴望家庭温暖的苏小薇承受不住这个打击，在母亲忌日那天喝下大量安眠药，幸亏发现及时才幸免于难，但是她的精神始终处于崩溃的边缘。妹妹苏小霁很希望父亲的研究生周家昌能够成为拯救姐姐的真命天子，但她并不知道这个当年曾经追求过姐姐，现今依旧单身的男子，此时的目光其实瞄准了自己。周家昌别有用心地提醒龚蕾，用伪装成罹患癌症的办法，逼迫田野与苏小霁分手，自己则乘虚而入。苏文培的研究在距成功仅剩一步之遥时，因为缺乏经费而陷入困境。田野说服自己公司的洋老板投资CBM的开发，他以为这样一来可解科研经费的燃眉之急，二来也可以缓和母亲与苏文培的矛盾，三则最终让双方家长能够接受自己和小霁的感情。谁知他的如意算盘却适得其反，苏文培误以为他是要将民族的知识产权出卖给外国人谋取利益，因此对其大为憎恶。而苏小薇、龚蕾还有周家昌等人的推波助澜，更造成了田野与苏小霁之间的极大误会和冲突。与此同时，田野又意外发现母亲的癌症纯属伪装，气愤之下他离开本市，远走他乡。田野的出走，给了周家昌可乘之机，他利用老师面临的困境，师母遭遇的诬陷，小薇受到的怀疑以及小薇儿子突发的疾病，大大地表现了一番英雄主义的气概，使苏家欠下他一份难以偿还的人情债。在对田野的极度失望之下，苏小霁以身相许，答应了周家昌的求婚。然而就在他们准备成亲的时候，田野带着国内医药企业的研究资金回到了他们所在的城市，并且加盟了苏小霁所在的公司。此时苏小霁虽然已经弄清了自己与田野之间的误会，但与周家昌之间几乎是木已成舟的关系却使她无法与这位昔日的恋人从头再来。她只能劝田野把自己当作普通朋友，田野经过痛苦的挣扎，不得不吞下这个苦果。然而苏小霁虽然嫁给了周家昌，但周家昌却无论如何不能容忍苏小霁整天与她的昔日恋人同处一室，他一方面力劝小霁回家做专职太太，另一方面使出种种手段在他们之间制造事端。与此同时，为了证明自己的能力，并达到完全控制妻子的目的，周家昌在极度的自卑和偏执心理的作用下，他将自己导师的研究成果出卖给了外国公司，并且雇人用摩托车撞伤了苏小霁，周家昌的如意算盘是让妻子不能走动而留在家里，谁知苏小霁由于脑部的血肿压迫视神经，她失明了！所有的亲人和朋友都为此伤心难过，田野更是发誓要查出凶手，唯有周家昌根本不在乎是谁撞伤了妻子，而是将苏小霁与所有的亲人朋友完全隔离开来，并且趁着她失明的机会，在她与亲朋之间制造了各种误会，甚至一度使苏小霁与家人产生了很深的隔膜。但是当苏小霁在电视里听到父亲为之奋斗了一生研制出来的CBM变成了丈夫的成果，她才一下子明白了丈夫的为人，最终回到父亲身边。苏小霁提出离婚，并支持父亲起诉周家昌的剽窃行为，在法院开庭的那天，周家昌感到末日来临般地恐惧，他犹豫再三选择了自取灭亡。而经过了这许许多多的事件之后，龚蕾也弄清了自己是由于为人的偏执才误解了苏文培，两家人终于握手言和，苏小霁与田野得到了双方父母的祝福，苏小薇也找到了自己的真爱。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161008/n469700463.shtml#第2集$http://tv.sohu.com/20161008/n469700469.shtml#第3集$http://tv.sohu.com/20161008/n469700472.shtml#第4集$http://tv.sohu.com/20161008/n469700475.shtml#第5集$http://tv.sohu.com/20161008/n469700492.shtml#第6集$http://tv.sohu.com/20161008/n469700497.shtml#第7集$http://tv.sohu.com/20161008/n469700516.shtml#第8集$http://tv.sohu.com/20161008/n469700532.shtml#第9集$http://tv.sohu.com/20161008/n469700550.shtml#第10集$http://tv.sohu.com/20161008/n469700567.shtml#第11集$http://tv.sohu.com/20161008/n469700582.shtml#第12集$http://tv.sohu.com/20161008/n469700588.shtml#第13集$http://tv.sohu.com/20161008/n469700597.shtml#第14集$http://tv.sohu.com/20161008/n469700603.shtml#第15集$http://tv.sohu.com/20161008/n469700622.shtml#第16集$http://tv.sohu.com/20161008/n469700627.shtml#第17集$http://tv.sohu.com/20161008/n469700631.shtml#第18集$http://tv.sohu.com/20161008/n469700635.shtml#第19集$http://tv.sohu.com/20161008/n469700639.shtml#第20集$http://tv.sohu.com/20161008/n469700648.shtml#第21集$http://tv.sohu.com/20161008/n469700653.shtml#第22集$http://tv.sohu.com/20161008/n469700660.shtml#第23集$http://tv.sohu.com/20161008/n469700671.shtml#第24集$http://tv.sohu.com/20161008/n469700686.shtml#第25集$http://tv.sohu.com/20161008/n469700694.shtml#第26集$http://tv.sohu.com/20161008/n469700700.shtml#第27集$http://tv.sohu.com/20161008/n469700722.shtml#第28集$http://tv.sohu.com/20161008/n469700736.shtml#第29集$http://tv.sohu.com/20161008/n469700743.shtml#第30集$http://tv.sohu.com/20161008/n469700750.shtml#第31集$http://tv.sohu.com/20161008/n469700753.shtml#第32集$http://tv.sohu.com/20161008/n469700759.shtml#第33集$http://tv.sohu.com/20161008/n469700763.shtml#第34集$http://tv.sohu.com/20161008/n469700769.shtml$$$http://v.youku.com/v_show/id_XMTgzMDE0NzEwMA==.html#http://v.youku.com/v_show/id_XMTgzMDE0NzA4OA==.html#http://v.youku.com/v_show/id_XMTgzMDE0NzA1Ng==.html#http://v.youku.com/v_show/id_XMTgzMDI1NjA3Ng==.html#http://v.youku.com/v_show/id_XMTgzMDI1ODA0MA==.html#http://v.youku.com/v_show/id_XMTgzMDI1ODY0NA==.html#http://v.youku.co