INSERT INTO `mac_vod` VALUES('16712','肥姐挂帅','共32集全','feijieguashuai','F','','http://photocdn.sohu.com/kis/fengmian/68/68997/68997_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/68/68997/68997_ver_big.jpg','','吴孟达/袁洁莹/黄一飞/沈殿霞/邱心志','穆龙','康熙年间,大美女,芙蓉城,南京','共32集全','香港','国语','2004','13','',',457,','0','0','0','0','0','0','0','0','48265','0','0','0','0','0','0','2.0','0','412','1481692026','1482341103','0','0','相传燕王朱棣称兵靖难，攻入南京，建文帝仓皇出走，其手下带走一批宫中珍宝，以图复位，由于建文帝下落不明，其手下只好将珍宝埋藏于某处，由三名侍卫之后人世代看守，而此三家之后人，分别掌管宝藏之地图、钥匙及机关之秘密，并约定每二十年相见一次，等待建文帝之后人出现，取回宝藏。时移世易，辗转二百余年，明亡清兴，此宝藏之秘密，除当事人外，已无人得知。康熙年间，平西王吴三桂心存异志，要谋反称帝，偶尔获悉“建文帝宝藏”重现江湖，责令心腹家将铁横江务必寻得宝藏，以作扩充军备之用；但铁横江费尽九牛二虎之力，只查到宝藏肯定与芙蓉城有关，即线索中断。芙蓉城内，”春风得意楼”隆重开业，老板肥姐花满娇带领四大美女春花、夏蝉、秋月、冬雪，使出浑身解数，煮酒迎宾，客似云来，惹起当地土豪路家垂涎，当家路青云率领二子路正及路直前来，欲分一杯羹，岂料反吃了暗亏，铩羽而归。','sohu','','','第1集$http://tv.sohu.com/20161009/n469809952.shtml#第2集$http://tv.sohu.com/20161009/n469809959.shtml#第3集$http://tv.sohu.com/20161009/n469809961.shtml#第4集$http://tv.sohu.com/20161009/n469809966.shtml#第5集$http://tv.sohu.com/20161009/n469809976.shtml#第6集$http://tv.sohu.com/20161009/n469809986.shtml#第7集$http://tv.sohu.com/20161009/n469810004.shtml#第8集$http://tv.sohu.com/20161009/n469810022.shtml#第9集$http://tv.sohu.com/20161009/n469810038.shtml#第10集$http://tv.sohu.com/20161009/n469810050.shtml#第11集$http://tv.sohu.com/20161009/n469810059.shtml#第12集$http://tv.sohu.com/20161009/n469810069.shtml#第13集$http://tv.sohu.com/20161009/n469810074.shtml#第14集$http://tv.sohu.com/20161009/n469810088.shtml#第15集$http://tv.sohu.com/20161009/n469810095.shtml#第16集$http://tv.sohu.com/20161009/n469810101.shtml#第17集$http://tv.sohu.com/20161009/n469810105.shtml#第18集$http://tv.sohu.com/20161009/n469810107.shtml#第19集$http://tv.sohu.com/20161009/n469810117.shtml#第20集$http://tv.sohu.com/20161009/n469810122.shtml#第21集$http://tv.sohu.com/20161009/n469810127.shtml#第22集$http://tv.sohu.com/20161009/n469810129.shtml#第23集$http://tv.sohu.com/20161009/n469810132.shtml#第24集$http://tv.sohu.com/20161009/n469810138.shtml#第25集$htt