INSERT INTO `mac_vod` VALUES('16713','保密局一九四九','共20集全','baomijuyijiusijiu','B','','http://photocdn.sohu.com/kis/fengmian/62/62013/62013_ver_big_20160923155003.jpg','http://photocdn.sohu.com/kis/fengmian/62/62013/62013_ver_big_20160923155003.jpg','','杨溢/林京来/金玉婷/刘小峰','尹大为','上海办事处,国民党,保密局,领导人,地下党','共20集全','大陆','国语','2008','12','',',451,','0','0','0','0','0','0','0','0','105964','0','0','0','0','0','0','6.0','0','191','1481692026','1482341100','0','0','上海解放在即，中共上海地下党接到情报，国民党保密局部署制定、代号为“墨斗鱼计划”的绝密档案，将于第二天下午五点押运台湾。情报显示，这份被国民党高层认为“共产党得到它，等于得到了大半座上海城”的档案，是八千多名特务在上海解放后的潜伏计划和详细名单。地下党主要领导人夏伯明经上级批准，迅速调集精兵强将执行酝酿已久的“鱼雷方案”，连夜出击，截获档案。因遭到潜伏在地下党内部的国民党“蝉”字辈特务的破坏，夏伯明和特派员林道宏不得不取消这个志在必得的行动，他们意识到这次未果的行动，必然会引起国民党保密局上海办事处少将处长姜继勋的高度警觉，决定启动针对“鱼雷方案”失利而预备的“黎明行动”，实施一系列应急措施，既要转移姜继勋内查外调的视线，保护战斗在敌人内部的同志生命安全，又要挖出潜伏在内部的特务，精心布下天罗地网，再擒墨斗鱼。但未曾想到有人提前一小时，盗走了“墨斗鱼计划”。','sohu','','','第1集$http://tv.sohu.com/20161008/n469699924.shtml#第2集$http://tv.sohu.com/20161008/n469699934.shtml#第3集$http://tv.sohu.com/20161008/n469699937.shtml#第4集$http://tv.sohu.com/20161008/n469699940.shtml#第5集$http://tv.sohu.com/20161008/n469699942.shtml#第6集$http://tv.sohu.com/20161008/n469699944.shtml#第7集$http://tv.sohu.com/20161008/n469699950.shtml#第8集$http://tv.sohu.com/20161008/n469699954.shtml#第9集$http://tv.sohu.com/20161008/n469699964.shtml#第10集$http://tv.sohu.com/20161008/n469699988.shtml#第11集$http://tv.sohu.com/20161008/n469700019.shtml#第12集$http://tv.sohu.com/20161008/n469700032.shtml#第13集$http://tv.sohu.com/20161008/n469700046.shtml#第14集$http://tv.sohu.com/20161008/n469700064.shtml#第15集$http://tv.sohu.com/20161008/n469700079.shtml#第16集$http://tv.sohu.com/20161008/n469700095.shtml#第17集$http://tv.sohu.com/20161008/n469700121.shtml#第18集$http://tv.sohu.com/20161008/n469700141.shtml#第19集$http://tv.sohu.com/20161008/n469700149.shtml#第20集$http://tv.sohu.com/20161008/n469700163.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16714','命案十三宗','共21集全','minganshisanzong','M','','http://photocdn.sohu.com/kis/fengmian/1102/1102438/1102438_ver_big_20160927153503.jpg','http://photocdn.sohu.com/kis/fengmian/1102/1102438/1102438_ver_big_20160927153503.jpg','','刘威葳/李进荣/高群书','高群书','杀人犯,电视,欲望,故事,记录','共21集全','大陆','国语','2001','12','',',468,','0','0','0','0','0','0','0','0','991445','0','0','0','0','0','0','7.0','0','294','1481692026','1482341102','0','0','二十一集电视系列剧《命案十三宗》取材于近几年发生的十三宗真实命案，经改编创作而成，主要情节与人物都是真实的。摄制组对这十三宗命案的凶犯做了三十多个小时的电视采访记录，并将这些采访作为一个部分放在剧中，与故事情节有机地结合成一个完整的影片。他们都说肯定不想杀人，但又承认自己后来确实杀了人，那是怎样的过程？是什么因素造成了惨剧的发生呢？他们绝非成心作恶之人，使他们走到这一步的就是人类所共有的人性弱点，自私、嫉妒、无知、狭隘、愚昧……断送了他们原本平静幸福的生活。被他们杀害的人痛苦地死去了，他们还活着，却没有了快乐。我们可能也曾面临过困境、也曾受到过伤害和由此产生的反抗，那种维护尊严的欲望和这些杀人者都是相同的，甚至更强烈。但有所不同的是，他们都采取了一种错误的方式。企图摆脱那种困境，却不料将自己置身于一个根本无法挽回的绝境，剥夺了给自己造成困境的人的生命，成了一名杀人犯。于是他们成了故事中的人。','sohu$$$qq$$$youku','$$$$$$','$$$$$$','第1集$http://tv.sohu.com/20161009/n469808048.shtml#第2集$http://tv.sohu.com/20161009/n469808073.shtml#第3集$http://tv.sohu.com/20161009/n469808081.shtml#第4集$http://tv.sohu.com/20161009/n469808085.shtml#第5集$http://tv.sohu.com/20161009/n469808093.shtml#第6集$http://tv.sohu.com/20161009/n469808096.shtml#第7集$http://tv.sohu.com/20161009/n469808106.shtml#第8集$http://tv.sohu.com/20161009/n469808113.shtml#第9集$http://tv.sohu.com/20161009/n469808119.shtml#第10集$http://tv.sohu.com/20161009/n469808121.shtml#第11集$http://tv.sohu.com/20161009/n469808125.shtml#第12集$http://tv.sohu.com/20161009/n469808132.shtml#第13集$http://tv.sohu.com/20161009/n469808136.shtml#第14集$http://tv.sohu.com/20161009/n469808140.shtml#第15集$http://tv.sohu.com/20161009/n469808145.shtml#第16集$http://tv.sohu.com/20161009/n469808157.shtml#第17集$http://tv.sohu.com/20161009/n469808168.shtml#第18集$http://tv.sohu.com/20161009/n469808176.shtml#第19集$http://tv.sohu.com/20161009/n469808180.shtml#第20集$http://tv.sohu.com/20161009/n469808183.shtml#第21集$http://tv.sohu.com/20161009/n469808189.shtml#第二部 真相$http://tv.sohu.com/item/MTEwMzAzOQ==.html$$$01$http://v.q