INSERT INTO `mac_vod` VALUES('16715','梧桐相思雨','共34集全','wutongxiangsiyu','W','','http://photocdn.sohu.com/kis/fengmian/222/222338/222338_ver_big_20160923154003.jpg','http://photocdn.sohu.com/kis/fengmian/222/222338/222338_ver_big_20160923154003.jpg','','陶红/宁静/张晨光/刘德凯/金玉婷','罗灿然','爱新觉罗,隆裕太后,紫禁城,禁卫军,荣利','共34集全','大陆','国语','2004','12','',',390,','0','0','0','0','0','0','0','0','98100','0','0','0','0','0','0','5.0','0','456','1481692027','1482341100','0','0','清朝末年，紫禁城中洋溢着外喷内张的紧绷气氛。满洲亲贵们见政权岌岌可危，充满危机感，故格外揽权，引起朝野有识之士的极度不满。颖捃王之女宝龄格格，自幼温柔清秀，灵巧客人，深得隆裕太后喜爱，时常被唤进宫程欢膝下。隆裕太后曾在说笑间欲将宝龄（陶红饰）指婚给和亲王之子多罗贝勒溥俊（刘德凯饰），权贵们也认为他俩是门当户对的一对璧人。溥俊为人聪明、豪爽、霸气、深以爱新觉罗皇统为荣，他积极训练禁卫军，是保守派的先锋。但他也觉得大清国不变革是不行的。溥俊深爱宝龄，痴等宝龄下嫁，但宝龄却爱上父亲门生陈思翰（张晨光饰）。陈思翰不慕荣利、两袖清风，看似温文实则刚强，他对腐败无能的统治集团感到愤怒而不屑！基于救国救民的急切与冲动，他加入了革命组织，他虽然也喜欢宝龄，但自知俩人身份犹如仇敌，他不能开始这段感情，所以对宝龄很冷淡。可是宝龄对陈思翰用情已深，思翰终被感动，与宝龄倾心相恋。但宝龄的心腹侍女也暗中爱上了思翰。虽然俩人无法公开恋情，但相爱的力量却因此更加坚定。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161008/n469699546.shtml#第2集$http://tv.sohu.com/20161008/n469699556.shtml#第3集$http://tv.sohu.com/20161008/n469699573.shtml#第4集$http://tv.sohu.com/20161008/n469699586.shtml#第5集$http://tv.sohu.com/20161008/n469699601.shtml#第6集$http://tv.sohu.com/20161008/n469699607.shtml#第7集$http://tv.sohu.com/20161008/n469699614.shtml#第8集$http://tv.sohu.com/20161008/n469699622.shtml#第9集$http://tv.sohu.com/20161008/n469699631.shtml#第10集$http://tv.sohu.com/20161008/n469699639.shtml#第11集$http://tv.sohu.com/20161008/n469699641.shtml#第12集$http://tv.sohu.com/20161008/n469699646.shtml#第13集$http://tv.sohu.com/20161008/n469699652.shtml#第14集$http://tv.sohu.com/20161008/n469699661.shtml#第15集$http://tv.sohu.com/20161008/n469699671.shtml#第16集$http://tv.sohu.com/20161008/n469699680.shtml#第17集$http://tv.sohu.com/20161008/n469699688.shtml#第18集$http://tv.sohu.com/20161008/n469699698.shtml#第19集$http://tv.sohu.com/20161008/n469699704.shtml#第20集$http://tv.sohu.com/20161008/n469699713.shtml#第21集$http://tv.sohu.com/20161008/n469699720.shtml#第22集$http://tv.sohu.com/20161008/n469699735.shtm