INSERT INTO `mac_vod` VALUES('16716','渴望城市','共23集全','kewangchengshi','K','','http://photocdn.sohu.com/kis/fengmian/992/992432/992432_ver_big_20160927151503.jpg','http://photocdn.sohu.com/kis/fengmian/992/992432/992432_ver_big_20160927151503.jpg','','纪永伦','曹慧生/胡楠','情感生活,情感经历,如意,故事','共23集全','大陆','国语','2006','12','',',355,','0','0','0','0','0','0','0','0','219140','0','0','0','0','0','0','1.0','0','190','1481692027','1482341101','0','0','本剧以每集一个故事的形式，以生活在城市中但往往被忽略的民工群体为题材，描写他们的喜怒哀乐，他们对生活的渴求、他们的情感生活以及他们在生活压力中体现出来的人性，反映外来民工生活状态、情感经历以及剖析他们心理变化分享者影视，道出了民工在城市求生存的艰难，正是这种艰难无奈的纪实性引发了很多背井离乡求生存求发展的民工们共同的心声，具有振聋发聩的意义，也留给社会思考。然而，觉得遗憾的是每集故事的结局多数是以不如意结束。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161009/n469807078.shtml#第2集$http://tv.sohu.com/20161009/n469807087.shtml#第3集$http://tv.sohu.com/20161009/n469807098.shtml#第4集$http://tv.sohu.com/20161009/n469807104.shtml#第5集$http://tv.sohu.com/20161009/n469807114.shtml#第6集$http://tv.sohu.com/20161009/n469807125.shtml#第7集$http://tv.sohu.com/20161009/n469807130.shtml#第8集$http://tv.sohu.com/20161009/n469807132.shtml#第9集$http://tv.sohu.com/20161009/n469807135.shtml#第10集$http://tv.sohu.com/20161009/n469807139.shtml#第11集$http://tv.sohu.com/20161009/n469807145.shtml#第12集$http://tv.sohu.com/20161009/n469807149.shtml#第13集$http://tv.sohu.com/20161009/n469807152.shtml#第14集$http://tv.sohu.com/20161009/n469807157.shtml#第15集$http://tv.sohu.com/20161009/n469807164.shtml#第16集$http://tv.sohu.com/20161009/n469807170.shtml#第17集$http://tv.sohu.com/20161009/n469807177.shtml#第18集$http://tv.sohu.com/20161009/n469807190.shtml#第19集$http://tv.sohu.com/20161009/n469807198.shtml#第20集$http://tv.sohu.com/20161009/n469807212.shtml#第21集$http://tv.sohu.com/20161009/n469807232.shtml#第22集$http://tv.sohu.com/20161009/n469807249.shtml#第23集$http://tv.sohu.com/20161009/n469807261.shtml$$$http://v.youku.com/v_show/id_XMTgzMTk5MzMyOA==.html#http://v.youku.com/v_show/id_XMTgzMjc2NzI4MA==.html#http://v.youku.com/v_show/id_XMTgzMjc3NTg1Ng==.html#http://v.youku.com/v_show/