INSERT INTO `mac_vod` VALUES('16719','真相','','zhenxiang','Z','','http://photocdn.sohu.com/kis/fengmian/91/91907/91907_ver_big_20160923161003.jpg','http://photocdn.sohu.com/kis/fengmian/91/91907/91907_ver_big_20160923161003.jpg','','海顿/王若麟/吴秀波/赵恒煊/颜丹晨','海顿','韦德,故事','正片','大陆','国语','2010','12','',',468,','0','0','0','0','0','0','0','0','476141','0','0','0','0','0','0','5.0','0','354','1481692028','1482352547','0','0','该剧故事中反映了现在老、中、青各阶段人们的婚姻状态，通过三名律师来化解各类婚姻矛盾讲述着不同的了悲欢离合。该剧的三个主人公刘神、安静、费丽丽堪称的婚姻官司的专家，他们通过在办理案件的过程中挽救好多当时人的婚姻，可是他们各自的婚姻都似乎一塌糊涂的不得了，在处理和这么多的案例中，他们都各自找到了自己的生活定位……女人面对即将分裂的婚姻时是慌乱的，女人，请你安静……男人面对外面的花花世界是好奇的，男人，记住要留神。','sohu$$$youku','$$$','$$$','第1集$http://tv.sohu.com/20161008/n469694498.shtml#第2集$http://tv.sohu.com/20161008/n469694526.shtml#第3集$http://tv.sohu.com/20161008/n469694548.shtml#第4集$http://tv.sohu.com/20161008/n469694564.shtml#第5集$http://tv.sohu.com/20161008/n469694585.shtml#第6集$http://tv.sohu.com/20161008/n469694602.shtml#第7集$http://tv.sohu.com/20161008/n469694620.shtml#第8集$http://tv.sohu.com/20161008/n469694641.shtml#第9集$http://tv.sohu.com/20161008/n469694662.shtml#第10集$http://tv.sohu.com/20161008/n469694686.shtml#第11集$http://tv.sohu.com/20161008/n469694702.shtml#第12集$http://tv.sohu.com/20161008/n469694719.shtml#第13集$http://tv.sohu.com/20161008/n469694744.shtml#第14集$http://tv.sohu.com/20161008/n469694772.shtml#第15集$http://tv.sohu.com/20161008/n469694782.shtml#第16集$http://tv.sohu.com/20161008/n469694799.shtml#第17集$http://tv.sohu.com/20161008/n469694813.shtml#第18集$http://tv.sohu.com/20161008/n469694836.shtml#第19集$http://tv.sohu.com/20161008/n469694847.shtml#第20集$http://tv.sohu.com/20161008/n469694859.shtml#第21集$http://tv.sohu.com/20161008/n469694873.shtml$$$http://v.youku.com/v_show/id_XMTg3NDMwOTc1Ng==.html','','','','');
INSERT INTO `mac_vod` VALUES('16720','雾都猎狐','','wuduliehu','W','','http://photocdn.sohu.com/kis/fengmian/87/87654/87654_ver_big_20160923153503.jpg','http://photocdn.sohu.com/kis/fengmian/87/87654/87654_ver_big_20160923153503.jpg','','吴樾/李光复/姜宏波/柳小海/国歌','曹慧生','蒋介石,解放军,八仙庵,朝鲜,重庆','','大陆','国语','2010','12','',',469,','0','0','0','0','0','0','0','0','267252','0','0','0','0','0','0','7.0','0','349','1481692029','1482086336','0','0','一九五零年，蒋介石集团借美国入侵朝鲜之机，派遣大批特务潜入内地制造混乱。以“血狐狸”钱孝义为头目的特务小组潜入重庆，准备实施一系列破坏活动。获悉情报后，解放军迅速成立了侦破小组并任命侦察科科长雷启明为组长，雷启明设伏八仙庵，但因侦察员的身份暴露而打草惊蛇。为了彻底消灭敌人，雷启明吸取教训，改变策略，利用“血狐狸”与“狼”互不相识且还未接上头的条件，假扮“狼”张为农，进入山中，深入虎穴与敌战斗。凭胆识和机智，雷启明赢得了以叶兰香为首的匪徒的信任，并顺利抓获前来与血狐狸接头的“狼”张为农。而同时也藏在山中的“血狐狸”识破了雷启明的身份。血狐狸在其同伙的帮助下，绑架了雷启明的妻女，雷启明深入虎穴，救出妻女，并全歼了敌特，保卫了和平。','sohu$$$qq','$$$','$$$','雾都猎狐第1集$http://tv.sohu.com/20161008/n469693340.shtml#雾都猎狐第2集$http://tv.sohu.com/20161008/n469693364.shtml#雾都猎狐第3集$http://tv.sohu.com/20161008/n469693379.shtml#雾都猎狐第4集$http://tv.sohu.com/20161008/n469693399.shtml#雾都猎狐第5集$http://tv.sohu.com/20161008/n469693423.shtml#雾都猎狐第6集$http://tv.sohu.com/20161008/n469693444.shtml#雾都猎狐第7集$http://tv.sohu.com/20161008/n469693468.shtml#雾都猎狐第8集$http://tv.sohu.com/20161008/n469693482.shtml#雾都猎狐第9集$http://tv.sohu.com/20161008/n469693497.shtml#雾都猎狐第10集$http://tv.sohu.com/20161008/n469693513.shtml#雾都猎狐第11集$http://tv.sohu.com/20161008/n469693531.shtml#雾都猎狐第12集$http://tv.sohu.com/20161008/n469693546.shtml#雾都猎狐第13集$http://tv.sohu.com/20161008/n469693555.shtml#雾都猎狐第14集$http://tv.sohu.com/20161008/n469693570.shtml#雾都猎狐第15集$http://tv.sohu.com/20161008/n469693594.shtml#雾都猎狐第16集$http://tv.sohu.com/20161008/n469693609.shtml#雾都猎狐第17集$http://tv.sohu.com/20161008/n469693624.shtml#雾都猎狐第18集$http://tv.sohu.com/20161008/n469693640.shtml#雾都猎狐第19集$http://tv.sohu.com/20161008/n469693649.shtml#雾都猎狐第20集$http://tv.sohu.com/20161008/n469693659.shtml#雾都猎狐第21集$http://tv.sohu.com/20161008/n469693681.shtml#雾都猎狐第22集$http://tv.sohu.com/20161008/n469693701.shtml$$$01$http://v.qq.com/x/cover/8w02kte4yggpxi7/g