INSERT INTO `mac_vod` VALUES('16724','倩女奇冤','','qingnvqiyuan','Q','','http://photocdn.sohu.com/kis/fengmian/1101/1101669/1101669_ver_big_20160927140504.jpg','http://photocdn.sohu.com/kis/fengmian/1101/1101669/1101669_ver_big_20160927140504.jpg','','刘松仁/吴家丽/黄达亮','梁凯程','传说,民间,证人','24集全','大陆','国语','1999','12','',',65,','0','0','0','0','0','0','0','0','908446','0','0','0','0','0','0','6.0','0','21','1481692030','1482092565','0','0','明朝年间，山南女子瑞云含冤枉死，幻化为孤魂野鬼，导致山南天怨人怨，因缘际会误入左都御史窦天章的府宅，窦天章幼年得异人传授，习得阴阳眼术，见到瑞云真身，本欲将其收伏，但同情其遭遇，愿为瑞云翻案，助其早日投胎，重新做人，次日，窦天章调阅案卷，提出重审，却遭到山南知县陶伍的反对，陶伍本为当世状元，只因其名与民间传说的凶神名字相近，便被贬为山南知县，为官十年，秉公办案，执法严明，为民除害，并对窦天章有救命之恩，兄弟之谊，窦天章一时间进退两难，窦天章夜访陶伍，昔日好对相对无言，瑞云突然出现，细问之下方知道原来是窦天章失散多年的女儿，窦天章摔杯而去与陶伍绝交，发誓一定要追查此案。大堂之上，重要证人蔡婆突然翻供，关键人证卢医生神秘失踪，窦天章一面抓紧寻找失踪的卢医生，一边差人抓捕为了陶伍做伪证的陈四，而陈四自杀身亡，卢医生逃亡路中给陶伍抓去，同时陶伍请来大法师对付瑞云和窦天章，生死之间，窦天章寻回死而复生的陈四，救出卢医生，瑞云一案真相大白，而此时陶伍才向窦天章说出心中隐情，一场人鬼奇幻正慢慢展开。','sohu$$$youku','$$$','$$$','倩女奇冤第1集$http://tv.sohu.com/20161006/n469643502.shtml#倩女奇冤第2集$http://tv.sohu.com/20161006/n469643506.shtml#倩女奇冤第3集$http://tv.sohu.com/20161006/n469643511.shtml#倩女奇冤第4集$http://tv.sohu.com/20161006/n469643515.shtml#倩女奇冤第5集$http://tv.sohu.com/20161006/n469643518.shtml#倩女奇冤第6集$http://tv.sohu.com/20161006/n469643522.shtml#倩女奇冤第7集$http://tv.sohu.com/20161006/n469643526.shtml#倩女奇冤第8集$http://tv.sohu.com/20161006/n469643530.shtml#倩女奇冤第9集$http://tv.sohu.com/20161006/n469643533.shtml#倩女奇冤第10集$http://tv.sohu.com/20161006/n469643535.shtml#倩女奇冤第11集$http://tv.sohu.com/20161006/n469643537.shtml#倩女奇冤第12集$http://tv.sohu.com/20161006/n469643539.shtml#倩女奇冤第13集$http://tv.sohu.com/20161006/n469643541.shtml#倩女奇冤第14集$http://tv.sohu.com/20161006/n469643544.shtml#倩女奇冤第15集$http://tv.sohu.com/20161006/n469643548.shtml#倩女奇冤第16集$http://tv.sohu.com/20161006/n469643552.shtml#倩女奇冤第17集$http://tv.sohu.com/20161006/n469643556.shtml#倩女奇冤第18集$http://tv.sohu.com/20161006/n469643560.shtml#倩女奇冤第19集$http://tv.sohu.com/20161006/n469643564.shtml#倩女奇冤第20集$http://tv.sohu.com/20161006/n469643568.shtml#倩女奇冤第21集$http://t