INSERT INTO `mac_vod` VALUES('16725','军礼','共26集全','junli','J','','http://photocdn.sohu.com/kis/fengmian/1004/1004672/1004672_ver_big_20160927171004.jpg','http://photocdn.sohu.com/kis/fengmian/1004/1004672/1004672_ver_big_20160927171004.jpg','','刘佩琦/刘孜/林熙越/杜志国/周莉','陈健','朝鲜战争,电视剧,共产主义,战友情,共和国','共26集全','大陆','国语','2009','12','',',388,','0','0','0','0','0','0','0','0','699823','0','0','0','0','0','0','4.0','0','460','1481692031','1481692031','0','0','在长征、抗日战争、解放战争和朝鲜战争的血雨腥风、战火纷飞的岁月里，从湘江之战走出来的一群热血青年赵大刀、马起义、赵果、王遵义、柳梅等，他们告别家人，投身共产主义事业，怀着对革命的忠诚，遵循着军人的诺言，感受着战友情、兄弟情、爱情的快乐与烦恼。为了共和国的明天以生命和热血书写了一曲曲荡气回肠、感人肺腑、催人泪下的军旅颂歌。在走过千难万险的坎坷之路后，含笑留给共和国和后人一个永不磨灭的电视剧《军礼》。','sohu','','','军礼第1集$http://tv.sohu.com/20161007/n469667181.shtml#军礼第2集$http://tv.sohu.com/20161007/n469667188.shtml#军礼第3集$http://tv.sohu.com/20161007/n469667193.shtml#军礼第4集$http://tv.sohu.com/20161007/n469667202.shtml#军礼第5集$http://tv.sohu.com/20161007/n469667211.shtml#军礼第6集$http://tv.sohu.com/20161007/n469667218.shtml#军礼第7集$http://tv.sohu.com/20161007/n469667221.shtml#军礼第8集$http://tv.sohu.com/20161007/n469667227.shtml#军礼第9集$http://tv.sohu.com/20161007/n469667232.shtml#军礼第10集$http://tv.sohu.com/20161007/n469667234.shtml#军礼第11集$http://tv.sohu.com/20161007/n469667239.shtml#军礼第12集$http://tv.sohu.com/20161007/n469667244.shtml#军礼第13集$http://tv.sohu.com/20161007/n469667246.shtml#军礼第14集$http://tv.sohu.com/20161007/n469667249.shtml#军礼第15集$http://tv.sohu.com/20161007/n469667254.shtml#军礼第16集$http://tv.sohu.com/20161007/n469667261.shtml#军礼第17集$http://tv.sohu.com/20161007/n469667264.shtml#军礼第18集$http://tv.sohu.com/20161007/n469667267.shtml#军礼第19集$http://tv.sohu.com/20161007/n469667270.shtml#军礼第20集$http://tv.sohu.com/20161007/n469667274.shtml#军礼第21集$http://tv.sohu.com/20161007/n469667283.shtml#军礼第22集$http://tv.sohu.com/20161007/n469667287.shtml#军礼第23集$http://tv.sohu.com/20161007/n469667291.shtml#军礼第24集$http://tv.sohu.com/20161007/n469667296.shtml#军礼第25集$http://tv.sohu.com/20161007/n469667300.shtml#军礼第26集$http://tv.sohu.com/20161007/n469667306.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16726','灯火黄昏','','denghuohuanghun','D','','http://photocdn.sohu.com/kis/fengmian/1070/1070259/1070259_ver_big_20160923171003.jpg','http://photocdn.sohu.com/kis/fengmian/1070/1070259/1070259_ver_big_20160923171003.jpg','','王雅捷/于洋/董勇/梁馨','孙文学','初恋男友,灯火黄昏,非婚生子,发家致富,国营企业','20集全','大陆','国语','2009','12','',',369,','0','0','0','0','0','0','0','0','298160','0','0','0','0','0','0','9.0','0','336','1481692031','1482092557','0','0','魏莎是一名纺织女工，沉稳善良、美丽大方，是工厂的女工标兵，真心相爱的初恋男友上前线牺牲，非婚生下的遗腹子被迫送人，在母亲的苦苦相逼和亲朋好友的劝说下，无奈地嫁给了厂长的儿子陈军。因为初恋的刻骨铭心让她难以对陈军产生真正的爱情，这让陈军“结婚八年都捂不热魏莎这块冰冷的石头”，从而产生了深深的失落，一个偶然的机会，魏莎非婚生子的事情被公开，这让陈军恼羞成怒，与魏莎离婚。离婚后的魏莎，又遭遇下岗，艰难地开始了再就业之路。徐宏昌是一位身体健壮、乐观向上，有着精明头脑的农民，年轻时候的他对魏莎一见钟情，但双方悬殊的家庭条件让他对魏莎的屡屡追求都以碰壁告终。万般无奈之际，只好与深爱他的农村姑娘王玉秀结婚生子，然而对魏莎的爱成了他发家致富的动力，经过十年的奋斗，他从一个小摊贩一步一步地成长为当地赫赫有名的民营企业家，成了国营企业幸福棉纺厂的一个强劲的竞争对手。然而不管他地位如何变化，他对魏莎的爱和关心都全心全意，在魏莎几次落难的关头，都挺身而出，渐渐赢得了魏莎的好感，后来徐宏昌邀请魏莎加入自己的公司，他们跨越20年的爱情看到了曙光。','sohu$$$youku','$$$','$$$','灯火黄昏第1集$http://tv.sohu.com/20161006/n469642429.shtml#灯火黄昏第2集$http://tv.sohu.com/20161006/n469642433.shtml#灯火黄昏第3集$http://tv.sohu.com/20161006/n469642438.shtml#灯火黄昏第4集$http://tv.sohu.com/20161006/n469642443.shtml#灯火黄昏第5集$http://tv.sohu.com/20161006/n469642447.shtml#灯火黄昏第6集$http://tv.sohu.com/20161006/n469642451.shtml#灯火黄昏第7集$http://tv.sohu.com/20161006/n469642455.shtml#灯火黄昏第8集$http://tv.sohu.com/20161006/n469642459.shtml#灯火黄昏第9集$http://tv.sohu.com/20161006/n469642463.shtml#灯火黄昏第10集$http://tv.sohu.com/20161006/n469642467.shtml#灯火黄昏第11集$http://tv.sohu.com/20161006/n469642474.shtml#灯火黄昏第12集$http://tv.sohu.com/20161006/n469642476.shtml#灯火黄昏第13集$http://tv.sohu.com/20161006/n469642479.shtml#灯火黄昏第14集$http://tv.sohu.com/20161006/n469642482.shtml#灯火黄昏第15集$http://tv.sohu.com/20161006/n469642489.shtml#灯火黄昏第16集$http://tv.sohu.com/20161006/n469642494.shtml#灯火黄昏第17集$http://tv.sohu.com/20161006/n469642499.shtml#灯火黄昏第18集$http://tv.sohu.com/20161006/n469642504.shtml#灯火黄昏第19集$http://tv.sohu.com/20161006/n469642507.shtml#灯火黄昏第20集$http://tv.sohu.com/2016