INSERT INTO `mac_vod` VALUES('16727','死去活来','','siquhuolai','S','','http://photocdn.sohu.com/kis/fengmian/43/43430/43430_ver_big_20160927135003.jpg','http://photocdn.sohu.com/kis/fengmian/43/43430/43430_ver_big_20160927135003.jpg','','刘蓓/冯远征/李成儒/汤镇宗/唐于鸿','尤小刚','戏剧性,主人公,中国,情感,故事','','大陆','国语','2007','12','',',81,','0','0','0','0','0','0','0','0','792314','0','0','0','0','0','0','10.0','0','475','1481692031','1481826034','0','0','本剧将镜头对准了一个普通的中国离婚家庭，讲述了在中国现有的家庭结构和道德伦理传统之下，离异夫妻所必须面对的具有“中国特色”的“剪不断理还乱”的诸多问题。记录了男女主人公背负着第一次婚姻留下的伤害与负担，围绕着复婚与各自的再婚、老人与子女、家庭与事业的种种矛盾冲突而演出的一段可咀嚼的人生故事。情感的大起大落，人生的悲欢离合，命运的戏剧性转折……而这一切也引发了剧中人对婚姻中的宽容、理解、信任与责任的思考，以及对人间真情的感悟！','sohu$$$qq','$$$','$$$','死去活来第1集$http://tv.sohu.com/20161006/n469643448.shtml#死去活来第2集$http://tv.sohu.com/20161006/n469643452.shtml#死去活来第3集$http://tv.sohu.com/20161006/n469643456.shtml#死去活来第4集$http://tv.sohu.com/20161006/n469643459.shtml#死去活来第5集$http://tv.sohu.com/20161006/n469643461.shtml#死去活来第6集$http://tv.sohu.com/20161006/n469643463.shtml#死去活来第7集$http://tv.sohu.com/20161006/n469643465.shtml#死去活来第8集$http://tv.sohu.com/20161006/n469643467.shtml#死去活来第9集$http://tv.sohu.com/20161006/n469643469.shtml#死去活来第10集$http://tv.sohu.com/20161006/n469643473.shtml#死去活来第11集$http://tv.sohu.com/20161006/n469643475.shtml#死去活来第12集$http://tv.sohu.com/20161006/n469643477.shtml#死去活来第13集$http://tv.sohu.com/20161006/n469643479.shtml#死去活来第14集$http://tv.sohu.com/20161006/n469643481.shtml#死去活来第15集$http://tv.sohu.com/20161006/n469643483.shtml#死去活来第16集$http://tv.sohu.com/20161006/n469643485.shtml#死去活来第17集$http://tv.sohu.com/20161006/n469643487.shtml#死去活来第18集$http://tv.sohu.com/20161006/n469643489.shtml#死去活来第19集$http://tv.sohu.com/20161006/n469643491.shtml#死去活来第20集$http://tv.sohu.com/20161006/n469643493.shtml#死去活来第21集$http://tv.sohu.com/20161006/n469643495.shtml#死去活来第22集$http://tv.sohu.com/20161006/n469643497.shtml#死去活来第23集$http://tv.sohu.com/20161006/n469643499.shtml#死去活来第24集$http://tv.sohu.com/20161006/n469643501.shtml#死去活来第25集$http://tv.sohu.com/20161006/n46