INSERT INTO `mac_vod` VALUES('16728','幸福的旅程','','xingfudelvcheng','X','','http://photocdn.sohu.com/kis/fengmian/190/190480/190480_ver_big_20160927164504.jpg','http://photocdn.sohu.com/kis/fengmian/190/190480/190480_ver_big_20160927164504.jpg','','郭德纲/姜超/史妍/刘金山/冯静','王宏桥','老百姓,故事,矛盾','','大陆','国语','2010','12','',',354,','0','0','0','0','0','0','0','0','793201','0','0','0','0','0','0','4.0','0','60','1481692031','1482086346','0','0','发生在一艘名叫“幸福号”长途豪华客轮上，一段段感人至深的百姓故事。“幸福号”客轮实际是一个浓缩的社会，各种生活背景的人都可以集合到这条船上。全船人员共同生活在一起，人与人之间很容易发生各种各样的矛盾和故事，他们会共同面对困难，共同享受生活的快乐。船上每个人身上还会产生各种有趣的事情。该剧是以一条长途客轮作为故事的载体，客轮上形形色色的乘客，有着不同的社会经历。他们不断的带着各自的故事上船，又把在船上的美好的记忆带到各自生活中去。该剧的故事虽然发生在船上，但是，每个故事讲述的却是贴近老百姓生活的人和事。','sohu$$$qq','$$$','$$$','幸福的旅程第1集$http://tv.sohu.com/20161007/n469666879.shtml#幸福的旅程第2集$http://tv.sohu.com/20161007/n469666883.shtml#幸福的旅程第3集$http://tv.sohu.com/20161007/n469666887.shtml#幸福的旅程第4集$http://tv.sohu.com/20161007/n469666892.shtml#幸福的旅程第5集$http://tv.sohu.com/20161007/n469666898.shtml#幸福的旅程第6集$http://tv.sohu.com/20161007/n469666903.shtml#幸福的旅程第7集$http://tv.sohu.com/20161007/n469666909.shtml#幸福的旅程第8集$http://tv.sohu.com/20161007/n469666916.shtml#幸福的旅程第9集$http://tv.sohu.com/20161007/n469666921.shtml#幸福的旅程第10集$http://tv.sohu.com/20161007/n469666925.shtml#幸福的旅程第11集$http://tv.sohu.com/20161007/n469666929.shtml#幸福的旅程第12集$http://tv.sohu.com/20161007/n469666934.shtml#幸福的旅程第13集$http://tv.sohu.com/20161007/n469666937.shtml#幸福的旅程第14集$http://tv.sohu.com/20161007/n469666942.shtml#幸福的旅程第15集$http://tv.sohu.com/20161007/n469666947.shtml#幸福的旅程第16集$http://tv.sohu.com/20161007/n469666951.shtml#幸福的旅程第17集$http://tv.sohu.com/20161007/n469666956.shtml#幸福的旅程第18集$http://tv.sohu.com/20161007/n469666961.shtml#幸福的旅程第19集$http://tv.sohu.com/20161007/n469666968.shtml#幸福的旅程第20集$http://tv.sohu.com/20161007/n469666973.shtml#幸福的旅程第21集$http://tv.sohu.com/20161007/n469666980.shtml#幸福的旅程第22集$http://tv.sohu.com/20161007/n469666985.shtml#幸福的旅程第23集$http://tv.sohu.com/20161007/n469666989.shtml#幸福的旅程第24集$http://tv.sohu.com/2