INSERT INTO `mac_vod` VALUES('16729','激荡时代','共26集全','jidangshidai','J','','http://photocdn.sohu.com/kis/fengmian/1082/1082954/1082954_ver_big_20160923165503.jpg','http://photocdn.sohu.com/kis/fengmian/1082/1082954/1082954_ver_big_20160923165503.jpg','','陈杰/梁云霞/李子嫣/王晓霞','文韬/黄克','房地产公司,投资公司,总经理,从零开始,离家出走','共26集全','大陆','国语','2010','12','',',377,','0','0','0','0','0','0','0','0','462213','0','0','0','0','0','0','4.0','0','253','1481692032','1481692032','0','0','李小雪促成即将破产的赵刚天宇房地产公司和周皓的房产公司合并，顺理成章的当上了项目总经理，尽管她努力工作，在杨静，金澜的支持下取得了一些成就，但是，由于经验不足在关键时期犯了严重错误，失去了工作，遭受了沉重的打击。李小雪没有被击倒，她承认错误，痛定思痛，勇敢面对现实，在朋友们的帮助下成立了投资公司，克服了重重困难，终于打开了局面。小雪和周陶相互爱慕，但周陶屈服于父母，为了挽救公司准备和第二大股东金澜结婚，李小雪的妹妹小雨为报复金澜去勾引周陶，小雪反对小雨的做法，最终，周陶和金澜结婚。周陶和金澜由于志向不同，婚姻出现裂痕，周陶思念小雪，小雪左右为难痛苦万分。小雪的初恋赵勇极力反对并阻挠小雪和周陶在一起以跳楼威逼，小雪离家出走发誓永不见周陶。金澜报复小雪导致小雪投资公司破产，周陶愤怒与金澜离婚。金澜抽走股金，天与房地产倒闭被人收购，背后收购的人就是金澜。周陶费尽千辛万苦找到了小雪，与小雪一起从零开始了重新打拼。','sohu','','','激荡时代第1集$http://tv.sohu.com/20161006/n469642385.shtml#激荡时代第2集$http://tv.sohu.com/20161006/n469642390.shtml#激荡时代第3集$http://tv.sohu.com/20161006/n469642393.shtml#激荡时代第4集$http://tv.sohu.com/20161006/n469642396.shtml#激荡时代第5集$http://tv.sohu.com/20161006/n469642399.shtml#激荡时代第6集$http://tv.sohu.com/20161006/n469642402.shtml#激荡时代第7集$http://tv.sohu.com/20161006/n469642404.shtml#激荡时代第8集$http://tv.sohu.com/20161006/n469642406.shtml#激荡时代第9集$http://tv.sohu.com/20161006/n469642408.shtml#激荡时代第10集$http://tv.sohu.com/20161006/n469642410.shtml#激荡时代第11集$http://tv.sohu.com/20161006/n469642412.shtml#激荡时代第12集$http://tv.sohu.com/20161006/n469642414.shtml#激荡时代第13集$http://tv.sohu.com/20161006/n469642416.shtml#激荡时代第14集$http://tv.sohu.com/20161006/n469642419.shtml#激荡时代第15集$http://tv.sohu.com/20161006/n469642424.shtml#激荡时代第16集$http://tv.sohu.com/20161006/n469642427.shtml#激荡时代第17集$http://tv.sohu.com/20161006/n469642430.shtml#激荡时代第18集$http://tv.sohu.com/20161006/n469642434.shtml#激荡时代第19集$http://tv.sohu.com/20161006/n469642440.shtml#激荡时代第20集$http://tv.sohu.com/20161006/n469642444.shtml#激荡时代第21集$http://tv.sohu.com/20161006/n46964