INSERT INTO `mac_vod` VALUES('16730','美丽誓言','','meilishiyan','M','','http://photocdn.sohu.com/kis/fengmian/1102/1102100/1102100_ver_big_20160927170503.jpg','http://photocdn.sohu.com/kis/fengmian/1102/1102100/1102100_ver_big_20160927170503.jpg','','黄海冰/戴娇倩/叶鹏/小李琳/午马','车径行','绍兴市,毕业生,活化石,高薪,故乡','23集全','大陆','国语','2012','12','',',441,','0','0','0','0','0','0','0','0','597104','0','0','0','0','0','0','9.0','0','389','1481692032','1482092544','0','0','一部千年家谱，埋藏了一个千年的秘密。在绍兴市的市郊，一个家族四千多年来一直以活化石的姿态顽强地证明着大禹存在的真实性，他们的职业是为大禹守陵，从公元前一九二三年，一直守到今天，每一次战争、瘟疫及其它自然灾害都给他们带来灭族之灾，最凄凉的时候阖族只剩下父子三人。硕士毕业生姒建邦放弃大城市的诱惑毅然返乡，他的故乡古禹村是有着四千年为大禹守陵历史的村落。当地致富的领军人物姒长乐的高薪聘用毅然当起了村官。在对土地的利用问题上兄弟二人发生了观念上的冲突，在对待村里的姑娘姒小雅以及外来的女作家蓝娴的感情上两人也发生误会，一时间矛盾重重。','sohu$$$youku','$$$','$$$','美丽誓言第1集$http://tv.sohu.com/20161007/n469667066.shtml#美丽誓言第2集$http://tv.sohu.com/20161007/n469667075.shtml#美丽誓言第3集$http://tv.sohu.com/20161007/n469667082.shtml#美丽誓言第4集$http://tv.sohu.com/20161007/n469667089.shtml#美丽誓言第5集$http://tv.sohu.com/20161007/n469667098.shtml#美丽誓言第6集$http://tv.sohu.com/20161007/n469667111.shtml#美丽誓言第7集$http://tv.sohu.com/20161007/n469667118.shtml#美丽誓言第8集$http://tv.sohu.com/20161007/n469667124.shtml#美丽誓言第9集$http://tv.sohu.com/20161007/n469667131.shtml#美丽誓言第10集$http://tv.sohu.com/20161007/n469667137.shtml#美丽誓言第11集$http://tv.sohu.com/20161007/n469667142.shtml#美丽誓言第12集$http://tv.sohu.com/20161007/n469667146.shtml#美丽誓言第13集$http://tv.sohu.com/20161007/n469667149.shtml#美丽誓言第14集$http://tv.sohu.com/20161007/n469667153.shtml#美丽誓言第15集$http://tv.sohu.com/20161007/n469667157.shtml#美丽誓言第16集$http://tv.sohu.com/20161007/n469667163.shtml#美丽誓言第17集$http://tv.sohu.com/20161007/n469667169.shtml#美丽誓言第18集$http://tv.sohu.com/20161007/n469667177.shtml#美丽誓言第19集$http://tv.sohu.com/20161007/n469667182.shtml#美丽誓言第20集$http://tv.sohu.com/20161007/n469667187.shtml#美丽誓言第21集$http://tv.sohu.com/20161007/n469667194.shtml#美丽誓言第22集$http://tv.sohu.com/20161007/n469667203.shtml#美丽誓言第23集$http://tv.sohu.com/20161007/n469667210.shtml$$$http://v.youku.com/v_