INSERT INTO `mac_vod` VALUES('16732','生死瞬间','','shengsishunjian','S','','http://photocdn.sohu.com/kis/fengmian/197/197499/197499_ver_big_20160927133502.jpg','http://photocdn.sohu.com/kis/fengmian/197/197499/197499_ver_big_20160927133502.jpg','','赵春羊/陈娜/王艺/修革/张亚坤','尚洪武','电视剧,专案组,停车场,天堂鸟,公安','','大陆','国语','2011','12','',',431,','0','0','0','0','0','0','0','0','58904','0','0','0','0','0','0','8.0','0','291','1481692032','1482086333','0','0','《生死瞬间》是一部有关公安缉毒题材的电视剧，该剧以传统的缉毒剧情做基础铺垫，其中糅合了令人匪夷所思、扑朔迷离的剧情、同时由众多演技派演员倾情加盟。于洪天和杜健康来到健康制药，却发现资料已经被删除。正在杜健康重建文档的时候，整栋大楼的电源被邓斌切断。于洪天带着杜健康逃出大楼，躲进地下停车场。于洪天教杜健康怎样用枪，两人决定并肩奋战，直到耿鹃带人支援。在与邓斌的激战中，杜健康为了掩护于洪天被子弹打中。最终黑虎将邓斌抓住。邓斌供认说自己就是天堂鸟。专案组经过讨论认为邓斌应该不是天堂鸟，他身后应该还有更大的敌人。','sohu$$$qq','$$$','$$$','生死瞬间第1集$http://tv.sohu.com/20161006/n469643320.shtml#生死瞬间第2集$http://tv.sohu.com/20161006/n469643324.shtml#生死瞬间第3集$http://tv.sohu.com/20161006/n469643328.shtml#生死瞬间第4集$http://tv.sohu.com/20161006/n469643335.shtml#生死瞬间第5集$http://tv.sohu.com/20161006/n469643339.shtml#生死瞬间第6集$http://tv.sohu.com/20161006/n469643343.shtml#生死瞬间第7集$http://tv.sohu.com/20161006/n469643347.shtml#生死瞬间第8集$http://tv.sohu.com/20161006/n469643351.shtml#生死瞬间第9集$http://tv.sohu.com/20161006/n469643355.shtml#生死瞬间第10集$http://tv.sohu.com/20161006/n469643359.shtml#生死瞬间第11集$http://tv.sohu.com/20161006/n469643361.shtml#生死瞬间第12集$http://tv.sohu.com/20161006/n469643363.shtml#生死瞬间第13集$http://tv.sohu.com/20161006/n469643365.shtml#生死瞬间第14集$http://tv.sohu.com/20161006/n469643367.shtml#生死瞬间第15集$http://tv.sohu.com/20161006/n469643369.shtml#生死瞬间第16集$http://tv.sohu.com/20161006/n469643372.shtml#生死瞬间第17集$http://tv.sohu.com/20161006/n469643377.shtml#生死瞬间第18集$http://tv.sohu.com/20161006/n469643381.shtml#生死瞬间第19集$http://tv.sohu.com/20161006/n469643385.shtml#生死瞬间第20集$http://tv.sohu.com/20161006/n469643389.shtml#生死瞬间第21集$http://tv.sohu.com/20161006/n469643394.shtml#生死瞬间第22集$http://tv.sohu.com/20161006/n469643399.shtml#生死瞬间第23集$http://tv.sohu.com/20161006/n469643403.shtml#生死瞬间第24集$http://tv.sohu.com/20161006/n46964