INSERT INTO `mac_vod` VALUES('16733','郭县令轶事','','guoxianlingdieshi','G','','http://photocdn.sohu.com/kis/fengmian/87/87659/87659_ver_big_20160927163003.jpg','http://photocdn.sohu.com/kis/fengmian/87/87659/87659_ver_big_20160927163003.jpg','','郭德纲/史妍/李文启/胡可瑜/于谦','王宏桥','当事人,老百姓,家务事,笑话,料理','62集全','大陆','国语','2010','12','',',472,','0','0','0','0','0','0','0','0','548853','0','0','0','0','0','0','3.0','0','415','1481692032','1482092541','0','0','在古代的某个县城的衙门里，住着郭台郭县令的父母和妻子一家人。衙门里的于师爷和三个衙役同他们一起生活，并料理衙门的日常事务。郭台作为一县之主，他为人正直，憨厚、不畏权贵仗义执言，敢于为老百姓办事。涉及到百姓的利益，他不怕得罪朝廷命官。郭台为人善良，秉公办事，在审理案件过程中，经常遇到原被告是些家不长理不短的小事，郭台为了调节这些矛盾，凡是遇到这种事情他耐心说服较劲脑汁，费劲心思。俗话说清官难断家务事，郭台为了理清这纷乱的家务事，他使劲了各种不合常理招数，来化解矛盾。因此，还不时的还被当事人误解，被人嘲笑并搭进自已的钱财。郭县令在处理各种案件时也时不时将自已的家庭卷进当事人的矛盾中而不能自拔。为此，处理这种案件中也经常闹出笑话。但是，郭台始终坚持做人的原则，化解矛盾、惩恶扬善，维护正义。','sohu$$$qq$$$youku','$$$$$$','$$$$$$','郭县令轶事第1集$http://tv.sohu.com/20161007/n469666821.shtml#郭县令轶事第2集$http://tv.sohu.com/20161007/n469666825.shtml#郭县令轶事第3集$http://tv.sohu.com/20161007/n469666829.shtml#郭县令轶事第4集$http://tv.sohu.com/20161007/n469666833.shtml#郭县令轶事第5集$http://tv.sohu.com/20161007/n469666836.shtml#郭县令轶事第6集$http://tv.sohu.com/20161007/n469666840.shtml#郭县令轶事第7集$http://tv.sohu.com/20161007/n469666844.shtml#郭县令轶事第8集$http://tv.sohu.com/20161007/n469666846.shtml#郭县令轶事第9集$http://tv.sohu.com/20161007/n469666848.shtml#郭县令轶事第10集$http://tv.sohu.com/20161007/n469666858.shtml#郭县令轶事第11集$http://tv.sohu.com/20161007/n469666860.shtml#郭县令轶事第12集$http://tv.sohu.com/20161007/n469666864.shtml#郭县令轶事第13集$http://tv.sohu.com/20161007/n469666866.shtml#郭县令轶事第14集$http://tv.sohu.com/20161007/n469666868.shtml#郭县令轶事第15集$http://tv.sohu.com/20161007/n469666870.shtml#郭县令轶事第16集$http://tv.sohu.com/20161007/n469666872.shtml#郭县令轶事第17集$http://tv.sohu.com/20161007/n469666874.shtml#郭县令轶事第18集$http://tv.sohu.com/20161007/n469666876.shtml#郭县令轶事第19集$http://tv.sohu.com/20161007/n469666878.shtml#郭县令轶事第20集$http://tv.sohu.com/20161007/n469666881.shtml#郭县令轶事第21集$http://tv.sohu.com/20161007/n469666885.shtml#郭县令轶事第22集$http://tv.soh