INSERT INTO `mac_vod` VALUES('16734','情断上海滩','','qingduanshanghaitan','Q','','http://photocdn.sohu.com/kis/fengmian/87/87252/87252_ver_big_20160926144003.jpg','http://photocdn.sohu.com/kis/fengmian/87/87252/87252_ver_big_20160926144003.jpg','','陈龙/戴娇倩/刘冠翔/李湘/赵鸿飞','尤小刚','上海滩,英雄本色,龙争虎斗,游乐场,流浪汉','25集全','大陆','国语','2005','12','',',470,','0','0','0','0','0','0','0','0','254121','0','0','0','0','0','0','7.0','0','163','1481692033','1482092563','0','0','五毒杂居，华洋相处，枪战械斗，奇情惊艳，新版《上海滩》风云再起……国难当头，兄弟异志，盲女在“阴谋”中复明，玫瑰在鲜血中绽放，千古风流浪淘尽，方显英雄本色。娱乐大亨赵世荣内外勾结称霸外滩，与国货大王倪彦祥、公务局局长马德安鼎足而立，剑拔弩张争斗不休；贫民窟发生流浪汉连环被杀事件，事件幕后主谋是赵世荣，他逼使院长乔刚就范，在学院内私建药物试验室，屠杀流浪汉……烈文(赵毅饰)烈之(陈龙饰)兄弟身手不凡为世荣赏识，纳入其游乐场，不料坠入世荣的圈套，烈文被诱杀乔刚灭口，后又惨遭毒手，烈之为侦查背后的更大阴谋假意投向世荣，欲讨好世荣欢心追求其女儿玫瑰(李湘饰)，令情人乔依依心碎，也常与白尘短兵相接，好朋友被逼走上陌路，龙争虎斗。赵世荣先后除去死敌马德安及倪彦祥，晋身新一任公务局长，成为上海滩上一代枭雄，烈之取得世荣信任并深入虎穴伺机反击。','sohu$$$qq$$$youku','$$$$$$','$$$$$$','情断上海滩第1集$http://tv.sohu.com/20161006/n469642243.shtml#情断上海滩第2集$http://tv.sohu.com/20161006/n469642247.shtml#情断上海滩第3集$http://tv.sohu.com/20161006/n469642251.shtml#情断上海滩第4集$http://tv.sohu.com/20161006/n469642254.shtml#情断上海滩第5集$http://tv.sohu.com/20161006/n469642258.shtml#情断上海滩第6集$http://tv.sohu.com/20161006/n469642262.shtml#情断上海滩第7集$http://tv.sohu.com/20161006/n469642267.shtml#情断上海滩第8集$http://tv.sohu.com/20161006/n469642271.shtml#情断上海滩第9集$http://tv.sohu.com/20161006/n469642276.shtml#情断上海滩第10集$http://tv.sohu.com/20161006/n469642279.shtml#情断上海滩第11集$http://tv.sohu.com/20161006/n469642283.shtml#情断上海滩第12集$http://tv.sohu.com/20161006/n469642287.shtml#情断上海滩第13集$http://tv.sohu.com/20161006/n469642289.shtml#情断上海滩第14集$http://tv.sohu.com/20161006/n469642291.shtml#情断上海滩第15集$http://tv.sohu.com/20161006/n469642293.shtml#情断上海滩第16集$http://tv.sohu.com/20161006/n469642295.shtml#情断上海滩第17集$http://tv.sohu.com/20161006/n469642297.shtml#情断上海滩第18集$http://tv.sohu.com/20161006/n469642299.shtml#情断上海滩第19集$http://tv.sohu.com/20161006/n469642302.shtml#情断上海滩第20集$http://tv.sohu.com/20161006/n469642304.shtml#情断上海滩第21集$http://tv.sohu.com/20161006/n469642307.