INSERT INTO `mac_vod` VALUES('16737','皇城神鹰','共22集全','huangchengshenying','H','','http://photocdn.sohu.com/kis/fengmian/54/54757/54757_ver_big_20160927132003.jpg','http://photocdn.sohu.com/kis/fengmian/54/54757/54757_ver_big_20160927132003.jpg','','含笑/宁静/吴京/李颖/郑爽','李永民','阎王殿,苏州,怀远,联合,民间','共22集全','大陆','国语','2001','12','',',386,','0','0','0','0','0','0','0','0','773365','0','0','0','0','0','0','7.0','0','26','1481692033','1481692033','0','0','大钦差金搏虎深入民间办案秉公执法、扬善除恶查处众多贪官污吏和龌龊鬼怪因调查苏州怀远侯输掉100万两税银一案得罪了一批京城官员于众官员联合皇后设置重重圈套陷害金搏虎金搏虎九死一生不避艰险终于阎王殿斩除众敌揪出罪酋找出事实证据但金搏虎面部被剧毒腐蚀从此以鹰面掩面。皇上要对金搏虎封官加爵之时却收到了金搏虎托公公苏弩转交给皇上‘遏必隆刀’金搏虎从此消失京城但京城总有一只神鹰窥视着贪官污吏和百姓疾苦其声名威慑九城朝野都尊称为“鹰面阎罗”。','sohu','','','皇城神鹰第1集$http://tv.sohu.com/20161006/n469643230.shtml#皇城神鹰第2集$http://tv.sohu.com/20161006/n469643232.shtml#皇城神鹰第3集$http://tv.sohu.com/20161006/n469643234.shtml#皇城神鹰第4集$http://tv.sohu.com/20161006/n469643236.shtml#皇城神鹰第5集$http://tv.sohu.com/20161006/n469643238.shtml#皇城神鹰第6集$http://tv.sohu.com/20161006/n469643240.shtml#皇城神鹰第7集$http://tv.sohu.com/20161006/n469643242.shtml#皇城神鹰第8集$http://tv.sohu.com/20161006/n469643246.shtml#皇城神鹰第9集$http://tv.sohu.com/20161006/n469643249.shtml#皇城神鹰第10集$http://tv.sohu.com/20161006/n469643251.shtml#皇城神鹰第11集$http://tv.sohu.com/20161006/n469643255.shtml#皇城神鹰第12集$http://tv.sohu.com/20161006/n469643259.shtml#皇城神鹰第13集$http://tv.sohu.com/20161006/n469643262.shtml#皇城神鹰第14集$http://tv.sohu.com/20161006/n469643267.shtml#皇城神鹰第15集$http://tv.sohu.com/20161006/n469643272.shtml#皇城神鹰第16集$http://tv.sohu.com/20161006/n469643277.shtml#皇城神鹰第17集$http://tv.sohu.com/20161006/n469643281.shtml#皇城神鹰第18集$http://tv.sohu.com/20161006/n469643285.shtml#皇城神鹰第19集$http://tv.sohu.com/20161006/n469643289.shtml#皇城神鹰第20集$http://tv.sohu.com/20161006/n469643293.shtml#皇城神鹰第21集$http://tv.sohu.com/20161006/n469643297.shtml#皇城神鹰第22集$http://tv.sohu.com/20161006/n469643301.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16738','杨光的快乐生活 第六部','共22集全','yangguangdekuaileshenghuodiliubu','Y','','http://photocdn.sohu.com/kis/fengmian/1103/1103634/1103634_ver_big_20160926171503.jpg','http://photocdn.sohu.com/kis/fengmian/1103/1103634/1103634_ver_big_20160926171503.jpg','','杨议/杨少华/尚华/韩兆/郜妍妍','杨议','不文明行为,生财之道,电视台,董事长,妇产科','共22集全','大陆','国语','2009','12','',',356,','0','0','0','0','0','0','0','0','795573','0','0','0','0','0','0','6.0','0','190','1481692033','1481692033','0','0','杨光在路上机缘巧合的几次不文明行为被电视台播出，成了反面典型。不甘心的杨光拉上条子，准备自己拍摄新闻当成生财之道，却一次次被电视台拒之门外。保安队为杨光配发了一部DV，杨光拍摄保安队队员的各种生活，获得了大奖。杨光的同学是妇产科主任，同事邻居纷纷来找杨光帮忙做流产手术，碍于面子，杨光一次次地向孙蓝求助，惹出很多麻烦。金董事发现条子是自己的亲生骨肉，条子的身份骤然改变成为“金条”，金山顺则被扫地出门到了条子家。金山顺把杨光和胡同里的生活描绘在画纸上，发现这就是他追求的最质朴的艺术。条子在富贵的生活中觉得失去了自我。金董事长重病中，要见金山顺，金山顺面对垂危的金董事长说出了原来当初是他自己调换了血样，而自己确是金董事长真正的骨肉。最终父子相认，条子又回到胡同继续自己卖水果的生活。','sohu','','','杨光的快乐生活6第1集$http://tv.sohu.com/20161007/n469666618.shtml#杨光的快乐生活6第2集$http://tv.sohu.com/20161007/n469666624.shtml#杨光的快乐生活6第3集$http://tv.sohu.com/20161007/n469666630.shtml#杨光的快乐生活6第4集$http://tv.sohu.com/20161007/n469666639.shtml#杨光的快乐生活6第5集$http://tv.sohu.com/20161007/n469666658.shtml#杨光的快乐生活6第6集$http://tv.sohu.com/20161007/n469666663.shtml#杨光的快乐生活6第7集$http://tv.sohu.com/20161007/n469666670.shtml#杨光的快乐生活6第8集$http://tv.sohu.com/20161007/n469666674.shtml#杨光的快乐生活6第9集$http://tv.sohu.com/20161007/n469666678.shtml#杨光的快乐生活6第10集$http://tv.sohu.com/20161007/n469666684.shtml#杨光的快乐生活6第11集$http://tv.sohu.com/20161007/n469666687.shtml#杨光的快乐生活6第12集$http://tv.sohu.com/20161007/n469666695.shtml#杨光的快乐生活6第13集$http://tv.sohu.com/20161007/n469666703.shtml#杨光的快乐生活6第14集$http://tv.sohu.com/20161007/n469666708.shtml#杨光的快乐生活6第15集$http://tv.sohu.com/20161007/n469666712.shtml#杨光的快乐生活6第16集$http://tv.sohu.com/20161007/n469666717.shtml#杨光的快乐生活6第17集$http://tv.sohu.com/20161007/n469666723.shtml#杨光的快乐生活6第18集$http://tv.sohu.com/20161007/n469666727.shtml#杨光的快乐生活6第19集$http://tv.sohu.com/20161007/n469666733.shtml#杨光的快乐生活6第20集$http://tv.sohu.com/20161007/n469666739.shtml#杨光的快乐