INSERT INTO `mac_vod` VALUES('16739','勇士的最后秘密','共27集全','yongshidezuihoumimi','Y','','http://photocdn.sohu.com/kis/fengmian/91/91116/91116_ver_big_20160926141503.jpg','http://photocdn.sohu.com/kis/fengmian/91/91116/91116_ver_big_20160926141503.jpg','','雷牧/陈小春/元华/万妮恩/刘灿','尤小刚','中国政府,犯罪团伙,俄罗斯,陈小春,武当山','共27集全','大陆','国语','2010','12','',',60,','0','0','0','0','0','0','0','0','145819','0','0','0','0','0','0','1.0','0','99','1481692034','1481692034','0','0','这份手稿即将起运前往俄罗斯展出，于是，犯罪团伙想尽办法偷窃手稿，但由于博物馆警戒严密，始终未能得手。中国政府应邀派出了智勇双全的国际刑警卫平(刘灿饰)，与俄罗斯探长尼娜以及普斯科维伊联合行动，终于在中国的武当山逮捕了参与偷盗的李虎(雷牧饰)。与此同时，幕后黑手以杂技表演为名，诱骗李虎和卫平的同门师兄李大牛(陈小春饰)取得了手稿，但此时的李大牛发现自己被骗。为了证明自己的清白，正直善良的李大牛在自己的俄罗斯朋友费多尔的帮助下，终于把手稿归还给警察局。然而经鉴定，手稿竟是假的。警方请求李大牛配合查案，李大牛为帮助师弟李虎戴罪立功，同意了当诱饵的计划，良心发现的李虎也决定将功赎罪。于是，在警方的配合下，李大牛和李虎各自执行自己的任务。一场对财富的探寻和争夺之战就此展开。','sohu','','','勇士的最后秘密第1集$http://tv.sohu.com/20161006/n469642082.shtml#勇士的最后秘密第2集$http://tv.sohu.com/20161006/n469642087.shtml#勇士的最后秘密第3集$http://tv.sohu.com/20161006/n469642091.shtml#勇士的最后秘密第4集$http://tv.sohu.com/20161006/n469642095.shtml#勇士的最后秘密第5集$http://tv.sohu.com/20161006/n469642100.shtml#勇士的最后秘密第6集$http://tv.sohu.com/20161006/n469642104.shtml#勇士的最后秘密第7集$http://tv.sohu.com/20161006/n469642108.shtml#勇士的最后秘密第8集$http://tv.sohu.com/20161006/n469642112.shtml#勇士的最后秘密第9集$http://tv.sohu.com/20161006/n469642116.shtml#勇士的最后秘密第10集$http://tv.sohu.com/20161006/n469642121.shtml#勇士的最后秘密第11集$http://tv.sohu.com/20161006/n469642126.shtml#勇士的最后秘密第12集$http://tv.sohu.com/20161006/n469642130.shtml#勇士的最后秘密第13集$http://tv.sohu.com/20161006/n469642132.shtml#勇士的最后秘密第14集$http://tv.sohu.com/20161006/n469642134.shtml#勇士的最后秘密第15集$http://tv.sohu.com/20161006/n469642137.shtml#勇士的最后秘密第16集$http://tv.sohu.com/20161006/n469642139.shtml#勇士的最后秘密第17集$http://tv.sohu.com/20161006/n469642141.shtml#勇士的最后秘密第18集$http://tv.sohu.com/20161006/n469642143.shtml#勇士的最后秘密第19集$http://tv.sohu.com/20161006/n469642149.shtml#勇士的最后秘密第20集$http://tv.sohu.com/20161006/n469642155.shtml#勇士的最后秘密第21集$http://tv.sohu.com/20161006/n469642162.shtml#勇士的最后