INSERT INTO `mac_vod` VALUES('16740','金搏虎','','jinbohu','J','','http://photocdn.sohu.com/kis/fengmian/1093/1093906/1093906_ver_big_20160927131503.jpg','http://photocdn.sohu.com/kis/fengmian/1093/1093906/1093906_ver_big_20160927131503.jpg','','李丁/丁海峰/瑶淼/徐锦江/含笑','李永民/陈亚洲','蒙古','20集全','大陆','国语','2001','12','',',473,','0','0','0','0','0','0','0','0','457820','0','0','0','0','0','0','5.0','0','53','1481692034','1482092546','0','0','世间传言解差和狱卒最心鄙狠毒，皇帝为锻炼络桑，密旨把他下狱，随囚发配边疆，沿路受尽折磨欺凌，以锻炼他忍辱挨苦的坚韧。后又以络桑作靶，展开蒙古式猎杀，百里之内，能获络桑首级者，重赏奖励。于是络桑在生死一发中逃命，以训练他死里求生的机智和愤极反抗的杀气，再以他挚爱激发他奋起争斗的野性，而取胜他不屈不挠的意志。最后挚爱被杀，络桑频临疯狂，击杀情敌和叛国首恶，而通过试炼，被皇帝颁赐“金搏虎”的荣誉。','sohu$$$youku','$$$','$$$','金搏虎第1集$http://tv.sohu.com/20161006/n469643148.shtml#金搏虎第2集$http://tv.sohu.com/20161006/n469643153.shtml#金搏虎第3集$http://tv.sohu.com/20161006/n469643159.shtml#金搏虎第4集$http://tv.sohu.com/20161006/n469643164.shtml#金搏虎第5集$http://tv.sohu.com/20161006/n469643169.shtml#金搏虎第6集$http://tv.sohu.com/20161006/n469643176.shtml#金搏虎第7集$http://tv.sohu.com/20161006/n469643179.shtml#金搏虎第8集$http://tv.sohu.com/20161006/n469643184.shtml#金搏虎第9集$http://tv.sohu.com/20161006/n469643187.shtml#金搏虎第10集$http://tv.sohu.com/20161006/n469643191.shtml#金搏虎第11集$http://tv.sohu.com/20161006/n469643196.shtml#金搏虎第12集$http://tv.sohu.com/20161006/n469643199.shtml#金搏虎第13集$http://tv.sohu.com/20161006/n469643201.shtml#金搏虎第14集$http://tv.sohu.com/20161006/n469643203.shtml#金搏虎第15集$http://tv.sohu.com/20161006/n469643207.shtml#金搏虎第16集$http://tv.sohu.com/20161006/n469643209.shtml#金搏虎第17集$http://tv.sohu.com/20161006/n469643211.shtml#金搏虎第18集$http://tv.sohu.com/20161006/n469643215.shtml#金搏虎第19集$http://tv.sohu.com/20161006/n469643217.shtml#金搏虎第20集$http://tv.sohu.com/20161006/n469643220.shtml$$$http://v.youku.com/v_show/id_XMTgxNjI0MjA0OA==.html#http://v.youku.com/v_show/id_XMTgxNjI5NjcwNA==.html#http://v.youku.com/v_show/id_XMTgxNjMzMjg1Mg==.html#http://v.youku.com/v_show/id_XMTgxNjM4MDYwMA==.html#http://v.youku.com/v_show/id_XMTgxNjc4MjA4NA==.html#http://v.youku.com/v_show/id_