INSERT INTO `mac_vod` VALUES('16742','极品妈妈','','jipinmama','J','','http://photocdn.sohu.com/kis/fengmian/1091/1091139/1091139_ver_big_20160926135502.jpg','http://photocdn.sohu.com/kis/fengmian/1091/1091139/1091139_ver_big_20160926135502.jpg','','聂远/戴娇倩/贺刚/鲍国安/王诗蒙','赖建国','工作环境,奉子成婚,婚姻,矛盾,男女','28集全','大陆','国语','2012','12','',',354,','0','0','0','0','0','0','0','0','282668','0','0','0','0','0','0','9.0','0','457','1481692034','1482092541','0','0','陈百锋、安可，外表潇洒内心传统的典型都市男女，酒吧邂逅。二人恋爱、奉子成婚。随着安产期临近，二人从前的甜蜜被现实的繁杂无奈取代。孩子降临，二人这才发现未做好任何心理准备。为成优秀母亲，安总希望做到最好，效果却适得其反且被封有讽刺意义的“极品妈妈”。陈因工作环境问题，辞职在家。夫妻矛盾激化，陈的前女友涉足，安提出离婚。离婚后，他们发现彼此就是最适合的人。在没有婚姻束缚的相处中，以孩子为纽带，反而更懂得珍惜、体谅对方。同时，陈的表妹耿耿，为让已离婚的父母和好，毅然住进父亲家，欲将父亲的现任妻子鸣薇薇赶出家门。耿、鸣从最初的格格不入到最后相互体贴理解。当鸣难产躺在病床上、耿父又坐牢时，耿肩负起照顾同父异母弟弟的责任，亦姐亦母，被封为“极品妈妈”。','sohu$$$youku','$$$','$$$','极品妈妈第1集$http://tv.sohu.com/20161006/n469641941.shtml#极品妈妈第2集$http://tv.sohu.com/20161006/n469641950.shtml#极品妈妈第3集$http://tv.sohu.com/20161006/n469641957.shtml#极品妈妈第4集$http://tv.sohu.com/20161006/n469641969.shtml#极品妈妈第5集$http://tv.sohu.com/20161006/n469641976.shtml#极品妈妈第6集$http://tv.sohu.com/20161006/n469641979.shtml#极品妈妈第7集$http://tv.sohu.com/20161006/n469641987.shtml#极品妈妈第8集$http://tv.sohu.com/20161006/n469641999.shtml#极品妈妈第9集$http://tv.sohu.com/20161006/n469642008.shtml#极品妈妈第10集$http://tv.sohu.com/20161006/n469642016.shtml#极品妈妈第11集$http://tv.sohu.com/20161006/n469642021.shtml#极品妈妈第12集$http://tv.sohu.com/20161006/n469642024.shtml#极品妈妈第13集$http://tv.sohu.com/20161006/n469642037.shtml#极品妈妈第14集$http://tv.sohu.com/20161006/n469642055.shtml#极品妈妈第15集$http://tv.sohu.com/20161006/n469642067.shtml#极品妈妈第16集$http://tv.sohu.com/20161006/n469642076.shtml#极品妈妈第17集$http://tv.sohu.com/20161006/n469642081.shtml#极品妈妈第18集$http://tv.sohu.com/20161006/n469642086.shtml#极品妈妈第19集$http://tv.sohu.com/20161006/n469642090.shtml#极品妈妈第20集$http://tv.sohu.com/20161006/n469642094.shtml#极品妈妈第21集$http://tv.sohu.com/20161006/n469642099.shtml#极品妈妈第22集$http://tv.sohu.com/20161006/n469642103.shtml#极品妈妈第23集$http://tv.