INSERT INTO `mac_vod` VALUES('16744','杨光的快乐生活 第四部','共38集全','yangguangdekuaileshenghuodisibu','Y','','http://photocdn.sohu.com/kis/fengmian/86/86998/86998_ver_big_20160926163004.jpg','http://photocdn.sohu.com/kis/fengmian/86/86998/86998_ver_big_20160926163004.jpg','','杨议/杨少华/韩兆/尚华/王奎荣','杨议','同学聚会,夜总会,经纪人,英雄,爱情','共38集全','大陆','国语','2008','12','',',444,','0','0','0','0','0','0','0','0','423943','0','0','0','0','0','0','4.0','0','49','1481692035','1481692035','0','0','夏丽出国，对于杨光造成了重大的打击，使他对于爱情失去了信心。邻居朋友同事纷纷帮忙介绍对象，却遭到了杨光的一次次拒绝。在一次同学聚会上，杨光遇到的曾经暗恋的同学小薇又让他本已沉寂的心再次躁动起来。在老同学和老师的撮合下，杨光和小薇（尚华饰演）的感情进展十分顺利。但是在一次偶然的机会下，杨光发现小薇原来是在夜总会唱歌的歌女，这又让杨光的内心受到了重击。小薇在夜总会里经常会遭到顾客的无理要求，在一次替小薇挡酒的英雄救美之后，杨光知道原来小薇在夜总会工作也是无奈之下迫不得已的选择。时来运转，常到夜总会观察小薇的唱片公司经纪人肯定了小薇在歌唱方面的才华，小薇成了偶像歌星，但是杨光和成为明星后的小薇之间的身份差距也越来越大，为了成全小薇的明星之路，为了对小薇的爱，杨光最终选择了放手。','sohu','','','杨光的快乐生活4第1集$http://tv.sohu.com/20161007/n469666480.shtml#杨光的快乐生活4第2集$http://tv.sohu.com/20161007/n469666482.shtml#杨光的快乐生活4第3集$http://tv.sohu.com/20161007/n469666484.shtml#杨光的快乐生活4第4集$http://tv.sohu.com/20161007/n469666486.shtml#杨光的快乐生活4第5集$http://tv.sohu.com/20161007/n469666488.shtml#杨光的快乐生活4第6集$http://tv.sohu.com/20161007/n469666490.shtml#杨光的快乐生活4第7集$http://tv.sohu.com/20161007/n469666496.shtml#杨光的快乐生活4第8集$http://tv.sohu.com/20161007/n469666501.shtml#杨光的快乐生活4第9集$http://tv.sohu.com/20161007/n469666504.shtml#杨光的快乐生活4第10集$http://tv.sohu.com/20161007/n469666511.shtml#杨光的快乐生活4第11集$http://tv.sohu.com/20161007/n469666515.shtml#杨光的快乐生活4第12集$http://tv.sohu.com/20161007/n469666518.shtml#杨光的快乐生活4第13集$http://tv.sohu.com/20161007/n469666520.shtml#杨光的快乐生活4第14集$http://tv.sohu.com/20161007/n469666522.shtml#杨光的快乐生活4第15集$http://tv.sohu.com/20161007/n469666524.shtml#杨光的快乐生活4第16集$http://tv.sohu.com/20161007/n469666527.shtml#杨光的快乐生活4第17集$http://tv.sohu.com/20161007/n469666529.shtml#杨光的快乐生活4第18集$http://tv.sohu.com/20161007/n469666531.shtml#杨光的快乐生活4第19集$http://tv.sohu.com/20161007/n469666534.shtml#杨光的快乐生活4第20集$http://tv.sohu.com/20161007/n469666537.shtml#杨光的快乐生活4第21集$http://tv.so