INSERT INTO `mac_vod` VALUES('16746','警中警','','jingzhongjing','J','','http://photocdn.sohu.com/kis/fengmian/1083/1083583/1083583_ver_big_20160923173002.jpg','http://photocdn.sohu.com/kis/fengmian/1083/1083583/1083583_ver_big_20160923173002.jpg','','刘之冰/王玉璋/茹萍/王志刚/张兴哲','孙波','电视剧,公安局,政法委,老百姓,建筑业','','大陆','国语','2005','12','',',378,','0','0','0','0','0','0','0','0','734270','0','0','0','0','0','0','2.0','0','245','1481692035','1481826078','0','0','这是一个人民警察与黑恶势力进行殊死搏斗的惊险故事；这是中国第一部描写“管警察的警察”的电视剧；这也是灵与肉、情与法、爱与恨、正义与邪恶、奉献与贪婪激烈冲突的人生戏剧。故事的主人公是公安战线第一代督察警，老百姓亲切地称谓他们为“警中警”……故事发生在绿江市。丁潮受人指使绑架了绿江市建筑业巨头丽都集团总裁张大洋，市公安局副局长马云山指挥刑警队，成功解救了人质，受到政法委陈副书记的高度评价。丁潮在医院莫名其妙地死去，这让刑警支队副支队长常健非常恼火，他认为丁潮的案子和三年前杀害了三名警察的“蓝平大侠案”有关。','sohu$$$qq','$$$','$$$','警中警第1集$http://tv.sohu.com/20161006/n469642674.shtml#警中警第2集$http://tv.sohu.com/20161006/n469642688.shtml#警中警第3集$http://tv.sohu.com/20161006/n469642703.shtml#警中警第4集$http://tv.sohu.com/20161006/n469642708.shtml#警中警第5集$http://tv.sohu.com/20161006/n469642715.shtml#警中警第6集$http://tv.sohu.com/20161006/n469642725.shtml#警中警第7集$http://tv.sohu.com/20161006/n469642734.shtml#警中警第8集$http://tv.sohu.com/20161006/n469642742.shtml#警中警第9集$http://tv.sohu.com/20161006/n469642744.shtml#警中警第10集$http://tv.sohu.com/20161006/n469642746.shtml#警中警第11集$http://tv.sohu.com/20161006/n469642748.shtml#警中警第12集$http://tv.sohu.com/20161006/n469642750.shtml#警中警第13集$http://tv.sohu.com/20161006/n469642754.shtml#警中警第14集$http://tv.sohu.com/20161006/n469642757.shtml#警中警第15集$http://tv.sohu.com/20161006/n469642762.shtml#警中警第16集$http://tv.sohu.com/20161006/n469642767.shtml#警中警第17集$http://tv.sohu.com/20161006/n469642774.shtml#警中警第18集$http://tv.sohu.com/20161006/n469642787.shtml#警中警第19集$http://tv.sohu.com/20161006/n469642800.shtml#警中警第20集$http://tv.sohu.com/20161006/n469642814.shtml#警中警第21集$http://tv.sohu.com/20161006/n469642820.shtml#警中警第22集$http://tv.sohu.com/20161006/n469642828.shtml#警中警第23集$http://tv.sohu.com/20161006/n469642832.shtml#警中警 第二部$http://tv.sohu.com/item/NzEyMTI=.html警中警 第三部$http://t