INSERT INTO `mac_vod` VALUES('16747','女人无悔','共25集全','nvrenwuhui','N','','http://photocdn.sohu.com/kis/fengmian/77/77737/77737_ver_big_20160922144003.jpg','http://photocdn.sohu.com/kis/fengmian/77/77737/77737_ver_big_20160922144003.jpg','','李进荣/何琳/孙晶晶/钱泳辰','林建龙','服装生意,经济纠纷,事业','共25集全','大陆','国语','2009','12','',',475,','0','0','0','0','0','0','0','0','755724','0','0','0','0','0','0','10.0','0','181','1481692035','1481692035','0','0','孤儿石惠被孙大凯寡母收养，为报答孙母养育之恩，石惠与孙大凯结合。石惠发现孙大凯嗜赌，在与孙大凯离婚后又被孙大凯强奸，孙大凯因此入狱，此后，石惠接受了崔文军的求爱。面对崔母的挑剔和事业的坎坷，石惠顽强拼搏，并生下女儿瑶瑶。崔母意外发现瑶瑶原是孙大凯的女儿，要求崔文军立刻离婚。石惠带瑶瑶离开了……石惠艰难创业，服装生意蒸蒸日上，崔母重病，石惠在身旁精心照顾，崔母深受感动，反过来撮合石惠和崔文军复婚。瑶瑶得了重病必须换肝，符合条件的崔文军逃走，石惠被迫找到孙大凯。换肝手术成功，但瑶瑶失明了。一直暗恋石惠的大款潘国庆破产后自杀，石惠将他救下来，却因经济纠纷被调查，孙大凯出面证实，其实是林芳所为，石惠被洗脱嫌疑。石惠的大爱与宽容感动了所有人，潘国庆也在石惠的劝说下去寻找一直深爱他的林芳。','sohu','','','女人无悔第1集$http://tv.sohu.com/20161006/n469641693.shtml#女人无悔第2集$http://tv.sohu.com/20161006/n469641696.shtml#女人无悔第3集$http://tv.sohu.com/20161006/n469641698.shtml#女人无悔第4集$http://tv.sohu.com/20161006/n469641700.shtml#女人无悔第5集$http://tv.sohu.com/20161006/n469641708.shtml#女人无悔第6集$http://tv.sohu.com/20161006/n469641710.shtml#女人无悔第7集$http://tv.sohu.com/20161006/n469641712.shtml#女人无悔第8集$http://tv.sohu.com/20161006/n469641714.shtml#女人无悔第9集$http://tv.sohu.com/20161006/n469641716.shtml#女人无悔第10集$http://tv.sohu.com/20161006/n469641718.shtml#女人无悔第11集$http://tv.sohu.com/20161006/n469641720.shtml#女人无悔第12集$http://tv.sohu.com/20161006/n469641722.shtml#女人无悔第13集$http://tv.sohu.com/20161006/n469641724.shtml#女人无悔第14集$http://tv.sohu.com/20161006/n469641726.shtml#女人无悔第15集$http://tv.sohu.com/20161006/n469641728.shtml#女人无悔第16集$http://tv.sohu.com/20161006/n469641730.shtml#女人无悔第17集$http://tv.sohu.com/20161006/n469641732.shtml#女人无悔第18集$http://tv.sohu.com/20161006/n469641734.shtml#女人无悔第19集$http://tv.sohu.com/20161006/n469641736.shtml#女人无悔第20集$http://tv.sohu.com/20161006/n469641738.shtml#女人无悔第21集$http://tv.sohu.com/20161006/n469641740.shtml#女人无悔第22集$http://tv.sohu.com/20161006/n469641742.shtml#女人无悔第23集$http://tv.sohu.com