INSERT INTO `mac_vod` VALUES('16748','宣言','','xuanyan','X','','http://photocdn.sohu.com/kis/fengmian/195/195974/195974_ver_big_20160926153003.jpg','http://photocdn.sohu.com/kis/fengmian/195/195974/195974_ver_big_20160926153003.jpg','','任重/王菁华/黄曼/于子健','周力','共产党员,国民党,党支部,反动派,侵略者','26集全','大陆','国语','2011','12','',',84,','0','0','0','0','0','0','0','0','969766','0','0','0','0','0','0','2.0','0','300','1481692035','1482092556','0','0','《宣言》讲述了从1927年到1947年间，中国共产党在北方建立的第一个党支部——刘集支部的几代党支部书记以《共产党宣言》为纲领，带领当地党员和群众进行不懈的斗争，最终迎来了胜利的曙光。以早期建立的中国共产党农村党支部刘集的革命斗争历史为原型进行创作，以刘集党支部保护收藏的我国首版中译本《共产党宣言》(陈望道先生翻译，1920年8月出版)为主线，讲述农民在村支部书记带领下进行抗租抗捐运动、成立农会等一系列故事，是央视建党90周年献礼片。全剧以刘集党支部保护收藏的我国首版中译本《共产党宣言》(陈望道先生翻译，1920年8月出版)为主线，生动展现了中国共产党的基层组织和共产党员高举《共产党宣言》这面旗帜，动员组织、团结带领人民群众同国民党反动派、日本侵略者进行的前赴后继、艰苦卓绝的斗争，为人民解放事业和新中国的诞生做出的重要贡献。','sohu$$$youku','$$$','$$$','宣言第1集$http://tv.sohu.com/20161006/n469641752.shtml#宣言第2集$http://tv.sohu.com/20161006/n469641754.shtml#宣言第3集$http://tv.sohu.com/20161006/n469641756.shtml#宣言第4集$http://tv.sohu.com/20161006/n469641758.shtml#宣言第5集$http://tv.sohu.com/20161006/n469641760.shtml#宣言第6集$http://tv.sohu.com/20161006/n469641762.shtml#宣言第7集$http://tv.sohu.com/20161006/n469641764.shtml#宣言第8集$http://tv.sohu.com/20161006/n469641766.shtml#宣言第9集$http://tv.sohu.com/20161006/n469641768.shtml#宣言第10集$http://tv.sohu.com/20161006/n469641770.shtml#宣言第11集$http://tv.sohu.com/20161006/n469641772.shtml#宣言第12集$http://tv.sohu.com/20161006/n469641774.shtml#宣言第13集$http://tv.sohu.com/20161006/n469641776.shtml#宣言第14集$http://tv.sohu.com/20161006/n469641778.shtml#宣言第15集$http://tv.sohu.com/20161006/n469641780.shtml#宣言第16集$http://tv.sohu.com/20161006/n469641782.shtml#宣言第17集$http://tv.sohu.com/20161006/n469641784.shtml#宣言第18集$http://tv.sohu.com/20161006/n469641786.shtml#宣言第19集$http://tv.sohu.com/20161006/n469641788.shtml#宣言第20集$http://tv.sohu.com/20161006/n469641790.shtml#宣言第21集$http://tv.sohu.com/20161006/n469641792.shtml#宣言第22集$http://tv.sohu.com/20161006/n469641794.shtml#宣言第23集$http://tv.sohu.com/20161006