INSERT INTO `mac_vod` VALUES('16749','狂花凋落','','kuanghuadiaoluo','K','','http://photocdn.sohu.com/kis/fengmian/56/56641/56641_ver_big_20160927103003.jpg','http://photocdn.sohu.com/kis/fengmian/56/56641/56641_ver_big_20160927103003.jpg','','侯勇/田海蓉/孙松/王姬/张远','雷献禾','突发事件,雪绒花,吉普车,研究所,安全局','','大陆','国语','2008','12','',',476,','0','0','0','0','0','0','0','0','158905','0','0','0','0','0','0','8.0','0','112','1481692036','1482086365','0','0','二十一世纪初，中国的宇宙飞船发射成功后，境外的间谍组织把目标锁定在我国著名航天专家、航天研究所所长陈冬生的身上。某日夜，在海迪娜国某处一个静谧的场所，一名境外间谍和一位神秘的女士在谈着一笔交易，一辆悍马吉普车从隐秘的所在疾驶而出，突然发生了爆炸。中国奉阳市国家安全局接到上级通报，总部设在海迪娜的MON国际间谍组织派遣间谍“雪绒花”前往中国企图窃取我航天“121”核心技术机密，在飞往奉阳市的国际航班里，出现了两位神秘的女士—50岁左右的海迪娜籍华人付东篱和较为年轻的周笑冰，她们因为一个突发事件而相识。','sohu$$$qq','$$$','$$$','狂花凋落第1集$http://tv.sohu.com/20161005/n469621595.shtml#狂花凋落第2集$http://tv.sohu.com/20161005/n469621597.shtml#狂花凋落第3集$http://tv.sohu.com/20161005/n469621600.shtml#狂花凋落第4集$http://tv.sohu.com/20161005/n469621602.shtml#狂花凋落第5集$http://tv.sohu.com/20161005/n469621604.shtml#狂花凋落第6集$http://tv.sohu.com/20161005/n469621606.shtml#狂花凋落第7集$http://tv.sohu.com/20161005/n469621608.shtml#狂花凋落第8集$http://tv.sohu.com/20161005/n469621612.shtml#狂花凋落第9集$http://tv.sohu.com/20161005/n469621614.shtml#狂花凋落第10集$http://tv.sohu.com/20161005/n469621616.shtml#狂花凋落第11集$http://tv.sohu.com/20161005/n469621618.shtml#狂花凋落第12集$http://tv.sohu.com/20161005/n469621620.shtml#狂花凋落第13集$http://tv.sohu.com/20161005/n469621622.shtml#狂花凋落第14集$http://tv.sohu.com/20161005/n469621629.shtml#狂花凋落第15集$http://tv.sohu.com/20161005/n469621631.shtml#狂花凋落第16集$http://tv.sohu.com/20161005/n469621633.shtml#狂花凋落第17集$http://tv.sohu.com/20161005/n469621635.shtml#狂花凋落第18集$http://tv.sohu.com/20161005/n469621637.shtml#狂花凋落第19集$http://tv.sohu.com/20161005/n469621639.shtml#狂花凋落第20集$http://tv.sohu.com/20161005/n469621641.shtml#狂花凋落第21集$http://tv.sohu.com/20161005/n469621643.shtml#狂花凋落第22集$http://tv.sohu.com/20161005/n469621646.shtml#狂花凋落第23集$http://tv.sohu.com/20161005/n469621649.shtml#狂花凋落第24集$http://tv.sohu.com/20161005/n469621653.sh