INSERT INTO `mac_vod` VALUES('16750','金色黄昏','','jinsehuanghun','J','','http://photocdn.sohu.com/kis/fengmian/1102/1102715/1102715_ver_big_20160922142003.jpg','http://photocdn.sohu.com/kis/fengmian/1102/1102715/1102715_ver_big_20160922142003.jpg','','雷明/李志舆/吴竟/吴冕','张今标','鬼门关,老年人,调研员,恐惧症,综合症','30集全','大陆','国语','2008','12','',',369,','0','0','0','0','0','0','0','0','694661','0','0','0','0','0','0','6.0','0','268','1481692036','1482092553','0','0','故事以一对老年人再婚重新组成家庭开篇，以两人之间的艰难磨合过程为主线贯穿全剧，直到最终的“心心相印”结束。退休干部马建群在官场历练一生却仍然性情耿直不通世故，临退下来才混了个“处级调研员”。老伴已病故，儿女们也早已另立门户。马建群郁郁寡欢，突患急性哮喘在鬼门关走了一圈又折了回来，从此在“退休综合症”之外更加上了“死亡恐惧症”，症状是脾气火爆、愤世嫉俗，什么都看不入眼，与谁都难以相处。儿子和媳妇深为头痛，认为替他找个老伴可以让他变得心平气和，还可以照料其生活起居。经过一番周折，退休小学教师高云香走进了马建群的家。','sohu$$$youku','$$$','$$$','金色黄昏第1集$http://tv.sohu.com/20161006/n469641557.shtml#金色黄昏第2集$http://tv.sohu.com/20161006/n469641561.shtml#金色黄昏第3集$http://tv.sohu.com/20161006/n469641565.shtml#金色黄昏第4集$http://tv.sohu.com/20161006/n469641569.shtml#金色黄昏第5集$http://tv.sohu.com/20161006/n469641573.shtml#金色黄昏第6集$http://tv.sohu.com/20161006/n469641577.shtml#金色黄昏第7集$http://tv.sohu.com/20161006/n469641585.shtml#金色黄昏第8集$http://tv.sohu.com/20161006/n469641589.shtml#金色黄昏第9集$http://tv.sohu.com/20161006/n469641593.shtml#金色黄昏第10集$http://tv.sohu.com/20161006/n469641598.shtml#金色黄昏第11集$http://tv.sohu.com/20161006/n469641601.shtml#金色黄昏第12集$http://tv.sohu.com/20161006/n469641606.shtml#金色黄昏第13集$http://tv.sohu.com/20161006/n469641609.shtml#金色黄昏第14集$http://tv.sohu.com/20161006/n469641614.shtml#金色黄昏第15集$http://tv.sohu.com/20161006/n469641618.shtml#金色黄昏第16集$http://tv.sohu.com/20161006/n469641622.shtml#金色黄昏第17集$http://tv.sohu.com/20161006/n469641629.shtml#金色黄昏第18集$http://tv.sohu.com/20161006/n469641634.shtml#金色黄昏第19集$http://tv.sohu.com/20161006/n469641639.shtml#金色黄昏第20集$http://tv.sohu.com/20161006/n469641647.shtml#金色黄昏第21集$http://tv.sohu.com/20161006/n469641654.shtml#金色黄昏第22集$http://tv.sohu.com/20161006/n469641660.shtml#金色黄昏第23集$http://tv.sohu.com/20161006/n469641666.shtml#金色黄昏第24集$http://tv.sohu.com/201