INSERT INTO `mac_vod` VALUES('16751','杨光的快乐生活 第三部','共30集全','yangguangdekuaileshenghuodisanbu','Y','','http://photocdn.sohu.com/kis/fengmian/86/86997/86997_ver_big_20160926155002.jpg','http://photocdn.sohu.com/kis/fengmian/86/86997/86997_ver_big_20160926155002.jpg','','杨议/杨少华/韩兆/李立君/王继世','杨议','待业青年,爱情方面,居委会,采花贼,培训班','共30集全','大陆','国语','2007','12','',',444,','0','0','0','0','0','0','0','0','653365','0','0','0','0','0','0','10.0','0','25','1481692036','1481692036','0','0','居委会举办的待业青年培训班，总算让走投无路的杨光（杨议饰）抓到一株救命稻草。经过一段时间的培训，杨光终于成为了一名小区保安。只是这份工作也不那么容易，上有以前结过梁子的领导刁难，下应付业主们各种各样的要求和状况，还得面对采花贼、偷车贼甚至鬼的事件，可真够杨光受的。至于活宝条子（韩兆饰），也实在好不到哪去。或者给杨光找来一个儿子，或者小人乍富干起网吧，总之就是两个字——折腾。在工作和生活上已然焦头烂额的杨光，爱情方面又遭受巨大的挫折。夏丽（李立君饰）突然和自己分手，毅然决然投向有钱老板的怀抱，这另一向快乐开朗的杨光痛苦万分。','sohu','','','杨光的快乐生活3第1集$http://tv.sohu.com/20161005/n469621516.shtml#杨光的快乐生活3第2集$http://tv.sohu.com/20161005/n469621518.shtml#杨光的快乐生活3第3集$http://tv.sohu.com/20161005/n469621520.shtml#杨光的快乐生活3第4集$http://tv.sohu.com/20161005/n469621522.shtml#杨光的快乐生活3第5集$http://tv.sohu.com/20161005/n469621524.shtml#杨光的快乐生活3第6集$http://tv.sohu.com/20161005/n469621526.shtml#杨光的快乐生活3第7集$http://tv.sohu.com/20161005/n469621528.shtml#杨光的快乐生活3第8集$http://tv.sohu.com/20161005/n469621530.shtml#杨光的快乐生活3第9集$http://tv.sohu.com/20161005/n469621535.shtml#杨光的快乐生活3第10集$http://tv.sohu.com/20161005/n469621537.shtml#杨光的快乐生活3第11集$http://tv.sohu.com/20161005/n469621539.shtml#杨光的快乐生活3第12集$http://tv.sohu.com/20161005/n469621541.shtml#杨光的快乐生活3第13集$http://tv.sohu.com/20161005/n469621544.shtml#杨光的快乐生活3第14集$http://tv.sohu.com/20161005/n469621546.shtml#杨光的快乐生活3第15集$http://tv.sohu.com/20161005/n469621548.shtml#杨光的快乐生活3第16集$http://tv.sohu.com/20161005/n469621550.shtml#杨光的快乐生活3第17集$http://tv.sohu.com/20161005/n469621552.shtml#杨光的快乐生活3第18集$http://tv.sohu.com/20161005/n469621554.shtml#杨光的快乐生活3第19集$http://tv.sohu.com/20161005/n469621556.shtml#杨光的快乐生活3第20集$http://tv.sohu.com/20161005/n469621558.shtml#杨光的快乐生活3第21集$http://tv.sohu.com/20161005/n469621560.shtml#杨光的快乐生活3第22集$http://tv.sohu.com/20161