INSERT INTO `mac_vod` VALUES('16753','杨光的快乐生活 第二部','共18集全','yangguangdekuaileshenghuodierbu','Y','','http://photocdn.sohu.com/kis/fengmian/77/77516/77516_ver_big_20160926154003.jpg','http://photocdn.sohu.com/kis/fengmian/77/77516/77516_ver_big_20160926154003.jpg','','杨少华/杨议/韩兆/李立君/王继世','杨议','房地产公司,结婚典礼,平凡人,朋友,大发','共18集全','大陆','国语','2005','12','',',444,','0','0','0','0','0','0','0','0','275901','0','0','0','0','0','0','3.0','0','203','1481692037','1481692037','0','0','因经营不善，黄大发的房地产公司关张大吉。事业上刚刚有点儿起色的杨光(杨议饰)，又再次轮为了失业人员。走投无路之际，他和活宝朋友条子(韩兆饰)开起小饭馆，毫无经验的他们不仅要应付各种各样的繁文缛节和挑战，还要面对来自竞争者的冲击。小饭馆的命运可想而知，而他和女友夏丽(李立君饰)的关系更耐人寻味，上一部中两人的结婚典礼被搅成一锅粥，如今双方则需面对更多的诱惑，由此误会多多，麻烦不断。与此同时，杨光还得想方设法找到新的营生，更多有趣和搞怪的人和事接连出现，杨光的生活充满了属于平凡人的快乐。','sohu','','','杨光的快乐生活2第1集$http://tv.sohu.com/20161005/n469621480.shtml#杨光的快乐生活2第2集$http://tv.sohu.com/20161005/n469621482.shtml#杨光的快乐生活2第3集$http://tv.sohu.com/20161005/n469621484.shtml#杨光的快乐生活2第4集$http://tv.sohu.com/20161005/n469621486.shtml#杨光的快乐生活2第5集$http://tv.sohu.com/20161005/n469621488.shtml#杨光的快乐生活2第6集$http://tv.sohu.com/20161005/n469621490.shtml#杨光的快乐生活2第7集$http://tv.sohu.com/20161005/n469621492.shtml#杨光的快乐生活2第8集$http://tv.sohu.com/20161005/n469621494.shtml#杨光的快乐生活2第9集$http://tv.sohu.com/20161005/n469621496.shtml#杨光的快乐生活2第10集$http://tv.sohu.com/20161005/n469621498.shtml#杨光的快乐生活2第11集$http://tv.sohu.com/20161005/n469621500.shtml#杨光的快乐生活2第12集$http://tv.sohu.com/20161005/n469621502.shtml#杨光的快乐生活2第13集$http://tv.sohu.com/20161005/n469621504.shtml#杨光的快乐生活2第14集$http://tv.sohu.com/20161005/n469621506.shtml#杨光的快乐生活2第15集$http://tv.sohu.com/20161005/n469621508.shtml#杨光的快乐生活2第16集$http://tv.sohu.com/20161005/n469621510.shtml#杨光的快乐生活2第17集$http://tv.sohu.com/20161005/n469621512.shtml#杨光的快乐生活2第18集$http://tv.sohu.com/20161005/n469621514.shtml#杨光的快乐生活 第一部$http://tv.sohu.com/item/ODY5OTU=.html杨光的快乐生活 第三部$http://tv.sohu.com/item/ODY5OTc=.html杨光的快乐生活 第四部$http://tv.sohu.com/item/ODY5OTg=.html杨光的快乐生活 第五部$http://tv.sohu.com/item/MTEwMDQ0OA==.html杨光的快乐生活 第六部$http://tv.sohu.com/it