INSERT INTO `mac_vod` VALUES('16754','前清秘史','','qianqingmishi','Q','','http://photocdn.sohu.com/kis/fengmian/1051/1051183/1051183_ver_big_20160922140004.jpg','http://photocdn.sohu.com/kis/fengmian/1051/1051183/1051183_ver_big_20160922140004.jpg','','佟佳/孟古/叶赫/李成梁','尤小刚','历史人物,纪录片,电视,故事,拍摄','24集全','大陆','国语','2007','12','',',442,','0','0','0','0','0','0','0','0','926440','0','0','0','0','0','0','8.0','0','83','1481692037','1482092566','0','0','《前清秘史》是一部采用情境再现形式拍摄的24集历史电视纪录片，不同于以往的所有历史纪录片，是独创的一种叙事样式的新品种，开辟了我国历史专题纪录片的崭新形式。它使用“尤小刚秘史剧系列”的所有素材和新拍摄的真人演绎再现历史情境，并加入大量历史遗迹、历史文档，讲述了明清两代自明朝万历至清朝雍正共9位皇帝、579位历史人物、236个历史故事。','sohu$$$youku','$$$','$$$','前清秘史第1集$http://tv.sohu.com/20161006/n469641454.shtml#前清秘史第2集$http://tv.sohu.com/20161006/n469641456.shtml#前清秘史第3集$http://tv.sohu.com/20161006/n469641458.shtml#前清秘史第4集$http://tv.sohu.com/20161006/n469641460.shtml#前清秘史第5集$http://tv.sohu.com/20161006/n469641462.shtml#前清秘史第6集$http://tv.sohu.com/20161006/n469641464.shtml#前清秘史第7集$http://tv.sohu.com/20161006/n469641466.shtml#前清秘史第8集$http://tv.sohu.com/20161006/n469641468.shtml#前清秘史第9集$http://tv.sohu.com/20161006/n469641471.shtml#前清秘史第10集$http://tv.sohu.com/20161006/n469641473.shtml#前清秘史第11集$http://tv.sohu.com/20161006/n469641475.shtml#前清秘史第12集$http://tv.sohu.com/20161006/n469641477.shtml#前清秘史第13集$http://tv.sohu.com/20161006/n469641479.shtml#前清秘史第14集$http://tv.sohu.com/20161006/n469641481.shtml#前清秘史第15集$http://tv.sohu.com/20161006/n469641483.shtml#前清秘史第16集$http://tv.sohu.com/20161006/n469641485.shtml#前清秘史第17集$http://tv.sohu.com/20161006/n469641487.shtml#前清秘史第18集$http://tv.sohu.com/20161006/n469641489.shtml#前清秘史第19集$http://tv.sohu.com/20161006/n469641491.shtml#前清秘史第20集$http://tv.sohu.com/20161006/n469641493.shtml#前清秘史第21集$http://tv.sohu.com/20161006/n469641495.shtml#前清秘史第22集$http://tv.sohu.com/20161006/n469641497.shtml#前清秘史第23集$http://tv.sohu.com/20161006/n469641499.shtml#前清秘史第24集$http://tv.sohu.com/20161006/n469641501.shtml$$$http://v.youku.com/v_show/id_XMTgzNDQxNTkzNg==.html#http://v.youku.c