INSERT INTO `mac_vod` VALUES('16755','杨光的快乐生活 第一部','共20集全','yangguangdekuaileshenghuodiyibu','Y','','http://photocdn.sohu.com/kis/fengmian/86/86995/86995_ver_big_20160926145503.jpg','http://photocdn.sohu.com/kis/fengmian/86/86995/86995_ver_big_20160926145503.jpg','','杨议/杨少华/韩兆/李立君/王继世','杨议','大龄青年,女朋友,老父亲,铅笔厂,大发','共20集全','大陆','国语','2004','12','',',444,','0','0','0','0','0','0','0','0','302536','0','0','0','0','0','0','8.0','0','376','1481692038','1481692038','0','0','家住天津的大龄青年杨光(杨议饰)和老父亲杨丰年(杨少华饰)住在市中心一幢老旧的二层小楼里，他原本在铅笔厂工作，收入一般，好在稳定平和，却不知怎么稀里糊涂就下岗成了无业人员。本来就和女朋友夏丽(李立君饰)的关系捉摸不定，若即若离，这一来更是为了美好的婚姻前程蒙上了阴影。为了谋求生计，杨光开始四下寻找工作，在此期间却遭遇了无数离奇有趣的人和事，比如仗义善良的老板黄大发、奸诈狡猾的碰瓷者(赵津生饰)、妈妈例儿超多的刺儿头老姑(胡可瑜饰)，令杨光的生活充满了几多麻烦与欢乐。','sohu','','','杨光的快乐生活1第1集$http://tv.sohu.com/20161005/n469621437.shtml#杨光的快乐生活1第2集$http://tv.sohu.com/20161005/n469621439.shtml#杨光的快乐生活1第3集$http://tv.sohu.com/20161005/n469621441.shtml#杨光的快乐生活1第4集$http://tv.sohu.com/20161005/n469621443.shtml#杨光的快乐生活1第5集$http://tv.sohu.com/20161005/n469621445.shtml#杨光的快乐生活1第6集$http://tv.sohu.com/20161005/n469621447.shtml#杨光的快乐生活1第7集$http://tv.sohu.com/20161005/n469621449.shtml#杨光的快乐生活1第8集$http://tv.sohu.com/20161005/n469621451.shtml#杨光的快乐生活1第9集$http://tv.sohu.com/20161005/n469621453.shtml#杨光的快乐生活1第10集$http://tv.sohu.com/20161005/n469621456.shtml#杨光的快乐生活1第11集$http://tv.sohu.com/20161005/n469621458.shtml#杨光的快乐生活1第12集$http://tv.sohu.com/20161005/n469621462.shtml#杨光的快乐生活1第13集$http://tv.sohu.com/20161005/n469621464.shtml#杨光的快乐生活1第14集$http://tv.sohu.com/20161005/n469621466.shtml#杨光的快乐生活1第15集$http://tv.sohu.com/20161005/n469621468.shtml#杨光的快乐生活1第16集$http://tv.sohu.com/20161005/n469621470.shtml#杨光的快乐生活1第17集$http://tv.sohu.com/20161005/n469621472.shtml#杨光的快乐生活1第18集$http://tv.sohu.com/20161005/n469621474.shtml#杨光的快乐生活1第19集$http://tv.sohu.com/20161005/n469621476.shtml#杨光的快乐生活1第20集$http://tv.sohu.com/20161005/n469621478.shtml#杨光的快乐生活 第二部$http://tv.sohu.com/item/Nzc1MTY=.html杨光的快乐生活 第三部$http://tv.sohu.com/item/ODY5OTc=.html杨光的快乐生活 第四部$http://tv.sohu.co