INSERT INTO `mac_vod` VALUES('16756','清官巧断家务事','','qingguanqiaoduanjiawushi','Q','','http://photocdn.sohu.com/kis/fengmian/60/60319/60319_ver_big_20160927112003.jpg','http://photocdn.sohu.com/kis/fengmian/60/60319/60319_ver_big_20160927112003.jpg','','郭德纲/于谦/姜超/彭玉/崔奕','王宏桥','家务事,故事,矛盾,喜剧,影响','60集全','大陆','国语','2008','12','',',457,','0','0','0','0','0','0','0','0','293519','0','0','0','0','0','0','1.0','0','95','1481692038','1482092545','0','0','古代某县城的县令郭台和父母、丫环、师爷、衙役同住在衙门之内，他们之间不断地因为误解发生着有趣的故事。郭台喜欢老夫人的丫环虎妞，但是老夫人受旧观念的影响，为了郭台的仕途坚决不同意俩人结为秦晋之好，为此郭台和虎妞与老夫人之间矛盾不断，老太爷和老夫人一心想让郭台谋求更大的官位，但是郭台与他们的想法不一样，为此时不时地发生冲突。郭台断案表面糊涂，但是，每次都能断的清正廉明。衙门里的于师爷没事时全是主意，等到正事时，出的全是馊主意，给郭台找了不少的麻烦。县城有个地绅鲍瑜，为霸一方，经常做出恶事，郭台每次都能惩恶扬善，给鲍瑜教训。衙门里来来往往的客人，围绕着他们也不时出现喜剧故事，比如：书圣茂才到衙门里来，老夫人为了不让郭台和虎妞相好，要将虎妞介绍给书生茂才成亲，郭台巧用计谋让茂才娶了赵财主的女儿，将虎妞继续留在了衙门之内。','sohu$$$qq$$$youku','$$$$$$','$$$$$$','清官巧断家务事第1集$http://tv.sohu.com/20161005/n469622310.shtml#清官巧断家务事第2集$http://tv.sohu.com/20161005/n469622317.shtml#清官巧断家务事第3集$http://tv.sohu.com/20161005/n469622325.shtml#清官巧断家务事第4集$http://tv.sohu.com/20161005/n469622334.shtml#清官巧断家务事第5集$http://tv.sohu.com/20161005/n469622341.shtml#清官巧断家务事第6集$http://tv.sohu.com/20161005/n469622350.shtml#清官巧断家务事第7集$http://tv.sohu.com/20161005/n469622357.shtml#清官巧断家务事第8集$http://tv.sohu.com/20161005/n469622366.shtml#清官巧断家务事第9集$http://tv.sohu.com/20161005/n469622382.shtml#清官巧断家务事第10集$http://tv.sohu.com/20161005/n469622393.shtml#清官巧断家务事第11集$http://tv.sohu.com/20161005/n469622401.shtml#清官巧断家务事第12集$http://tv.sohu.com/20161005/n469622409.shtml#清官巧断家务事第13集$http://tv.sohu.com/20161005/n469622416.shtml#清官巧断家务事第14集$http://tv.sohu.com/20161005/n469622423.shtml#清官巧断家务事第15集$http://tv.sohu.com/20161005/n469622432.shtml#清官巧断家务事第16集$http://tv.sohu.com/20161005/n469622440.shtml#清官巧断家务事第17集$http://tv.sohu.com/20161005/n469622448.shtml#清官巧断家务事第18集$http://tv.sohu.com/20161005/n469622458.shtml#清官巧断家务事第19集$http://tv.sohu.com/20161005/n469622468.shtml#清官巧断家务事第20集$http://tv.sohu.com/20161005/n469622477.shtml#清官巧断家务事第21集$http://