INSERT INTO `mac_vod` VALUES('16757','暗战','','anzhan','A','','http://photocdn.sohu.com/kis/fengmian/1090/1090113/1090113_ver_big_20160926144503.jpg','http://photocdn.sohu.com/kis/fengmian/1090/1090113/1090113_ver_big_20160926144503.jpg','','王庆祥/奚美娟/金鑫/李宗翰/陈思诚','刘新','贩毒集团,贩毒组织,公安局,支队长,英雄','腾讯高清','大陆','国语','2003','12','',',396,','0','0','0','0','0','0','0','0','815163','0','0','0','0','0','0','10.0','0','256','1481692038','1482347529','0','0','这是一个描绘我公安干警与境内外贩毒组织进行殊死斗争、甘为人民洒尽热血的英雄故事。十年前，时任龙兴市公安局缉毒支队支队长的骆成龙得到情报，大宗毒品要转运到龙兴市，骆成龙亲自出马指挥围捕行动。他的儿子，也就是龙兴市公安局特警大队队长骆树英奉命配合缉毒支队行动。由于骆成龙固执己见，导致行动失败。省厅派人调查情况，骆树英如实反映了实情。骆成龙最终接受处分，离开了岗位。骆成龙迁怒与儿子，从此跟骆树英形同陌路。十年后，我警方为了打击以女毒枭穆吉春为首的境外贩毒集团，委任骆树英出任龙兴市缉毒支队队长一职。骆树英上任的第一天，副支队长纪言德接到卧底情报后，抓捕了毒贩坤马和阿敢，毒品虽被缴获，坤马却自爆身亡。','sohu$$$youku$$$qq','$$$$$$','$$$$$$','暗战（2003）第1集$http://tv.sohu.com/20161005/n469621369.shtml#暗战（2003）第2集$http://tv.sohu.com/20161005/n469621376.shtml#暗战（2003）第3集$http://tv.sohu.com/20161005/n469621385.shtml#暗战（2003）第4集$http://tv.sohu.com/20161005/n469621389.shtml#暗战（2003）第5集$http://tv.sohu.com/20161005/n469621392.shtml#暗战（2003）第6集$http://tv.sohu.com/20161005/n469621396.shtml#暗战（2003）第7集$http://tv.sohu.com/20161005/n469621398.shtml#暗战（2003）第8集$http://tv.sohu.com/20161005/n469621400.shtml#暗战（2003）第9集$http://tv.sohu.com/20161005/n469621402.shtml#暗战（2003）第10集$http://tv.sohu.com/20161005/n469621405.shtml#暗战（2003）第11集$http://tv.sohu.com/20161005/n469621408.shtml#暗战（2003）第12集$http://tv.sohu.com/20161005/n469621414.shtml#暗战（2003）第13集$http://tv.sohu.com/20161005/n469621416.shtml#暗战（2003）第14集$http://tv.sohu.com/20161005/n469621418.shtml#暗战（2003）第15集$http://tv.sohu.com/20161005/n469621422.shtml#暗战（2003）第16集$http://tv.sohu.com/20161005/n469621424.shtml#暗战（2003）第17集$http://tv.sohu.com/20161005/n469621426.shtml#暗战（2003）第18集$http://tv.sohu.com/20161005/n469621429.shtml#暗战（2003）第19集$http://tv.sohu.com/20161005/n469621431.shtml#暗战（2003）第20集$http://tv.sohu.com/20161005/n469621433.shtml#暗战（2003）第21集$http://tv.sohu.com/20161005/n469621435.shtml$$$htt