INSERT INTO `mac_vod` VALUES('16758','山水友相逢','','shanshuiyouxiangfeng','S','','http://photocdn.sohu.com/kis/fengmian/1093/1093373/1093373_ver_big_20160927104503.jpg','http://photocdn.sohu.com/kis/fengmian/1093/1093373/1093373_ver_big_20160927104503.jpg','','蔡紫芬/黄俊英/阮星航/罗志敏/林以政','陈耀祥','国际旅行社,新同居时代,有限公司,现实生活,生活空间','208集全','大陆','国语','2000','12','',',444,','0','0','0','0','0','0','0','0','485059','0','0','0','0','0','0','10.0','0','226','1481692038','1482092566','0','0','本剧故事源于广州的现实生活，在风格上延续浓厚的广州风情，几乎每个广州人都可以在这里找到自己的影子：一群生活在广州不同阶层的人，带着各自不同的憧憬与追求，融入同一座的商厦打拼自己的将来。白天，“风云极”广告文化传播有限公司、“滋滋游”国际旅行社的连锁店以及“值得信”家政中心，是他们的事业平台，三家公司有着这样或是那样的联系，他们也在大厦的“煮楼”餐厅里聚会、聊天；夜晚，他们又在交叉的生活空间里延续着自己的喜怒哀乐—年轻的都市男女演绎着“四人房，单人床”新同居时代的故事；成家出现两代人传统与新潮的碰撞，还有一对互相算计的生意夫妻，因为情感、利益等问题矛盾频生，笑料不断……可谓是六组喜剧冲突“你方唱罢我登场”。','sohu$$$youku','$$$','$$$','山水友相逢第1集$http://tv.sohu.com/20161005/n469621735.shtml#山水友相逢第2集$http://tv.sohu.com/20161005/n469621737.shtml#山水友相逢第3集$http://tv.sohu.com/20161005/n469621740.shtml#山水友相逢第4集$http://tv.sohu.com/20161005/n469621742.shtml#山水友相逢第5集$http://tv.sohu.com/20161005/n469621744.shtml#山水友相逢第6集$http://tv.sohu.com/20161005/n469621748.shtml#山水友相逢第7集$http://tv.sohu.com/20161005/n469621750.shtml#山水友相逢第8集$http://tv.sohu.com/20161005/n469621752.shtml#山水友相逢第9集$http://tv.sohu.com/20161005/n469621754.shtml#山水友相逢第10集$http://tv.sohu.com/20161005/n469621756.shtml#山水友相逢第11集$http://tv.sohu.com/20161005/n469621759.shtml#山水友相逢第12集$http://tv.sohu.com/20161005/n469621761.shtml#山水友相逢第13集$http://tv.sohu.com/20161005/n469621763.shtml#山水友相逢第14集$http://tv.sohu.com/20161005/n469621766.shtml#山水友相逢第15集$http://tv.sohu.com/20161005/n469621768.shtml#山水友相逢第16集$http://tv.sohu.com/20161005/n469621770.shtml#山水友相逢第17集$http://tv.sohu.com/20161005/n469621772.shtml#山水友相逢第18集$http://tv.sohu.com/20161005/n469621774.shtml#山水友相逢第19集$http://tv.sohu.com/20161005/n469621776.shtml#山水友相逢第20集$http://tv.sohu.com/20161005/n469621778.shtml#山水友相逢第21集$http://tv.sohu.com/20161005/n469621780.shtml#山水友相逢第22集$http://tv.sohu.com/20161005/n4696217