INSERT INTO `mac_vod` VALUES('16759','崛起','共20集全','jueqi','J','','http://photocdn.sohu.com/kis/fengmian/1207/1207896/1207896_ver_big_20161009094014.jpg','http://photocdn.sohu.com/kis/fengmian/1207/1207896/1207896_ver_big_20161009094014.jpg','','冯绍峰/奚美娟/崔杰','刘新','开发项目,区政府,市政府,工程,建材','共20集全','大陆','国语','2004','12','',',406,','0','0','0','0','0','0','0','0','561443','0','0','0','0','0','0','1.0','0','294','1481692039','1481692039','0','0','一场百年不遇的狂风暴雨，区长高芳（奚美娟饰）与区政府干部虽奋力抢险，但不幸还是发生了，严重的工程质量问题，多宗屋毁人亡的惨剧，引起了市委、市政府的高度重视，风平浪静的表象下已暗流汹涌。市区大面积的工程重建列上了市政府的第一议事日程，巨额利益的驱动下，政界、商界各路人马相继粉墨登场，争抢开发项目、便用劣质建材、挪用工程资金、工程诈骗、施工扰民等问题使高芳不胜其重，而高芳的廉洁奉公终于使自己置身于权力场的风暴眼：涉嫌受贿50万，高芳被停职，市经委开始介入调查。一场权力界的狂风暴雨由此拉开。','sohu','','','崛起第1集$http://tv.sohu.com/20161005/n469621288.shtml#崛起第2集$http://tv.sohu.com/20161005/n469621293.shtml#崛起第3集$http://tv.sohu.com/20161005/n469621296.shtml#崛起第4集$http://tv.sohu.com/20161005/n469621302.shtml#崛起第5集$http://tv.sohu.com/20161005/n469621307.shtml#崛起第6集$http://tv.sohu.com/20161005/n469621310.shtml#崛起第7集$http://tv.sohu.com/20161005/n469621313.shtml#崛起第8集$http://tv.sohu.com/20161005/n469621315.shtml#崛起第9集$http://tv.sohu.com/20161005/n469621318.shtml#崛起第10集$http://tv.sohu.com/20161005/n469621322.shtml#崛起第11集$http://tv.sohu.com/20161005/n469621324.shtml#崛起第12集$http://tv.sohu.com/20161005/n469621328.shtml#崛起第13集$http://tv.sohu.com/20161005/n469621330.shtml#崛起第14集$http://tv.sohu.com/20161005/n469621333.shtml#崛起第15集$http://tv.sohu.com/20161005/n469621336.shtml#崛起第16集$http://tv.sohu.com/20161005/n469621340.shtml#崛起第17集$http://tv.sohu.com/20161005/n469621343.shtml#崛起第18集$http://tv.sohu.com/20161005/n469621346.shtml#崛起第19集$http://tv.sohu.com/20161005/n469621350.shtml#崛起第20集$http://tv.sohu.com/20161005/n469621352.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16760','追着幸福跑','','zhuizhouxingfupao','Z','','http://photocdn.sohu.com/kis/fengmian/52/52125/52125_ver_big_20160927111503.jpg','http://photocdn.sohu.com/kis/fengmian/52/52125/52125_ver_big_20160927111503.jpg','','郭德纲/雷恪生/彭玉/姜超/白桦','王宏桥','婚姻介绍所,郭德纲,家庭旅馆,劳务公司,麦当娜','60集全','大陆','国语','2008','12','',',477,','0','0','0','0','0','0','0','0','245543','0','0','0','0','0','0','2.0','0','33','1481692039','1482092542','0','0','随着社会的飞速发展，工厂小工人李洪刚(郭德纲饰)光荣下岗。在这高不成低不就的年龄，洪刚左右为难，最后决定和发小胖头于(姜超饰)开一家名为“双双飞”的婚姻介绍所。所谓人倒霉喝凉水也塞牙，婚介所刚开张没多久，就跑来一个号称非小甜甜、麦当娜那样的美女不娶的大龄男青年(于谦饰)，几番搅扰过后，洪刚的婚介所关门大吉。他转而开劳务公司，当然霉运当头，最终仍以关张收场。不顾父亲李老爷子(雷恪生饰)的阻挠，洪刚将家里的四合院改为餐饮一体的家庭旅馆，胖头于也提着炒勺赶来助阵。一波三折过后，旅馆总算成立。洪刚除了每天应付各种各样奇怪的客人，还要不时调节老爹和丈母娘田姥姥(彭玉饰)的矛盾，当然，哄媳妇(史妍饰)开心也是首要任务之一。无论生活怎样艰辛，他仍旧坚定信念，追着幸福跑。','sohu$$$youku','$$$','$$$','追着幸福跑第1集$http://tv.sohu.com/20161005/n469622205.shtml#追着幸福跑第2集$http://tv.sohu.com/20161005/n469622211.shtml#追着幸福跑第3集$http://tv.sohu.com/20161005/n469622219.shtml#追着幸福跑第4集$http://tv.sohu.com/20161005/n469622225.shtml#追着幸福跑第5集$http://tv.sohu.com/20161005/n469622231.shtml#追着幸福跑第6集$http://tv.sohu.com/20161005/n469622237.shtml#追着幸福跑第7集$http://tv.sohu.com/20161005/n469622245.shtml#追着幸福跑第8集$http://tv.sohu.com/20161005/n469622253.shtml#追着幸福跑第9集$http://tv.sohu.com/20161005/n469622259.shtml#追着幸福跑第10集$http://tv.sohu.com/20161005/n469622268.shtml#追着幸福跑第11集$http://tv.sohu.com/20161005/n469622275.shtml#追着幸福跑第12集$http://tv.sohu.com/20161005/n469622281.shtml#追着幸福跑第13集$http://tv.sohu.com/20161005/n469622288.shtml#追着幸福跑第14集$http://tv.sohu.com/20161005/n469622294.shtml#追着幸福跑第15集$http://tv.sohu.com/20161005/n469622300.shtml#追着幸福跑第16集$http://tv.sohu.com/20161005/n469622306.shtml#追着幸福跑第17集$http://tv.sohu.com/20161005/n469622313.shtml#追着幸福跑第18集$http://tv.sohu.com/20161005/n469622321.shtml#追着幸福跑第19集$http://tv.sohu.com/20161005/n469622329.shtml#追着幸福跑第20集$http://tv.sohu.com/20161005/n469622336.shtml#追着幸福跑第21集$http://tv.sohu.com/20161005/n469622344.shtml#追着幸福跑第22集$http://tv.sohu.com/20161005/n46962