INSERT INTO `mac_vod` VALUES('16761','伏羲女娲','','fuxinvwa','F','','http://photocdn.sohu.com/kis/fengmian/202/202813/202813_ver_big_20160923200003.jpg','http://photocdn.sohu.com/kis/fengmian/202/202813/202813_ver_big_20160923200003.jpg','','黄志忠/荣蓉/王卫国/刘赫男/蒋欣','顾琴芳','雷神,八卦,婴儿,正义','17集全','大陆','国语','2000','12','',',83,','0','0','0','0','0','0','0','0','77759','0','0','0','0','0','0','8.0','0','55','1481692039','1482092554','0','0','蛮荒时代，在火山、洪水、野兽肆虐的环境之中，人类的部落之间为抢夺生存环境和生活资料而相互争斗、频繁厮杀。被雷神强暴的华胥，在激流中生下一个孩子，一条鳄鱼把婴儿驮到岸边。正祭祀的鹿部落救起了这个孩子，起名“伏羲”。伏羲长大后，在部落混战中主持正义扶贫弱，以仁爱之心博得了各部落拥戴，建立了强大的龙部落，并娶女娲为妻。随后，在与天斗、与地斗、与人斗的恶劣环境中，伏羲又发明了织网捕鱼，创制“八卦”，制定婚娶制度，为创建人类远古文化做出了巨大贡献。','sohu$$$qq$$$youku','$$$$$$','$$$$$$','伏羲女娲第1集$http://tv.sohu.com/20161005/n469621211.shtml#伏羲女娲第2集$http://tv.sohu.com/20161005/n469621214.shtml#伏羲女娲第3集$http://tv.sohu.com/20161005/n469621219.shtml#伏羲女娲第4集$http://tv.sohu.com/20161005/n469621223.shtml#伏羲女娲第5集$http://tv.sohu.com/20161005/n469621226.shtml#伏羲女娲第6集$http://tv.sohu.com/20161005/n469621230.shtml#伏羲女娲第7集$http://tv.sohu.com/20161005/n469621234.shtml#伏羲女娲第8集$http://tv.sohu.com/20161005/n469621238.shtml#伏羲女娲第9集$http://tv.sohu.com/20161005/n469621242.shtml#伏羲女娲第10集$http://tv.sohu.com/20161005/n469621246.shtml#伏羲女娲第11集$http://tv.sohu.com/20161005/n469621250.shtml#伏羲女娲第12集$http://tv.sohu.com/20161005/n469621254.shtml#伏羲女娲第13集$http://tv.sohu.com/20161005/n469621258.shtml#伏羲女娲第14集$http://tv.sohu.com/20161005/n469621262.shtml#伏羲女娲第15集$http://tv.sohu.com/20161005/n469621266.shtml#伏羲女娲第16集$http://tv.sohu.com/20161005/n469621270.shtml#伏羲女娲第17集$http://tv.sohu.com/20161005/n469621272.shtml$$$01$http://v.qq.com/x/cover/dsslwawkk8ky67g/d00214ygif4.html#02$http://v.qq.com/x/cover/dsslwawkk8ky67g/b0021h7xikq.html#03$http://v.qq.com/x/cover/dsslwawkk8ky67g/i0021il9oxn.html#04$http://v.qq.com/x/cover/dsslwawkk8ky67g/l002116ii6d.html#05$http://v.qq.com/x/cover/dsslwawkk8ky67g/r0021v692he.html#06$http://v.qq.com/x/cover/dsslwawkk8ky67g/s0021ubnc0b.html#07$http://v.qq.com/x/cover/dsslwawkk