INSERT INTO `mac_vod` VALUES('16762','小房东','','xiaofangdong','X','','http://photocdn.sohu.com/kis/fengmian/52/52126/52126_ver_big_20160927111002.jpg','http://photocdn.sohu.com/kis/fengmian/52/52126/52126_ver_big_20160927111002.jpg','','郭德纲/闫学晶/张二丹/侯耀华/陈创','许瑞生','家常菜,八里店村,四合院,门脸房,主人公','','大陆','国语','2006','12','',',20,','0','0','0','0','0','0','0','0','199475','0','0','0','0','0','0','3.0','0','302','1481692039','1482086360','0','0','城郊结合部八里店村住着一户姓刘的人家，主人公大号刘二喜，媳妇叫马大华，父亲叫刘四爷，堂弟刘有余，岳母马姥姥，过着自在悠闲的生活。刘家有一所四合院，几个门脸房。刘二喜把门脸房租给堂弟刘有余开店，刘有余外号半膘子，做事不着调，热热闹闹开业，开张不过几天，就撂挑子不干了。刘二喜赶鸭子上架，接手开“小房东家常菜”，为了解决流动资金的问题，把院里另几间空屋也租了出去，刘二喜成为有产有业的小房东，刘二喜一家的平静生活被打破。','sohu$$$qq','$$$','$$$','小房东第1集$http://tv.sohu.com/20161005/n469622001.shtml#小房东第2集$http://tv.sohu.com/20161005/n469622006.shtml#小房东第3集$http://tv.sohu.com/20161005/n469622012.shtml#小房东第4集$http://tv.sohu.com/20161005/n469622019.shtml#小房东第5集$http://tv.sohu.com/20161005/n469622025.shtml#小房东第6集$http://tv.sohu.com/20161005/n469622031.shtml#小房东第7集$http://tv.sohu.com/20161005/n469622037.shtml#小房东第8集$http://tv.sohu.com/20161005/n469622043.shtml#小房东第9集$http://tv.sohu.com/20161005/n469622049.shtml#小房东第10集$http://tv.sohu.com/20161005/n469622056.shtml#小房东第11集$http://tv.sohu.com/20161005/n469622062.shtml#小房东第12集$http://tv.sohu.com/20161005/n469622067.shtml#小房东第13集$http://tv.sohu.com/20161005/n469622073.shtml#小房东第14集$http://tv.sohu.com/20161005/n469622077.shtml#小房东第15集$http://tv.sohu.com/20161005/n469622081.shtml#小房东第16集$http://tv.sohu.com/20161005/n469622085.shtml#小房东第17集$http://tv.sohu.com/20161005/n469622090.shtml#小房东第18集$http://tv.sohu.com/20161005/n469622094.shtml#小房东第19集$http://tv.sohu.com/20161005/n469622097.shtml#小房东第20集$http://tv.sohu.com/20161005/n469622103.shtml#小房东第21集$http://tv.sohu.com/20161005/n469622107.shtml#小房东第22集$http://tv.sohu.com/20161005/n469622111.shtml#小房东第23集$http://tv.sohu.com/20161005/n469622115.shtml#小房东第24集$http://tv.sohu.com/20161005/n469622119.shtml#小房东第25集$http://tv.sohu.com/20161005/n469622123.shtml#小房东第26集$http: