INSERT INTO `mac_vod` VALUES('16763','神厨','','shenchu','S','','http://photocdn.sohu.com/kis/fengmian/68/68980/68980_ver_big_20160923195503.jpg','http://photocdn.sohu.com/kis/fengmian/68/68980/68980_ver_big_20160923195503.jpg','','亲测网资源社区如/达式常/邢岷山/程前/陈述','范元','杭州,骆驼,秘密','36集全','大陆','国语','1998','12','',',65,','0','0','0','0','0','0','0','0','411039','0','0','0','0','0','0','3.0','0','371','1481692040','1482092570','0','0','身怀绝技、家学渊源的庖厨刘善东(邢岷山饰)西域学艺后到中原寻亲，与落难的关东飞盗陈福、李聪、小机灵鱼鳅(贾林饰)误入皇家禁苑，并偷食十九阿哥的猎鹿被抓。眼看人头落地，刘善东120道菜的“全羊席”让康熙(达式常饰)、众阿哥刮目相看，保全了众好汉性命；一席“西域烤全骆驼”更令大清国威大振，使心存二念的土克图大汗俯首称臣。皇宫大内，无奈做了皇上御厨的善东无心贪恋富贵，归心似箭，一片孝心终于感动康熙，恩准回乡探亲。父亲向他传授了厨艺绝学-飞鸾刀法，临终前，父亲再三嘱托他即刻赶往杭州寻找师伯，“我不是你爹，你是……”未及说出隐藏多年的秘密，老人就撒手归西。带着心中疑团和无尽悲哀，善东踏上了艰辛的寻亲之路。','sohu$$$qq$$$youku','$$$$$$','$$$$$$','神厨第1集$http://tv.sohu.com/20161005/n469621145.shtml#神厨第2集$http://tv.sohu.com/20161005/n469621149.shtml#神厨第3集$http://tv.sohu.com/20161005/n469621152.shtml#神厨第4集$http://tv.sohu.com/20161005/n469621156.shtml#神厨第5集$http://tv.sohu.com/20161005/n469621160.shtml#神厨第6集$http://tv.sohu.com/20161005/n469621163.shtml#神厨第7集$http://tv.sohu.com/20161005/n469621167.shtml#神厨第8集$http://tv.sohu.com/20161005/n469621171.shtml#神厨第9集$http://tv.sohu.com/20161005/n469621175.shtml#神厨第10集$http://tv.sohu.com/20161005/n469621179.shtml#神厨第11集$http://tv.sohu.com/20161005/n469621183.shtml#神厨第12集$http://tv.sohu.com/20161005/n469621187.shtml#神厨第13集$http://tv.sohu.com/20161005/n469621191.shtml#神厨第14集$http://tv.sohu.com/20161005/n469621194.shtml#神厨第15集$http://tv.sohu.com/20161005/n469621196.shtml#神厨第16集$http://tv.sohu.com/20161005/n469621198.shtml#神厨第17集$http://tv.sohu.com/20161005/n469621200.shtml#神厨第18集$http://tv.sohu.com/20161005/n469621202.shtml#神厨第19集$http://tv.sohu.com/20161005/n469621204.shtml#神厨第20集$http://tv.sohu.com/20161005/n469621206.shtml#神厨第21集$http://tv.sohu.com/20161005/n469621208.shtml#神厨第22集$http://tv.sohu.com/20161005/n469621210.shtml#神厨第23集$http://tv.sohu.com/20161005/n469621215.shtml#神厨第24集$http://tv.sohu.com/20161005/n469621218.