INSERT INTO `mac_vod` VALUES('16764','常开笑口','','changkaixiaokou','C','','http://photocdn.sohu.com/kis/fengmian/1207/1207921/1207921_ver_big_20161009094023.jpg','http://photocdn.sohu.com/kis/fengmian/1207/1207921/1207921_ver_big_20161009094023.jpg','','唐杰忠/杨少华/郝爱民/刘亚津','郝凌云','历史人物,轻喜剧,数来宝,小人物,艺术性','32集全','大陆','国语','2013','12','',',444,','0','0','0','0','0','0','0','0','953680','0','0','0','0','0','0','7.0','0','420','1481692040','1482092542','0','0','相声轻喜剧《常开笑口》是以中国传统相声为蓝本，在搜集的近三百部传统相声段子中，精心挑选了32个内容健康、艺术性佳，群众喜闻乐见的段子，去其糟粕、取之精华加以改编创作而成。其中有反映市井人物百态的《钓鱼》、《拔牙》、《琴棋书画》、《王二爷》、《酒迷》、《白吃》、《王宝钏洗澡》；有针砭时弊的《糊涂县官》、《三性人》、《家兄》；有展现历史人物才华的传说故事《解学士》、《吃元宵》、《两吃鱼》；也有展现民间传统手艺的《卖布头》、《怯拉车》、《当行论》、《怯算命》、《灯下神术》；还有描写小人物智慧的《巧嘴媒婆》、《皮匠招亲》、《扒马褂》、《数来宝》、《黄半仙》、《丢驴吃药》、《淘气儿》、《训徒》、《贼说话》、《三近视》等。','sohu$$$youku','$$$','$$$','常开笑口第1集$http://tv.sohu.com/20161005/n469621918.shtml#常开笑口第2集$http://tv.sohu.com/20161005/n469621922.shtml#常开笑口第3集$http://tv.sohu.com/20161005/n469621926.shtml#常开笑口第4集$http://tv.sohu.com/20161005/n469621931.shtml#常开笑口第5集$http://tv.sohu.com/20161005/n469621934.shtml#常开笑口第6集$http://tv.sohu.com/20161005/n469621938.shtml#常开笑口第7集$http://tv.sohu.com/20161005/n469621942.shtml#常开笑口第8集$http://tv.sohu.com/20161005/n469621946.shtml#常开笑口第9集$http://tv.sohu.com/20161005/n469621951.shtml#常开笑口第10集$http://tv.sohu.com/20161005/n469621955.shtml#常开笑口第11集$http://tv.sohu.com/20161005/n469621961.shtml#常开笑口第12集$http://tv.sohu.com/20161005/n469621965.shtml#常开笑口第13集$http://tv.sohu.com/20161005/n469621969.shtml#常开笑口第14集$http://tv.sohu.com/20161005/n469621973.shtml#常开笑口第15集$http://tv.sohu.com/20161005/n469621978.shtml#常开笑口第16集$http://tv.sohu.com/20161005/n469621982.shtml#常开笑口第17集$http://tv.sohu.com/20161005/n469621985.shtml#常开笑口第18集$http://tv.sohu.com/20161005/n469621989.shtml#常开笑口第19集$http://tv.sohu.com/20161005/n469621993.shtml#常开笑口第20集$http://tv.sohu.com/20161005/n469621998.shtml#常开笑口第21集$http://tv.sohu.com/20161005/n469622002.shtml#常开笑口第22集$http://tv.sohu.com/20161005/n469622008.shtml#常开笑口第23集$http://tv.sohu.com/