INSERT INTO `mac_vod` VALUES('16765','相逢何必曾相识','','xiangfenghebizengxiangshi','X','','http://photocdn.sohu.com/kis/fengmian/192/192416/192416_ver_big_20160923195002.jpg','http://photocdn.sohu.com/kis/fengmian/192/192416/192416_ver_big_20160923195002.jpg','','杨幂/林佑威/江宏恩/董璇/秦风','谭友业','马来西亚,物换星移,日军轰炸,实习生,医学院','36集全','大陆','国语','2011','12','',',478,','0','0','0','0','0','0','0','0','461033','0','0','0','0','0','0','9.0','0','84','1481692040','1482092566','0','0','抗日战争末期，厦门的一天黄昏，医学院学生何美纪正准备回校，在桥上遇到日军轰炸，急忙躲闪间，来自马来西亚的华侨实习生林志祥奋不顾身地上前紧紧抱住美纪，自己却被炮弹熏得满脸黑烟，志祥和美纪在等待轰炸过去的时光中互生情愫。他们相约，如果能躲过这场轰炸，明晚会在初次相逢的桥上约会。志祥所就读的学校突然宣布撤离，志祥因此没能赴晚上与美纪的约会。志祥撤离来到桥边时，取下自己胸前的名牌，放在桥边。晚上美纪到来看到志祥的名牌上沾满了血迹，心情非常难过，她担心着志祥的生死。战争结束后，在拥挤的火车战，美纪重遇志祥，看到志祥还活着，美纪心里又喜又忧，因为虽然她心里一直放不下志祥，但一切都已物换星移，人事全非，战争带给这对恋人却是永远的遗憾。','sohu$$$youku','$$$','$$$','相逢何必曾相识第1集$http://tv.sohu.com/20161005/n469621078.shtml#相逢何必曾相识第2集$http://tv.sohu.com/20161005/n469621084.shtml#相逢何必曾相识第3集$http://tv.sohu.com/20161005/n469621087.shtml#相逢何必曾相识第4集$http://tv.sohu.com/20161005/n469621091.shtml#相逢何必曾相识第5集$http://tv.sohu.com/20161005/n469621096.shtml#相逢何必曾相识第6集$http://tv.sohu.com/20161005/n469621100.shtml#相逢何必曾相识第7集$http://tv.sohu.com/20161005/n469621104.shtml#相逢何必曾相识第8集$http://tv.sohu.com/20161005/n469621108.shtml#相逢何必曾相识第9集$http://tv.sohu.com/20161005/n469621112.shtml#相逢何必曾相识第10集$http://tv.sohu.com/20161005/n469621114.shtml#相逢何必曾相识第11集$http://tv.sohu.com/20161005/n469621116.shtml#相逢何必曾相识第12集$http://tv.sohu.com/20161005/n469621118.shtml#相逢何必曾相识第13集$http://tv.sohu.com/20161005/n469621120.shtml#相逢何必曾相识第14集$http://tv.sohu.com/20161005/n469621122.shtml#相逢何必曾相识第15集$http://tv.sohu.com/20161005/n469621124.shtml#相逢何必曾相识第16集$http://tv.sohu.com/20161005/n469621126.shtml#相逢何必曾相识第17集$http://tv.sohu.com/20161005/n469621128.shtml#相逢何必曾相识第18集$http://tv.sohu.com/20161005/n469621130.shtml#相逢何必曾相识第19集$http://tv.sohu.com/20161005/n469621132.shtml#相逢何必曾相识第20集$http://tv.sohu.com/20161005/n469621134.shtml#相逢何必曾相识第21集$http://tv.sohu.com/20161005/n469621136.shtml#相逢何必曾