INSERT INTO `mac_vod` VALUES('16766','游戏规则','','youxiguize','Y','','http://photocdn.sohu.com/kis/fengmian/1207/1207917/1207917_ver_big_20161009094019.jpg','http://photocdn.sohu.com/kis/fengmian/1207/1207917/1207917_ver_big_20161009094019.jpg','','王庆祥/何晴/王志飞','黄净伟','新世纪,主人公,丰满,情感,游戏','28集全','大陆','国语','2000','12','',',406,','0','0','0','0','0','0','0','0','359852','0','0','0','0','0','0','1.0','0','107','1481692041','1482092557','0','0','通过描写在新世纪的经济大潮中，两个公司在业务上的竞争，四个主人公在经历金钱与道德的冲突、较量、爱恨的纠缠后，回归道德与人性的正常轨道来的故事，塑造了郑琳、林信达、沈尼青、方缉珠等一批鲜活生动、血肉丰满、情感充沛的艺术形象。剧中反映了生活最真实的一面，角色也是生活典型的提炼。正可谓屏前人笑说屏中的理，戏里的我走近戏外的你，屏外屏中心感动，戏里戏外情相融。','sohu$$$youku','$$$','$$$','游戏规则(2000)第1集$http://tv.sohu.com/20161005/n469621647.shtml#游戏规则(2000)第2集$http://tv.sohu.com/20161005/n469621652.shtml#游戏规则(2000)第3集$http://tv.sohu.com/20161005/n469621655.shtml#游戏规则(2000)第4集$http://tv.sohu.com/20161005/n469621659.shtml#游戏规则(2000)第5集$http://tv.sohu.com/20161005/n469621663.shtml#游戏规则(2000)第6集$http://tv.sohu.com/20161005/n469621667.shtml#游戏规则(2000)第7集$http://tv.sohu.com/20161005/n469621671.shtml#游戏规则(2000)第8集$http://tv.sohu.com/20161005/n469621675.shtml#游戏规则(2000)第9集$http://tv.sohu.com/20161005/n469621679.shtml#游戏规则(2000)第10集$http://tv.sohu.com/20161005/n469621683.shtml#游戏规则(2000)第11集$http://tv.sohu.com/20161005/n469621687.shtml#游戏规则(2000)第12集$http://tv.sohu.com/20161005/n469621691.shtml#游戏规则(2000)第13集$http://tv.sohu.com/20161005/n469621695.shtml#游戏规则(2000)第14集$http://tv.sohu.com/20161005/n469621699.shtml#游戏规则(2000)第15集$http://tv.sohu.com/20161005/n469621704.shtml#游戏规则(2000)第16集$http://tv.sohu.com/20161005/n469621706.shtml#游戏规则(2000)第17集$http://tv.sohu.com/20161005/n469621709.shtml#游戏规则(2000)第18集$http://tv.sohu.com/20161005/n469621711.shtml#游戏规则(2000)第19集$http://tv.sohu.com/20161005/n469621713.shtml#游戏规则(2000)第20集$http://tv.sohu.com/20161005/n469621715.shtml#游戏规则(2000)第21集$http://tv.sohu.com/20161005/n469621717.shtml#游戏规则(2000)第22集$http://tv.sohu.com/20161005/n469621719.shtml#游戏规则(2000)第23集$http://tv.sohu.com/20161005