INSERT INTO `mac_vod` VALUES('16767','同年同月同日生','共34集全','tongniantongyuetongrisheng','T','','http://photocdn.sohu.com/kis/fengmian/94/94121/94121_ver_big_20160923194503.jpg','http://photocdn.sohu.com/kis/fengmian/94/94121/94121_ver_big_20160923194503.jpg','','富大龙/章贺/孙宁/瑛子/岳跃利','李平','一见钟情,安宁,江南,江山,录取','共34集全','大陆','国语','2006','12','',',363,','0','0','0','0','0','0','0','0','824008','0','0','0','0','0','0','4.0','0','254','1481692041','1481692041','0','0','民国初年，江南小镇青石街突遇狂风暴雨，雷电将保佑全镇祥和安宁的石碑“江山永和”击碎。按照族规，新的碑刻必须由同年同月同日生的一对金童子篆刻，并在其中一人娶亲的良辰吉日立上桥头。青石街人终于迎来了贺紫垣和周云亭这对金童子，两人都天生聪颖，长大后分别以文科和算学状元的优异成绩被高等师范学堂录取。临上学前，贺紫垣偶遇临村姑娘罗怡莲，一见钟情。','sohu','','','同年同月同日生第1集$http://tv.sohu.com/20161005/n469621002.shtml#同年同月同日生第2集$http://tv.sohu.com/20161005/n469621007.shtml#同年同月同日生第3集$http://tv.sohu.com/20161005/n469621013.shtml#同年同月同日生第4集$http://tv.sohu.com/20161005/n469621017.shtml#同年同月同日生第5集$http://tv.sohu.com/20161005/n469621021.shtml#同年同月同日生第6集$http://tv.sohu.com/20161005/n469621025.shtml#同年同月同日生第7集$http://tv.sohu.com/20161005/n469621029.shtml#同年同月同日生第8集$http://tv.sohu.com/20161005/n469621033.shtml#同年同月同日生第9集$http://tv.sohu.com/20161005/n469621037.shtml#同年同月同日生第10集$http://tv.sohu.com/20161005/n469621041.shtml#同年同月同日生第11集$http://tv.sohu.com/20161005/n469621045.shtml#同年同月同日生第12集$http://tv.sohu.com/20161005/n469621048.shtml#同年同月同日生第13集$http://tv.sohu.com/20161005/n469621051.shtml#同年同月同日生第14集$http://tv.sohu.com/20161005/n469621053.shtml#同年同月同日生第15集$http://tv.sohu.com/20161005/n469621055.shtml#同年同月同日生第16集$http://tv.sohu.com/20161005/n469621057.shtml#同年同月同日生第17集$http://tv.sohu.com/20161005/n469621059.shtml#同年同月同日生第18集$http://tv.sohu.com/20161005/n469621061.shtml#同年同月同日生第19集$http://tv.sohu.com/20161005/n469621063.shtml#同年同月同日生第20集$http://tv.sohu.com/20161005/n469621065.shtml#同年同月同日生第21集$http://tv.sohu.com/20161005/n469621067.shtml#同年同月同日生第22集$http://tv.sohu.com/20161005/n469621069.shtml#同年同月同日生第23集$http://tv.sohu.com/20161005/n469621071.shtml#同年同月同日生第24集$http://tv.sohu.com/20161005/n469621073.shtm