INSERT INTO `mac_vod` VALUES('16768','关中女人','共32集全','guanzhongnvren','G','','http://photocdn.sohu.com/kis/fengmian/70/70569/70569_ver_big_20160923193503.jpg','http://photocdn.sohu.com/kis/fengmian/70/70569/70569_ver_big_20160923193503.jpg','','苏廷石/王茜华/舒耀宣/李进荣/孙大川','陈权','生育能力,大儿子,龙凤胎,雷鸣','共32集全','大陆','国语','2006','12','',',362,','0','0','0','0','0','0','0','0','149554','0','0','0','0','0','0','8.0','0','242','1481692043','1481692043','0','0','民国时期，关中名医金郎中，因受诬陷下药不当将剿匪司令何雷鸣妻子致死，被逼全家跪行为何妻送葬。金郎中为洗血耻，带大儿子金治国和土匪田川挖掘何家祖坟，意外得到珍贵的秘方。金郎中顿生恶意，将田川埋在坟中，但却将其子收养。金治国无生育能力，为了家族的兴盛，金郎中强迫二儿子金保国与大儿媳荷花同房，生下一子。土匪为报杀父之仇抢夺了何家刚刚出生的龙凤胎，两个孩子一个落入匪巢，一个流落金家。','sohu','','','关中女人第1集$http://tv.sohu.com/20161005/n469620925.shtml#关中女人第2集$http://tv.sohu.com/20161005/n469620931.shtml#关中女人第3集$http://tv.sohu.com/20161005/n469620938.shtml#关中女人第4集$http://tv.sohu.com/20161005/n469620942.shtml#关中女人第5集$http://tv.sohu.com/20161005/n469620947.shtml#关中女人第6集$http://tv.sohu.com/20161005/n469620951.shtml#关中女人第7集$http://tv.sohu.com/20161005/n469620958.shtml#关中女人第8集$http://tv.sohu.com/20161005/n469620963.shtml#关中女人第9集$http://tv.sohu.com/20161005/n469620966.shtml#关中女人第10集$http://tv.sohu.com/20161005/n469620974.shtml#关中女人第11集$http://tv.sohu.com/20161005/n469620976.shtml#关中女人第12集$http://tv.sohu.com/20161005/n469620979.shtml#关中女人第13集$http://tv.sohu.com/20161005/n469620982.shtml#关中女人第14集$http://tv.sohu.com/20161005/n469620984.shtml#关中女人第15集$http://tv.sohu.com/20161005/n469620986.shtml#关中女人第16集$http://tv.sohu.com/20161005/n469620988.shtml#关中女人第17集$http://tv.sohu.com/20161005/n469620990.shtml#关中女人第18集$http://tv.sohu.com/20161005/n469620993.shtml#关中女人第19集$http://tv.sohu.com/20161005/n469620995.shtml#关中女人第20集$http://tv.sohu.com/20161005/n469620997.shtml#关中女人第21集$http://tv.sohu.com/20161005/n469620999.shtml#关中女人第22集$http://tv.sohu.com/20161005/n469621001.shtml#关中女人第23集$http://tv.sohu.com/20161005/n469621005.shtml#关中女人第24集$http://tv.sohu.com/20161005/n469621012.shtml#关中女人第25集$http://tv.sohu.com/20161005/n469621016.shtml#关中女人第26集$