INSERT INTO `mac_vod` VALUES('16770','关中男人','','guanzhongnanren','G','','http://photocdn.sohu.com/kis/fengmian/43/43239/43239_ver_big_20160923193003.jpg','http://photocdn.sohu.com/kis/fengmian/43/43239/43239_ver_big_20160923193003.jpg','','王千源/卓子/邓瑛/杨明娜/李进荣','李小亭','爱国主义,未婚妻,二杆子,西安人,运输队','','大陆','国语','2007','12','',',416,','0','0','0','0','0','0','0','0','188349','0','0','0','0','0','0','5.0','0','378','1481692043','1482086442','0','0','名门浪子王长安在抗日浪潮激励下，挺身而出，参加了抗日支前运输队。凭着“二杆子”的性格，误打误撞，都顺利完成了任务，一时被西安人誉为“福将”。一次巧遇他喜欢上秦腔名旦金月华，当得知金月华是抗日前线副团长谢大龙的未婚妻时，生性放荡豪爽的他竟不管不顾强行抢亲，致使王、谢两家旧日矛盾爆发。日军为实现战略目的，派特工潜入西安，妄图破坏后方补给线，欲将金月华组织的抗战将士家属慰问团绑架到中条山，以瓦解陕军将士的抗战意志。以王长安为首的关中男人不惜生命危险，与日军展开斗智斗勇较量，全部壮烈献身，胜利保护慰问团的安全，完成上级交给的任务，谱写了一曲爱国主义的英雄赞歌。','sohu$$$qq','$$$','$$$','关中男人第1集$http://tv.sohu.com/20161005/n469620830.shtml#关中男人第2集$http://tv.sohu.com/20161005/n469620835.shtml#关中男人第3集$http://tv.sohu.com/20161005/n469620840.shtml#关中男人第4集$http://tv.sohu.com/20161005/n469620850.shtml#关中男人第5集$http://tv.sohu.com/20161005/n469620852.shtml#关中男人第6集$http://tv.sohu.com/20161005/n469620855.shtml#关中男人第7集$http://tv.sohu.com/20161005/n469620859.shtml#关中男人第8集$http://tv.sohu.com/20161005/n469620863.shtml#关中男人第9集$http://tv.sohu.com/20161005/n469620869.shtml#关中男人第10集$http://tv.sohu.com/20161005/n469620875.shtml#关中男人第11集$http://tv.sohu.com/20161005/n469620885.shtml#关中男人第12集$http://tv.sohu.com/20161005/n469620889.shtml#关中男人第13集$http://tv.sohu.com/20161005/n469620891.shtml#关中男人第14集$http://tv.sohu.com/20161005/n469620893.shtml#关中男人第15集$http://tv.sohu.com/20161005/n469620895.shtml#关中男人第16集$http://tv.sohu.com/20161005/n469620897.shtml#关中男人第17集$http://tv.sohu.com/20161005/n469620899.shtml#关中男人第18集$http://tv.sohu.com/20161005/n469620901.shtml#关中男人第19集$http://tv.sohu.com/20161005/n469620903.shtml#关中男人第20集$http://tv.sohu.com/20161005/n469620905.shtml#关中男人第21集$http://tv.sohu.com/20161005/n469620907.shtml#关中男人第22集$http://tv.sohu.com/20161005/n469620909.shtml#关中男人第23集$http://tv.sohu.com/20161005/n469620911.shtml#关中男人第24集$http://tv.so