INSERT INTO `mac_vod` VALUES('16771','女娲传说之灵珠（TV版）','共36集全','nvwachuanshuozhilingzhuTVban','N','','http://photocdn.sohu.com/kis/fengmian/90/90761/90761_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/90/90761/90761_ver_big.jpg','','钟欣潼/蒋毅/刘庭羽/蒲巴甲/朱紫汶','蔡晶胜','女娲传说,考古学家,穿越时空,钟欣桐,蒲巴甲','共36集全','大陆','国语','2011','12','',',480,','0','0','0','0','0','0','0','0','688705','0','0','0','0','0','0','3.0','0','92','1481692044','1481692044','0','0','丁瑶(钟欣桐饰)：女，22岁，考古学家丁勉博士的女儿，历史系学生。丁瑶本为三千年前女娲传人仙乐转世，但她自己并不知情！丁瑶是一个容貌平常(打扮起来很漂亮)；资质平常。什么都很平常却开朗乐观的女孩儿！丁勉教授从南越古洞里挖出当年祭祀问卦用的九星轮，丁瑶在帮父亲做研究课题时误入九星轮，结果穿越时空回到了三千年前，并在古洞里遇到了被封印的问天(蒲巴甲饰)。她救下问天的同时得到能够令天下群妖丧胆的镇妖瓶，引得各路妖魔前来抢夺，混乱中，镇妖瓶破碎，化为九颗灵珠散落四方，引得三界震动。丁瑶为弥补自己的过失，毅然决定与问天一起去寻找九灵珠！一场前世今生的恋情就此展开。　　仙乐(钟欣桐饰)：女，上古大神女娲嫡传弟子，南越国女祭祀，使用兵器：仙笛。仙乐是女娲传人，心怀慈悲，眼见上古年间，人间混乱，妖魔为祸，她毅然恳请天帝让自己下界拯救苍生。仙乐下界除妖，在女娲神殿请出镇妖瓶，终平三界之乱，使人间恢复太平。仙乐留恋人间，于是请旨永驻人间，成为南国大祭祀。仙乐一直为人间驱除妖魔，拯救苍生，直到一天她遇见了问天，仙乐第一次尝到了爱情的滋味，正当她准备放弃神籍，与问天长相厮守时，阴谋发生了。','sohu','','','女娲传说之灵珠第1集$http://tv.sohu.com/20160930/n469461678.shtml#女娲传说之灵珠第2集$http://tv.sohu.com/20160930/n469461703.shtml#女娲传说之灵珠第3集$http://tv.sohu.com/20160930/n469461711.shtml#女娲传说之灵珠第4集$http://tv.sohu.com/20160930/n469461719.shtml#女娲传说之灵珠第5集$http://tv.sohu.com/20160930/n469461729.shtml#女娲传说之灵珠第6集$http://tv.sohu.com/20160930/n469461740.shtml#女娲传说之灵珠第7集$http://tv.sohu.com/20160930/n469461748.shtml#女娲传说之灵珠第8集$http://tv.sohu.com/20160930/n469461754.shtml#女娲传说之灵珠第9集$http://tv.sohu.com/20160930/n469461760.shtml#女娲传说之灵珠第10集$http://tv.sohu.com/20160930/n469461765.shtml#女娲传说之灵珠第11集$http://tv.sohu.com/20160930/n469461774.shtml#女娲传说之灵珠第12集$http://tv.sohu.com/20160930/n469461778.shtml#女娲传说之灵珠第13集$http://tv.sohu.com/20160930/n469461782.shtml#女娲传说之灵珠第14集$http://tv.sohu.com/20160930/n469461786.shtml#女娲传说之灵珠第15集$http://tv.sohu.com/20160930/n469461791.shtml#女娲传说之灵珠第16集$http://tv.sohu.com/20160930/n469461799.shtml#女娲传说之灵珠第17集$http://tv.sohu.com/20160930/n469461805.shtml#女娲传说之灵珠第18集$http://tv.sohu.com/20160930/n469461822.shtml#女娲传说之灵珠第19集$http://tv.sohu.com/201