INSERT INTO `mac_vod` VALUES('20579','异形魔怪','','yixingmoguai','Y','','http://puui.qpic.cn/vcover_vt_pic/0/bs8hhd9zkf7y2hit1447590629.jpg/220','http://puui.qpic.cn/vcover_vt_pic/0/bs8hhd9zkf7y2hit1447590629.jpg/220','','凯文·贝肯/弗莱德·沃德/Finn/Carter','罗恩·安德伍德','恐怖事件,年轻人,巴斯特,新生活,米奇','腾讯高清','美国','英语','0','1','',',1518,','0','0','0','0','0','0','0','0','739732','0','0','0','0','0','0','8.0','0','181','1481777301','1482347635','0','0','在一个名为“完美”的宁静小镇上，米奇（凯文·贝肯 Kevin Bacon 饰）和死党巴斯特（弗莱德·沃德 Fred Ward 饰）又度过了属于他们的平静一天。对于在这个无趣的小镇里从事着一份又一份没有前途，仅能糊口的工作这一事实，两个血气方刚的年轻人感到十分无奈和困扰。终于，他们决定要走出完美镇，开始他们多姿多彩的新生活，而就在此时，通向镇外的唯一一条公路莫名塌陷了，某些不详的征兆开始显现。\n早在数星期之前，镇上发生了家畜神秘失踪的恐怖事件，同时，地质系学生蕾贝卡（ 芬妮·卡特 Finn Carter 饰）发现小镇的地壳运动十分异常。现在，众人终于将这些纷乱的线索拼凑到了一起，在大家的脚下，黑不见光的地底，究竟是什么在蠢蠢欲动？\n        ','qq','','','腾讯高清$http://v.qq.com/x/cover/bs8hhd9zkf7y2hi/j0021qbj36i.html','','','','');
